INSERT INTO "movies" VALUES('tt0076759','Action, Adventure, Fantasy, Sci-Fi','George Lucas','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Star Wars: Episode IV - A New Hope','The Imperial Forces, under orders from cruel Darth Vader, hold Princess Leia hostage in their efforts to quell the rebellion against the Galactic Empire. Luke Skywalker and Han Solo, captain of the Millennium Falcon, work together with the companionable droid duo R2-D2 and C-3PO to rescue the beautiful princess, help the Rebel Alliance and restore freedom and justice to the Galaxy.',NULL,'8.6','');
INSERT INTO "movies" VALUES('tt0080684','Action, Adventure, Fantasy, Sci-Fi','Irvin Kershner','','Star Wars: Episode V - The Empire Strikes Back','Luke Skywalker, Han Solo, Princess Leia and Chewbacca face attack by the Imperial forces and its AT-AT walkers on the ice planet Hoth. While Han and Leia escape in the Millennium Falcon, Luke travels to Dagobah in search of Yoda. Only with the Jedi master''s help will Luke survive when the dark side of the Force beckons him into the ultimate duel with Darth Vader.',NULL,'8.7','[{"id": "0b60f2f38d7ef03db580c18d214a403eb0877b34"}, {"id": "0b60f2f35988f621775659dbb7ad784c3795d71b"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt0086190','Action, Adventure, Fantasy, Sci-Fi','Richard Marquand','','Star Wars: Episode VI - Return of the Jedi','Luke Skywalker battles horrible Jabba the Hut and cruel Darth Vader to save his comrades in the Rebel Alliance and triumph over the Galactic Empire. Han Solo and Princess Leia reaffirm their love and team with Chewbacca, Lando Calrissian, the Ewoks and the androids C-3PO and R2-D2 to aid in the disruption of the Dark Side and the defeat of the evil emperor.',NULL,'8.3','[{"id": "0b60f2f35988f621775659dbb7ad784c3795d71b"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt2488496','Action, Adventure, Sci-Fi','J.J. Abrams','','Star Wars: Episode VII - The Force Awakens','30 years after the defeat of Darth Vader and the Empire, Rey, a scavenger from the planet Jakku, finds a BB-8 droid that knows the whereabouts of the long lost Luke Skywalker. Rey, as well as a rogue stormtrooper and two smugglers, are thrown into the middle of a battle between the Resistance and the daunting legions of the First Order.',NULL,'7.9','[{"id": "0b60f2f35988f621775659dbb7ad784c3795d71b"}, {"id": "0b60f2f32d22f1f7187aa507e6d087ee4c91b6b9"}, {"id": "0b60f2f3246d44d437dc29c4d0f99414ceda6396"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt0120915','Action, Adventure, Fantasy, Sci-Fi','George Lucas','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Star Wars: Episode I - The Phantom Menace','The evil Trade Federation, led by Nute Gunray is planning to take over the peaceful world of Naboo. Jedi Knights Qui-Gon Jinn and Obi-Wan Kenobi are sent to confront the leaders. But not everything goes to plan. The two Jedi escape, and along with their new Gungan friend, Jar Jar Binks head to Naboo to warn Queen Amidala, but droids have already started to capture Naboo and the Queen is not safe there. Eventually, they land on Tatooine, where they become friends with a young boy known as Anakin Skywalker. Qui-Gon is curious about the boy, and sees a bright future for him. The group must now find a way of getting to Coruscant and to finally solve this trade dispute, but there is someone else hiding in the shadows. Are the Sith really extinct? Is the Queen really who she says she is? And what''s so special about this young boy?',NULL,'6.5','');
INSERT INTO "movies" VALUES('tt0121766','Action, Adventure, Fantasy, Sci-Fi','George Lucas','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Star Wars: Episode III - Revenge of the Sith','Near the end of the Clone Wars, Darth Sidious has revealed himself and is ready to execute the last part of his plan to rule the galaxy. Sidious is ready for his new apprentice, Darth Vader, to step into action and kill the remaining Jedi. Vader, however, struggles to choose the dark side and save his wife or remain loyal to the Jedi order.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt0121765','Action, Adventure, Fantasy, Sci-Fi','George Lucas','','Star Wars: Episode II - Attack of the Clones','Ten years after the invasion of Naboo, the Galactic Republic is facing a Separatist movement and the former queen and now Senator Padmé Amidala travels to Coruscant to vote on a project to create an army to help the Jedi to protect the Republic. Upon arrival, she escapes from an attempt to kill her, and Obi-Wan Kenobi and his Padawan Anakin Skywalker are assigned to protect her. They chase the shape-shifter Zam Wessell but she is killed by a poisoned dart before revealing who hired her. The Jedi Council assigns Obi-Wan Kenobi to discover who has tried to kill Amidala and Anakin to protect her in Naboo. Obi-Wan discovers that the dart is from the planet Kamino, and he heads to the remote planet. He finds an army of clones that has been under production for years for the Republic and that the bounty hunter Jango Fett was the matrix for the clones. Meanwhile Anakin and Amidala fall in love with each other, and he has nightmarish visions of his mother. They travel to his home planet, Tatooine, to see his mother, and he discovers that she has been abducted by Tusken Raiders. Anakin finds his mother dying, and he kills all the Tusken tribe, including the women and children. Obi-Wan follows Jango Fett to the planet Geonosis where he discovers who is behind the Separatist movement. He transmits his discoveries to Anakin since he cannot reach the Jedi Council. Who is the leader of the Separatist movement? Will Anakin receive Obi-Wan''s message? And will the secret love between Anakin and Amidala succeed?',NULL,'6.5','[{"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f39fe27a1a1aea6de3fb79a22eefa2bf20"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt0796366','Action, Adventure, Sci-Fi','J.J. Abrams','','Star Trek','On the day of James Kirk''s birth, his father dies on his damaged starship in a last stand against a Romulan mining vessel looking for Ambassador Spock, who in this time, has grown on Vulcan disdained by his neighbors for his half-human heritage. 25 years later, James T. Kirk has grown into a young rebellious troublemaker. Challenged by Captain Christopher Pike to realize his potential in Starfleet, he comes to annoy academy instructors like Commander Spock. Suddenly, there is an emergency on Vulcan and the newly-commissioned USS Enterprise is crewed with promising cadets like Nyota Uhura, Hikaru Sulu, Pavel Chekov and even Kirk himself, thanks to Leonard McCoy''s medical trickery. Together, this crew will have an adventure in the final frontier where the old legend is altered forever as a new version of the legend begins.',NULL,'7.9','[{"id": "0b60f2f3aa68a9c54c9df5376df66eb1a4f3fe7f"}, {"id": "0b60f2f35a158dc6d9c6a2024da15ab6ec6f56dc"}, {"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}]');
INSERT INTO "movies" VALUES('tt2527336','Action, Adventure, Fantasy, Sci-Fi','Rian Johnson','','Star Wars: Episode VIII - The Last Jedi','Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares for battle with the First Order.',NULL,'7.0','[{"id": "0b60f2f32904830ed7b5cda8e9f6fdfaf363814a"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt3748528','Action, Adventure, Sci-Fi','Gareth Edwards','','Rogue One: A Star Wars Story','All looks lost for the Rebellion against the Empire as they learn of the existence of a new super weapon, the Death Star. Once a possible weakness in its construction is uncovered, the Rebel Alliance must set out on a desperate mission to steal the plans for the Death Star. The future of the entire galaxy now rests upon its success.',NULL,'7.8','[{"id": "0b60f2f3f2864ef77d8513d16a611a3ded6303e6"}, {"id": "0b60f2f3f787ca6915679af7e6c12adac4b66b48"}, {"id": "0b60f2f3269b69a169ddf2fe8be18299e368b0e9"}, {"id": "0b60f2f3b437f8b86af8e652e3b5e9ffe4e9a090"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt1408101','Action, Adventure, Sci-Fi','J.J. Abrams','','Star Trek Into Darkness','When the USS Enterprise crew is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis. With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one-man weapon of mass destruction. As our space heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.',NULL,'7.7','[{"id": "0b60f2f3aa68a9c54c9df5376df66eb1a4f3fe7f"}, {"id": "0b60f2f35a158dc6d9c6a2024da15ab6ec6f56dc"}, {"id": "0b60f2f3e0016796e67b32cc16723d585165caf6"}, {"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}]');
INSERT INTO "movies" VALUES('tt2527338','Action, Adventure, Fantasy, Sci-Fi','J.J. Abrams','','Star Wars: Episode IX - The Rise of Skywalker','The surviving members of the resistance face the First Order once again, and the legendary conflict between the Jedi and the Sith reaches its peak bringing the Skywalker saga to its end.',NULL,'6.7','[{"id": "0b60f2f37dd9a9c9bc44e88259e254a4626904c1"}, {"id": "0b60f2f32d22f1f7187aa507e6d087ee4c91b6b9"}, {"id": "0b60f2f3698666f0b98af51d64c7f036ba6212cc"}, {"id": "0b60f2f336bda8ba5c3724ea229d5c0ac3db51d6"}, {"id": "0b60f2f37dd9a9c9bc44e88259e254a4626904c1"}, {"id": "0b60f2f32d22f1f7187aa507e6d087ee4c91b6b9"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt1517451','Drama, Music, Romance','Bradley Cooper','','A Star Is Born','Jackson Maine (Cooper), a country music star on the brink of decline, discovers a talented unknown named Ally (Germanotta). As the two begin a passionate love affair, Jackson coaxes Ally into the spotlight, catapulting her to stardom. But as Ally''s career quickly eclipses his own, Jack finds it increasingly hard to handle his fading glory.',NULL,'7.7','[{"id": "0b60f2f38729aa9efb4e5fd5d98df296ce92bdf2"}, {"id": "0b60f2f3a81c071cd02f48cce98b65e6f0c4e6f1"}, {"id": "0b60f2f3407cfca3b24ea81d559e575346e384da"}, {"id": "0b60f2f3fe6e7994882bb6ebe71e30ca6b1a99c9"}, {"id": "0b60f2f3bf87762af9fbe8965d04e6062fb9ffbe"}, {"id": "0b60f2f371c57a27eaa1c5d7d2229c97bb329a16"}, {"id": "0b60f2f343816286e53f7a7025bba6c4ea69a9c5"}, {"id": "0b60f2f355f09e9398fdea3557efe91176af5816"}, {"id": "0b60f2f3aee2e6db966a4a639f090387d7306e13"}]');
INSERT INTO "movies" VALUES('tt3778644','Action, Adventure, Sci-Fi','Ron Howard','','Solo: A Star Wars Story','During an adventure into the criminal underworld, Han Solo meets his future co-pilot Chewbacca and encounters Lando Calrissian years before joining the Rebellion.',NULL,'6.9','[{"id": "0b60f2f322b0f605b475f2b5d49b1107259823a7"}, {"id": "0b60f2f35988f621775659dbb7ad784c3795d71b"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt2660888','Action, Adventure, Sci-Fi, Thriller','Justin Lin','','Star Trek Beyond','After stopping off at Starbase Yorktown, a remote outpost on the fringes of Federation space, the USS Enterprise, halfway into their five-year mission, is destroyed by an unstoppable wave of unknown aliens. With the crew stranded on an unknown planet and with no apparent means of rescue, they find themselves fighting against a ruthless enemy with a well-earned hatred of the Federation and everything it stands for. Only a rebellious alien warrior can help them reunite and leave the planet to stop this deadly menace from beginning a possible galactic war.',NULL,'7.1','[{"id": "0b60f2f3f83143bd8775ef028a004fbc94bfa8d2"}, {"id": "0b60f2f3c906e92a399c372f3ea82f7bdda9ec70"}, {"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}]');
INSERT INTO "movies" VALUES('tt0117731','Action, Adventure, Drama, Sci-Fi, Thriller','Jonathan Frakes','','Star Trek: First Contact','In the 24th century, the crew of the Enterprise-E has been ordered to patrol the Romulan Neutral Zone by the Federation to avoid interference with their battle against the insidious Borg. Witnessing the loss of the battle, Captain Jean-Luc Picard ignores orders and takes command of the fleet engaging the Borg. But the Borg plan to travel back into the 21st century through a vortex with the intention to stop Earth''s first contact with an alien race (the Vulcans). Following the Borg sphere, Picard and his crew realize that they have taken over the Enterprise in order to carry out their mission. Their only chance to do away with the Borg and their seductive queen is to make sure that Zefram Cochrane makes his famous faster-than-light travel to the stars.',NULL,'7.6','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f359228645d7c8b9c1d135fa63e1be3e91"}, {"id": "0b60f2f36225f51bfb83f4cc8558c0383c4ab015"}, {"id": "0b60f2f346b47c58b507f78e4599e88dfb02a952"}, {"id": "0b60f2f36225f51bfb83f4cc8558c0383c4ab015"}, {"id": "0b60f2f346b47c58b507f78e4599e88dfb02a952"}]');
INSERT INTO "movies" VALUES('tt0084726','Action, Adventure, Sci-Fi','Nicholas Meyer','','Star Trek II: The Wrath of Khan','It is the 23rd century. Admiral James T. Kirk is an instructor at Starfleet Academy and feeling old; the prospect of attending his ship, the USS Enterprise--now a training ship--on a two-week cadet cruise does not make him feel any younger. But the training cruise becomes a deadly serious mission when his nemesis Khan Noonien Singh--infamous conqueror from late 20th century Earth--appears after years of exile. Khan later revealed that the planet Ceti Alpha VI exploded, and shifted the orbit of the fifth planet as a Mars-like haven. He begins capturing Project Genesis, a top secret device holding the power of creation itself, and schemes the utter destruction of Kirk.',NULL,'7.7','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f39e4d7afff686defce6e7bed210da4d25"}, {"id": "0b60f2f3d8e9584ca0601f4506fe37ca3a9b62bb"}, {"id": "0b60f2f3d8e9584ca0601f4506fe37ca3a9b62bb"}]');
INSERT INTO "movies" VALUES('tt0092455','Action, Adventure, Mystery, Sci-Fi','N/A','0b60f2f38bf80dbebe43a1854547b0af6a19fb11','Star Trek: The Next Generation','Set in the 24th century and decades after the adventures of the original crew of the starship Enterprise, this new series is the long-awaited successor to the original Star Trek (1966). Under the command of Captain Jean-Luc Picard, the all new Enterprise NCC 1701-D travels out to distant planets to seek out new life and to boldly go where no one has gone before.',NULL,'8.6','');
INSERT INTO "movies" VALUES('tt5171438','Action, Adventure, Drama, Sci-Fi','N/A','','Star Trek: Discovery','Ten years before Kirk, Spock, and the Enterprise, the USS Discovery discovers new worlds and lifeforms as one Starfleet officer learns to understand all things alien.',NULL,'7.3','[{"id": "0b60f2f3d303b7eac76f46bb326068845b117829"}, {"id": "0b60f2f35a158dc6d9c6a2024da15ab6ec6f56dc"}]');
INSERT INTO "movies" VALUES('tt0079945','Adventure, Mystery, Sci-Fi','Robert Wise','','Star Trek','A massive alien spacecraft of enormous power destroys three powerful Klingon cruisers, entering Federation space. Admiral James T. Kirk is ordered to take command of the USS Enterprise for the first time since her historic five-year mission. The Epsilon IX space station alerts the Federation, but they are also destroyed by the alien spacecraft. The only starship in range is the Enterprise--after undergoing a major overhaul at Spacedock on Earth. Kirk rounds up the rest of his crew, and acquires some new members, and sets off to intercept the alien spacecraft. However, it has been there years since Kirk last commanded the Enterprise... is he up to the task of saving Earth?',NULL,'6.4','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f32bda9c9d5a287b8a9f1cc27b03b3657b"}, {"id": "0b60f2f31eb231cb76af73512ca66c35446118f0"}]');
INSERT INTO "movies" VALUES('tt0092007','Adventure, Comedy, Sci-Fi','Leonard Nimoy','','Star Trek IV: The Voyage Home','The most acclaimed Star Trek adventure of all time with an important message. It is the 23rd century, and a mysterious alien probe is threatening Earth by evaporating the oceans and destroying the atmosphere. In their frantic attempt to save mankind, Admiral Kirk and his crew must time travel back to 1986 San Francisco where they find a world of punk, pizza and exact-change buses that are as alien to them as anything they have ever encountered in the far-off reaches of the galaxy. William Shatner and Leonard Nimoy return as Kirk and Spock, along with the entire Star Trek crew.',NULL,'7.3','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f369d1ddbe61384187bc0b15383debc5e4"}, {"id": "0b60f2f39e4d7afff686defce6e7bed210da4d25"}, {"id": "0b60f2f33b824c0a939379fa1a15bd6b96b6178a"}, {"id": "0b60f2f3b6a7d26f570c176622d194a876ee0a46"}, {"id": "0b60f2f39e4d7afff686defce6e7bed210da4d25"}, {"id": "0b60f2f331163952425b22201eaa3a533cc62090"}]');
INSERT INTO "movies" VALUES('tt0111280','Action, Adventure, Mystery, Sci-Fi, Thriller','David Carson','','Star Trek: Generations','In the late 23rd century, the gala maiden voyage of the newly-christened Enterprise-B boasts such luminaries as Pavel Chekov, Montgomery Scott and the legendary Captain James T. Kirk as guests. But her maiden voyage turns into a disaster as the unprepared starship is forced to rescue two transport ships from a mysterious energy ribbon. The Enterprise manages to save a handful of the ships'' passengers and barely succeeds out intact... but at the cost of Captain Kirk''s life. 78 years later, Captain Jean-Luc Picard and the Enterprise-D crew find themselves at odds with renegade scientist Dr. Tolian Soran... who is destroying entire star systems. Only one man can help Picard stop Soran''s scheme... and he has been dead for 78 years.',NULL,'6.6','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f359228645d7c8b9c1d135fa63e1be3e91"}, {"id": "0b60f2f346b47c58b507f78e4599e88dfb02a952"}, {"id": "0b60f2f36225f51bfb83f4cc8558c0383c4ab015"}, {"id": "0b60f2f346b47c58b507f78e4599e88dfb02a952"}, {"id": "0b60f2f36225f51bfb83f4cc8558c0383c4ab015"}]');
INSERT INTO "movies" VALUES('tt0088170','Action, Adventure, Sci-Fi','Leonard Nimoy','','Star Trek III: The Search for Spock','In the wake of Spock''s ultimate deed of sacrifice, Admiral Kirk and the Enterprise crew return to Earth for some essential repairs to their ship. When they arrive at Spacedock, they are shocked to discover that the Enterprise is to be decommissioned. Even worse, Dr. McCoy begins acting strangely and Scotty has been reassigned to another ship. Kirk is forced to steal back the Enterprise and head across space to the Genesis Planet to save Spock and bring him to Vulcan. Unknown to them, the Klingons are planning to steal the secrets of the Genesis Device for their own deadly purpose.',NULL,'6.7','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f39e4d7afff686defce6e7bed210da4d25"}]');
INSERT INTO "movies" VALUES('tt0253754','Action, Adventure, Sci-Fi, Thriller','Stuart Baird','','Star Trek: Nemesis','After a joyous wedding between William Riker and Deanna Troi, Captain Picard and the Enterprise crew stumble upon a mysterious signal which results in it being a prototype android who is the twin to Data. Then the Enterprise is invited to Romulus to negotiate peace with the Romulans by their new Praetor named Shinzon. However, Shinzon is revealed to be a clone of Picard who was raised on Remus, a slave planet to the Romulans. Later on, Picard discovers that this peace treaty was nothing more than a set-up due to the fact that Shinzon needs Picard in order to survive. But little do the Enterprise crew know that Shinzon also plans to do away with the Federation by unleashing a weapon that could destroy a whole planet.',NULL,'6.4','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f3e00a7e44e07bb34c063286c7eb9315a6"}, {"id": "0b60f2f359228645d7c8b9c1d135fa63e1be3e91"}, {"id": "0b60f2f3bd3071801c067f41bc4bfec8c5403f8e"}, {"id": "0b60f2f3e00a7e44e07bb34c063286c7eb9315a6"}]');
INSERT INTO "movies" VALUES('tt0060028','Action, Adventure, Sci-Fi','N/A','0b60f2f38bf80dbebe43a1854547b0af6a19fb11','Star Trek: The Original Series','The adventures of the USS Enterprise, representing the United Federation of Planets on a five-year mission in outer space to explore new worlds, seek new life and new civilizations, and to boldly go where no one has gone before. The Enterprise is commanded by handsome and brash Captain James T. Kirk. His First Officer and best friend is Mr. Spock from the planet Vulcan, and Kirk''s Medical Officer is Dr. Leonard "Bones" McCoy. With a crew of approximately 430, the Enterprise battles aliens, megalomaniacal computers, time paradoxes, psychotic murderers, and even Khan!',NULL,'8.3','');
INSERT INTO "movies" VALUES('tt0120844','Action, Adventure, Sci-Fi, Thriller','Jonathan Frakes','','Star Trek: Insurrection','While on a mission to observe the peaceful Ba''ku race, Lt. Commander Data suddenly behaves as if having to fear for his existence. The immortal Ba''ku, whose planet offers regenerative radiation and therefore incredible lifespans, live in harmony with nature and reject advanced technology. Their planet and their culture is secretly researched by the Federation associated with an alien race called the Son''a. But the Son''a intend to abduct the Ba''ku in order to take the planet for themselves and for the Starfleet officials who all would like to regenerate their bodies. But they did not think of the loyalty of Captain Jean-Luc Picard and the crew of the Enterprise-E to the Prime Directive.',NULL,'6.4','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f359228645d7c8b9c1d135fa63e1be3e91"}, {"id": "0b60f2f3457eb5061f8f7cab919ab67235c5d4cd"}, {"id": "0b60f2f3457eb5061f8f7cab919ab67235c5d4cd"}]');
INSERT INTO "movies" VALUES('tt0102975','Action, Adventure, Sci-Fi, Thriller','Nicholas Meyer','','Star Trek VI: The Undiscovered Country','After an explosion on their moon, the Klingons have an estimated 50 years before their ozone layer is completely depleted, and they all die. They have only one choice - to make peace with the Federation, which will mean an end to 70 years of conflict. Captain James T. Kirk and crew are called upon to help in the negotiations because of their experience with the Klingons. Peace talks don''t quite proceed, and Kirk and McCoy are convicted of assassinating the Klingon High Chancellor, and imprisoned on Rura Penthe, a snowy hard-labor prison camp. Will they manage to escape? And will there ever be peace with the Klingons?',NULL,'7.2','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f369d1ddbe61384187bc0b15383debc5e4"}, {"id": "0b60f2f38fae6648f0bcaf5057a69b9ffaf97b23"}, {"id": "0b60f2f3bf2af966d1f3f9cdc7a02eecdb43a0e1"}, {"id": "0b60f2f331163952425b22201eaa3a533cc62090"}, {"id": "0b60f2f32081b2e78e2ed98fded35c76d469b165"}]');
INSERT INTO "movies" VALUES('tt0112178','Action, Adventure, Sci-Fi','N/A','','Star Trek: Voyager','The Federation starship USS Voyager, chasing a band of Maquis rebels, enters the dangerous space nebula known as the Badlands. Both ships are transported by a distant space probe to the Delta Quadrant, 75,000 light-years from Federation space. Voyager''s crew and the Maquis form an uneasy truce to rescue crewmen of both ships, kidnapped by the probe''s builder, the powerful, dying Caretaker. The Maquis ship is destroyed in a battle with the warlike Kazons. To prevent a Kazon aggression against a helpless world, Voyager destroys the space probe. Without the probe, it will take 75 years for Voyager to travel back to Federation space. With the differences between them rendered meaningless by time and distance, The Federation and Maquis crews unite aboard Voyager. Together, they embark on their new mission: to boldly go - home.',NULL,'7.8','[{"id": "0b60f2f359228645d7c8b9c1d135fa63e1be3e91"}, {"id": "0b60f2f3457eb5061f8f7cab919ab67235c5d4cd"}, {"id": "0b60f2f3ea3fd0aa6d8db1645a71aff3d937cf3d"}]');
INSERT INTO "movies" VALUES('tt0098382','Action, Adventure, Fantasy, Sci-Fi, Thriller','William Shatner','','Star Trek V: The Final Frontier','When the newly-christened starship Enterprise''s shakedown cruise goes poorly, Captain Kirk and crew put her into Spacedock for repairs. But an urgent mission interrupts their Earth-bound shore leave. A renegade Vulcan named Sybok has taken three ambassadors hostage on Nimbus III, the Planet of Galactic Peace. This event also attracts the attention of a Klingon captain who wants to make a name for himself and sets out to pursue the Enterprise. Sybok''s ragtag army captures the Enterprise and takes her on a journey to the center of the galaxy in search of the Supreme Being.',NULL,'5.5','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f31d2ed5486a46a9e402db6834facf1bb2"}, {"id": "0b60f2f39e4d7afff686defce6e7bed210da4d25"}, {"id": "0b60f2f3accf917c294d65df1c30e69a878ace50"}, {"id": "0b60f2f3accf917c294d65df1c30e69a878ace50"}]');
INSERT INTO "movies" VALUES('tt1185834','Animation, Action, Adventure, Family, Fantasy, Sci-Fi','Dave Filoni','','Star Wars: The Clone Wars','As the Clone Wars sweep through the galaxy, the heroic Jedi Knights struggle to maintain order and restore peace. More and more systems are falling prey to the forces of the dark side as the Galactic Republic slips further and further under the sway of the Separatists and their never-ending droid army. Anakin Skywalker and his Padawan learner Ahsoka Tano find themselves on a mission with far-reaching consequences, one that brings them face-to-face with crime lord Jabba the Hutt. But Count Dooku and his sinister agents, including the nefarious Asajj Ventress, will stop at nothing to ensure that Anakin and Ahsoka fail at their quest. Meanwhile, on the front lines of the Clone Wars, Obi-Wan Kenobi and Master Yoda lead the massive clone army in a valiant effort to resist the forces of the dark side ...',NULL,'5.9','[{"id": "0b60f2f347164adcba8c19f4da4b8f2814ea0c0d"}, {"id": "0b60f2f3aa0bd04962fca3c65c5859839ab49eda"}, {"id": "0b60f2f3f338c0e36939ec3614568c94bfdb3992"}]');
INSERT INTO "movies" VALUES('tt0458290','Animation, Action, Adventure, Drama, Fantasy, Sci-Fi','N/A','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Star Wars: The Clone Wars','Jedi Knights lead the Grand Army of the Republic against the droid army of the Separatists.',NULL,'8.2','');
INSERT INTO "movies" VALUES('tt0106145','Action, Adventure, Drama, Sci-Fi','N/A','','Star Trek: Deep Space Nine','The stable wormhole discovered by the Deep Space Nine crew is known to the Bajoran people as the Celestial Temple of their Prophets. Sisko, as discoverer of the wormhole and its inhabitants, is therefore the Emissary of Bajoran prophesy. The wormhole''s other end is in the Gamma Quadrant, halfway around the galaxy from Bajor. That section of space is dominated by the malevolent Dominion. The Dominion is led by the Changelings, the race of shapeshifters to which Odo belongs. As of the beginning of the sixth season, Cardassia has joined the Dominion, and together they are waging war on the Federation and their Klingon allies. The war is quickly becoming the most costly war ever for the Federation, and the Deep Space Nine crew must fight to protect their way of life.',NULL,'7.9','[{"id": "0b60f2f359228645d7c8b9c1d135fa63e1be3e91"}, {"id": "0b60f2f3457eb5061f8f7cab919ab67235c5d4cd"}]');
INSERT INTO "movies" VALUES('tt0244365','Action, Adventure, Drama, Sci-Fi','N/A','','Star Trek: Enterprise','The year is 2151. Earth has spent the last 88 years since learning how to travel faster than the speed of light studying under the wisdom of their alien ally called the ''Vulcans''. Now, the first crew of human explorers sets out into deep space on a ship called the ''Enterprise'' to see what is beyond our solar system.',NULL,'7.5','[{"id": "0b60f2f359228645d7c8b9c1d135fa63e1be3e91"}, {"id": "0b60f2f36225f51bfb83f4cc8558c0383c4ab015"}]');
INSERT INTO "movies" VALUES('tt0202470','Drama, Music','Stephen Herek','0b60f2f305e3e0635dbdec84edf844c41f472f0a','Rock Star','Chris Cole was born to rock. His longtime girlfriend Emily believes his talent could take him all the way - but Chris worships at the altar of Bobby Beers, the fiery frontman for heavy metal legends Steel Dragon. By day, Chris still lives at home with his parents and spends his days repairing copy machines. But when Chris takes the stage, fronting Pennsylvania''s premiere Steel Dragon tribute band, all of that disappears. Chris Cole is Bobby Beers - mesmerizing audiences with his perfect imitation of Beers'' electrifying vocals. The night his bandmates boot him out of the group, Chris is devastated - until an unexpected phone call changes his life forever: He, Chris Cole, has been tapped to replace Bobby Beers as the lead singer of Steel Dragon. In an instant, Chris rockets to the dizzying heights of sudden stardom, rising from devotee to icon, from rock fan to rock god - the wanna-be who got to be. So what happens when an average guy gets everything he wants - and discovers it''s not enough?',NULL,'6.3','');
INSERT INTO "movies" VALUES('tt8806524','Action, Adventure, Drama, Sci-Fi','N/A','','Star Trek: Picard','Follow-up series to Star Trek: The Next Generation (1987) and Star Trek: Nemesis (2002) that centers on Jean-Luc Picard (Sir Patrick Stewart) in the next chapter of his life.',NULL,'7.7','[{"id": "0b60f2f3c612dfd8e888a0696f347b7a28ec5306"}, {"id": "0b60f2f37e9e97c2b83dacb57ee6e1d15d2232cd"}, {"id": "0b60f2f3efa3dea62a996ee98540e5db00a3b5d2"}, {"id": "0b60f2f35a158dc6d9c6a2024da15ab6ec6f56dc"}]');
INSERT INTO "movies" VALUES('tt0116905','Drama, Mystery','John Sayles','0b60f2f31c83aca8549d842a75b8ec84591afb17','Lone Star','John Sayles'' murder-mystery explores interpersonal and interracial tensions in Rio County, Texas. Sam Deeds is the local sheriff who is called to investigate a 40-year-old skeleton found in the desert....As Sam delves deeper into the town''s dark secrets, he begins to learn more about his father, the legendary former sheriff Buddy Deeds, who replaced the corrupt Charlie Wade. While Sam puzzles out the long-past events surrounding the mystery corpse, he also longs to rekindle a romance with his old high-school flame. Sayles'' complex characters are brought together as the tightly woven plot finally draws to its dramatic close.',NULL,'7.4','');
INSERT INTO "movies" VALUES('tt2930604','Animation, Action, Adventure, Family, Fantasy, Mystery, Sci-Fi','N/A','','Star Wars Rebels','An animated TV series set between the events of Episode III and IV, Star Wars Rebels takes place in a time where the Empire is securing its grip on the galaxy and hunting down the last of the Jedi Knights as a fledgling rebellion against the Empire is taking shape.',NULL,'8.0','[{"id": "0b60f2f37430702949d9ec90dfbfd3498e87de3d"}, {"id": "0b60f2f35f2ec215e4adb26fba2d933c40e44f50"}, {"id": "0b60f2f38dcbf64a10d50730022b1e3f99210b2e"}]');
INSERT INTO "movies" VALUES('tt0810784','Biography, Drama, Romance','Jane Campion','','Bright Star','It''s 1818 in Hampstead Village on the outskirts of London. Poet Charles Brown lives in one half of a house, the Dilkes family who live in the other half. Through their association with the Dilkes, the fatherless Brawne family know Mr. Brown. The Brawne''s eldest daughter, Fanny Brawne, and Mr. Brown don''t like each other. She thinks he''s arrogant and rude, and he feels that she is pretentious, knowing only how to sew (admittedly well as she makes all her own fashionable clothes), flirt and give opinions on subjects about which she knows nothing. Insecure struggling poet John Keats comes to live with his friend, Mr. Brown. Miss Brawne and Mr. Keats have a mutual attraction to each other, a relationship which however is slow to develop in part since Mr. Brown does whatever he can to keep the two apart. But other obstacles face the couple, including their eventual overwhelming passion for each other clouding their view of what the other does, Mr. Keats'' struggling career which offers him little in the way of monetary security (which will lead to Mrs. Brawne not giving consent for them to marry), and health issues which had earlier taken the life of Mr. Keats'' brother, Tom.',NULL,'6.9','[{"id": "0b60f2f30ed82c6016197afea8eed4903dd5dbc9"}, {"id": "0b60f2f30ed82c6016197afea8eed4903dd5dbc9"}, {"id": "0b60f2f3e33922b1e5b29bb7442b120c9b758415"}]');
INSERT INTO "movies" VALUES('tt0361243','Animation, Action, Adventure, Drama, Family, Fantasy, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars: Clone Wars','Immediately after the events of Star Wars: Episode II - Attack of the Clones (2002), the Clone Wars continue. The Separatists launch masses of Battle Droids while the Republic has an entire arsenal of Clone Troopers to blow them away. Obi-Wan Kenobi and his apprentice Anakin Skywalker are also participating in the fights against Count Dooku and his defiant separatists. Jedi Masters Yoda and Mace Windu, take part in the battle as well. While down on Coruscant, Padmé Amidala, Chancellor Palpatine, C-3PO and R2-D2 hope nothing but good for our heroes. Will the Republic emerge triumphant? Will Dooku and his separatists be brought to their knees? And will Anakin truly bring balance to the Force, or will he bring absolutely tyranny?',NULL,'7.8','');
INSERT INTO "movies" VALUES('tt0069945','Comedy, Sci-Fi','John Carpenter','','Dark Star','Low-budget story of four astronauts in deep space, whose mission is to destroy unstable planets in star systems which are to be colonised. The late Commander Powell is stored in deep freeze, where he is still able to offer advice. As their mission nears completion, they must cope with a runaway alien which resembles a beach-ball, faulty computer systems, and a "smart bomb" who thinks it is God.',NULL,'6.3','[{"id": "0b60f2f3e6e0d2cb6f55dc093eacd2dc8f2fe575"}, {"id": "0b60f2f38838c37f4ac3f7f9c900a78309e46052"}]');
INSERT INTO "movies" VALUES('tt2657262','Drama, Romance, Sci-Fi','N/A','0b60f2f366325b7410530c6cd4534a284232ec62','Star-Crossed','What starts out as a star crossed lovers story gradually changes focus to explore moral conflicts with integration and racism Both humans and aliens feel like they are the superior race so they fight each other to try to achieve the most power. The seven aliens and their families help each other out and take great risks to ensure their survival.',NULL,'7.3','');
INSERT INTO "movies" VALUES('tt0047522','Drama, Musical, Romance','George Cukor','','A Star Is Born','Norman Maine, a movie star whose career is on the wane, meets showgirl Esther Blodgett when he drunkenly stumbles into her act one night. A friendship develops, then blossoms into romance before tensions increase as Esther''s career takes off while Norman''s continues to plummet.',NULL,'7.6','[{"id": "0b60f2f3fe6e7994882bb6ebe71e30ca6b1a99c9"}, {"id": "0b60f2f389ef700882874a37e0fd075f51feeda3"}, {"id": "0b60f2f3f4e6a716cd65b591f93c4dfce109c42b"}, {"id": "0b60f2f3aee2e6db966a4a639f090387d7306e13"}, {"id": "0b60f2f355f09e9398fdea3557efe91176af5816"}, {"id": "0b60f2f3aee2e6db966a4a639f090387d7306e13"}]');
INSERT INTO "movies" VALUES('tt0325258','Comedy','Sam Weisman','','Dickie Roberts: Former Child Star','Once, he was on top of the world as a popular child actor on TV. Now, he''s Hollywood''s punchline about everything wrong with people who were famous as children. All Dickie Roberts wants to do is find that one gig that will restore his honor and everyone''s love of him, so after learning that Rob Reiner''s making an ambitious new movie destined to sweep the Oscars, Dickie''s first in line to audition. He walks out having learned he certainly looks the part but can''t act it... yet, owing to his very unusual childhood. To research the role, Dickie embarks on a bizarre scheme to live with a suburban family to see how the average American child lives, having them put him up as their "son". But once his gloves are off, Dickie discovers how great it is to be part of a true family, and whether he gets the part or not, his attempt at method acting will certainly change his life forever.',NULL,'5.5','[{"id": "0b60f2f36d166efa8f19deca40c804adcc6bda2b"}, {"id": "0b60f2f3b1ae873db030c51c3f8ff0ffb09bf7fb"}]');
INSERT INTO "movies" VALUES('tt1699114','Animation, Action, Sci-Fi','Sam Liu','','All-Star Superman','While saving the crew of the first manned mission to the sun, Superman is poisoned by solar radiation. Dying, he decides to fulfill his lifelong dreams, while still saving the Earth from various threats. But when Lex Luthor reveals his latest plot to control the world, Superman must use his remaining strength to stop him.',NULL,'7.0','[{"id": "0b60f2f3c5910716ab0cb3bc97b37c0b1f43d7fe"}, {"id": "0b60f2f3f8b91abc3859589a9ed16d125ebca0a1"}, {"id": "0b60f2f36bc0280e52e27c3e0932c4613485c5f5"}, {"id": "0b60f2f3b3ca6ff480057d4809379bddcde7579a"}, {"id": "0b60f2f32adc059321640eff53cb52b0f00184aa"}]');
INSERT INTO "movies" VALUES('tt0193524','Adventure, Family, Musical, Sci-Fi','Steve Binder, David Acomba','','The Star Wars Holiday Special','It is Life Day, a holiday that is celebrated on Chewbacca''s home planet Kashyyyk. Chewie and Han Solo are trying to get to the planet where Chewie''s family is waiting for him, but the Empire is out searching for the Rebels, giving everyone a hard time. While we are waiting we get a look at the everyday life of a Wookiee family. We meet all the familiar characters from Star Wars: Episode IV - A New Hope (1977) and we are introduced to Boba Fett during a short cartoon. We also pay a visit to the Cantina and meet all the monsters again.',NULL,'2.1','[{"id": "0b60f2f3709af63a61541bffcf52a77c0ec65ab3"}, {"id": "0b60f2f3b93f8a85d3690864351a0af5b3019ea6"}, {"id": "0b60f2f34887a3b3467573a8c76a7d73ad7ffd5a"}, {"id": "0b60f2f33c11b40cef9dbf9db0e066aa5c382ec7"}, {"id": "0b60f2f352d143eb81a65814104e97a743f03089"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt1411664','Comedy','Tom Brady','','Bucky Larson: Born to Be a Star','Living in small town Iowa, Bucky Larson is a simple minded, uneducated, beaver toothed young man still living with his protective parents, Jeremiah and Debbie Larson. Initially saddened when he is fired from his job as a bagger at a supermarket, he eventually sees it as a sign that he is destined for greatness in some other field. Based on some information he learns, Bucky believes that destiny is to become a porn star, despite he being a virgin and only having recently learned what masturbation is. With his parents'' blessing, Bucky hops on a bus to Los Angeles to make it big there as a porn star. He is taken under the wings of a few people in LA. On the professional side, he meets the reigning king of porn, Dick Shadow, who only sees in Bucky a laughing stock. But washed up porn director Miles Deep stumbles across what he sees as an untapped niche market for Bucky''s limited talents. Miles has the challenge of trying to convince investors who only see in Bucky the antithesis of porn. On the personal side, Bucky befriends a young diner waitress Kathy McGee, who helps Bucky find a place to live - albeit with an insensitive oaf named Gary who only wants to get into Kathy''s pants - and navigate general life in the big city. Kathy, however, is facing her own demons in working toward her destiny, those demons which Bucky hopes he can help her beat down.',NULL,'3.2','[{"id": "0b60f2f31921a92aaba20db744218e1f6da1b051"}, {"id": "0b60f2f3d3b7e6f5491d2e01eb31cc253e115750"}, {"id": "0b60f2f32630fdaeabafd05cd24788a6608348e8"}]');
INSERT INTO "movies" VALUES('tt4607112','Crime, Drama, Thriller','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Tin Star','Ex undercover UK cop turned police chief of a small town in the Canadian Rockies does what he must to defend his family from those in power whether it''s the oilmen, the preachers or the gangsters.',NULL,'7.3','');
INSERT INTO "movies" VALUES('tt2758770','Animation, Action, Adventure, Comedy, Drama, Family, Fantasy, Sci-Fi, Thriller','N/A','','Star vs. the Forces of Evil','An interdimensional princess, from the kingdom of Mewni, named Star Butterfly is sent to a new dimension, the Earth dimension, to learn how to use her newest possession, the royal family wand, and she finds help along the way meeting an Earth boy named Marco Diaz, and she lives with Marco and his parents causing all kinds of interdimensional mischief.',NULL,'8.0','[{"id": "0b60f2f3b53e4853b1adad6c3fc09c520a72d704"}, {"id": "0b60f2f3521195e4fdc1173fa9e884406ea7ab7d"}, {"id": "0b60f2f3214e130df48caf7065aed3f3c2abc809"}]');
INSERT INTO "movies" VALUES('tt0075265','Drama, Music, Romance','Frank Pierson','','A Star Is Born','Talented rock star John Norman Howard has seen his career begin to decline. Too many years of concerts and managers and life on the road have made him cynical and the monotony has taken its toll. Then he meets the innocent, pure and very talented singer Esther Hoffman. As one of his songs in the movie says "I''m gonna take you girl, I''m gonna show you how." And he does. He shows Esther the way to stardom while forsaking his own career. As they fall in love, her success only makes his decline even more apparent.',NULL,'6.2','[{"id": "0b60f2f3bf87762af9fbe8965d04e6062fb9ffbe"}, {"id": "0b60f2f371c57a27eaa1c5d7d2229c97bb329a16"}, {"id": "0b60f2f343816286e53f7a7025bba6c4ea69a9c5"}, {"id": "0b60f2f355f09e9398fdea3557efe91176af5816"}, {"id": "0b60f2f3aee2e6db966a4a639f090387d7306e13"}]');
INSERT INTO "movies" VALUES('tt0029606','Drama, Romance','William A. Wellman, Jack Conway','','A Star Is Born','Esther Blodgett is just another starry-eyed farm kid trying to break into the movies. Waitressing at a Hollywood party, she catches the eye of alcoholic star Norman Maine, is given a test, and is caught up in the Hollywood glamor machine (ruthlessly satirized). She and her idol Norman marry; but his career abruptly dwindles to nothing',NULL,'7.3','[{"id": "0b60f2f389ef700882874a37e0fd075f51feeda3"}, {"id": "0b60f2f3f4e6a716cd65b591f93c4dfce109c42b"}, {"id": "0b60f2f3aee2e6db966a4a639f090387d7306e13"}, {"id": "0b60f2f355f09e9398fdea3557efe91176af5816"}, {"id": "0b60f2f3aee2e6db966a4a639f090387d7306e13"}]');
INSERT INTO "movies" VALUES('tt0370754','Animation, Short, Drama, Romance, Sci-Fi','Makoto Shinkai','0b60f2f30a3e7c8fca940780b31e09c08b513bef','Voices of a Distant Star','The story of the high school students Mikako Nagamine and Noboru Terao. When the alien Tarsians attack, Mikako volunteers to be a pilot in the space force that will protect mankind. The lovers try to remain in contact using cellular telephone text messages, but as each battle takes Mikako further from the Earth, each message takes longer to arrive. Will their love stand the tests of time and distance?',NULL,'7.2','');
INSERT INTO "movies" VALUES('tt1020990','Animation, Short, Adventure, Comedy, Family, Sci-Fi','Seth Green','','Robot Chicken: Star Wars','The first of three Star Wars themed Robot Chicken parodies.',NULL,'8.1','[{"id": "0b60f2f3596f099a3c230af0af185fe640c9068d"}, {"id": "0b60f2f34b080d9a3ed2856b24eca74afdadedb4"}, {"id": "0b60f2f3bdcd1b6d4c475be3159d2ebb81916962"}, {"id": "0b60f2f3010dc1f17f3b8a539462b26b930c93a3"}, {"id": "0b60f2f3f3057866b931a1f319479307e6478acb"}, {"id": "0b60f2f32a291ec645c8cfce732ab2d422854212"}, {"id": "0b60f2f3cd08c0373a752d9c927becf2a8041ef6"}, {"id": "0b60f2f31da4003d4f1819f8aa0bc42da7c19f7c"}, {"id": "0b60f2f3062cbc9cf1199b034b6aeb8407c31ca4"}, {"id": "0b60f2f3b447149b28ca9f743a0fabe814424b01"}, {"id": "0b60f2f3bdcd1b6d4c475be3159d2ebb81916962"}, {"id": "0b60f2f31da4003d4f1819f8aa0bc42da7c19f7c"}]');
INSERT INTO "movies" VALUES('tt3469052','Comedy, Drama, Fantasy, Romance, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','My Love from Another Star','Do Min-Joon, an alien that came to our planet 400 years ago, will be able to return to his planet in 3 months, but when he meets famous actress Chun Song-Yi, all the centuries he spent distancing himself from humans come to an end.',NULL,'8.3','');
INSERT INTO "movies" VALUES('tt0286151','Action, Short, Comedy','Guy Ritchie','','Star','The Driver now carries an arrogant rock star who is visiting a major city (not Pittsburgh as earlier believed). Played by Madonna, this title character wants to get away from her bodyguards in the Driver''s BMW. He soon gets tired of her and decides to have a bit of fun.',NULL,'7.7','[{"id": "0b60f2f32bcae08a9418c8bf1da82bfd6b5772df"}, {"id": "0b60f2f3330957a161422f589d73e01db5872464"}]');
INSERT INTO "movies" VALUES('tt0118178','Comedy, Family, Fantasy','Blair Treu','0b60f2f3a5706728dae4312f4e69f7d5e1e74cca','Wish Upon a Star','Handsome, considerate high-school jock Kyle Harding is the only taste the Wheaton sisters share. Tall, fashionable, popular airhead big sister is dating him, but fails to truly appreciate the young gentleman, let alone contemplate a serious relationship. Nerdy kid sister Haley hates the waste and expresses her envy by thoughtlessly wishing at a ''shooting star'' (comet) to be Alexia. To their stupor, that happens the next morning. Forced to live each-other''s lives, but unable to do it well by the other''s standards, the sisters soon hate each-other even more and deliberately screw up. Gradually, they realize they would only both lose out, learn to appreciate the other''s values and reconsider their own. Remain the matters of obviously utterly confused Kyle, and new neighbor boy Simon, whose no longer secret crush on Haley was confounded by Alexia.',NULL,'6.7','');
INSERT INTO "movies" VALUES('tt1510906','Drama','Hattie Dalton','0b60f2f352156a1123613757ab2093afb0133b67','Third Star','James and his three closest lifelong friends go on an ill-advised trip to the stunning coastal area of Barafundle Bay in West Wales. What follows is a touching and comical adventure dealing with friendship, heroism and love.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt0086356','Crime, Drama, Mystery, Thriller','Peter Hyams','','The Star Chamber','Disgusted with criminals escaping the judicial system via technicalities, an idealistic young judge investigates an alternative method for punishing the guilty.',NULL,'6.3','[{"id": "0b60f2f3a2cc40cb092d51e3fc5fa308b931f031"}, {"id": "0b60f2f3d1d2d208976d7fc45799422e2dadeb8e"}, {"id": "0b60f2f3a2cc40cb092d51e3fc5fa308b931f031"}]');
INSERT INTO "movies" VALUES('tt4587656','Animation, Adventure, Comedy, Family, Fantasy','Timothy Reckart','','The Star','In Sony Pictures Animation''s THE STAR, a small but brave donkey named Bo yearns for a life beyond his daily grind at the village mill. One day he finds the courage to break free, and finally goes on the adventure of his dreams. On his journey, he teams up with Ruth, a lovable sheep who has lost her flock and Dave, a dove with lofty aspirations. Along with three wisecracking camels and some eccentric stable animals, Bo and his new friends follow the Star and become accidental heroes in the greatest story ever told - the first Christmas.',NULL,'6.2','[{"id": "0b60f2f36ea479ef22cb1f24c97f5343b8b47ef4"}, {"id": "0b60f2f322c996bbf66ff416fe3f0daa82b8a384"}, {"id": "0b60f2f36ea479ef22cb1f24c97f5343b8b47ef4"}]');
INSERT INTO "movies" VALUES('tt0142371','Animation, Action, Drama, Fantasy','Toyoo Ashida','','Fist of the North Star','After a nuclear holocaust tears the world apart, mankind is forced to the harshness of not only the oppression of others who are much more powerful, but the dead earth which seems to be getting worse with every passing moment. But a savior has risen from the ashes, a man who will defeat those who would torment the weak and make the world a livable place once more. A man named Kenshiro.....',NULL,'7.3','[{"id": "0b60f2f34a64dddbec8c01e384df728aa0035f43"}, {"id": "0b60f2f384df6900d578af85d1d049da83540a6e"}, {"id": "0b60f2f394cd470d9d921993ea9f63276bc61f6a"}]');
INSERT INTO "movies" VALUES('tt0472566','Action, Comedy, Sci-Fi','Timo Vuorensola','','Star Wreck: In the Pirkinning','The future looks bleak for Captain Pirk. Originally from the far future, he traveled back to save the world, but was shipwrecked on the 21st century. The world of the past is a dangerous place and he is finding it difficult to convince the ladies he is, in fact, an intergalactic space hero from the future. To make things right Pirk comes up with a questionable plan to save mankind''s future...',NULL,'6.6','[{"id": "0b60f2f3612acb33753ed19553bbcaaa40b84101"}, {"id": "0b60f2f37564c8e6badd9ae007d8e6135fb53009"}, {"id": "0b60f2f3a28ec0248262ec5dc45a5c9739642097"}, {"id": "0b60f2f37564c8e6badd9ae007d8e6135fb53009"}]');
INSERT INTO "movies" VALUES('tt0069637','Animation, Action, Adventure, Family, Sci-Fi','N/A','0b60f2f38bf80dbebe43a1854547b0af6a19fb11','Star Trek: The Animated Series','This animated series continues the adventures of the USS Enterprise, taking advantage of the visual freedom of animation to present stories with more alien elements.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt0086355','Biography, Drama','Bob Fosse','','Star 80','Paul Snider is a narcissistic, small time hustler who fancies himself a ladies man. His life changes when he meets Dorothy Stratten working behind the counter of a Dairy Queen. Dorothy is a pretty but naive high school senior. Paul immediately falls for Dorothy, who sees in Paul a wise, worldly person unlike herself. Paul believes Dorothy is Playboy material, the magazine he sees as only a springboard to bigger and better things. Paul''s dream does become a reality: not only does Dorothy eventually marry him, she becomes the August 1979 Playboy Playmate and ultimately Playboy Playmate of 1979, which does indeed lead to the start of an acting career. As Dorothy''s star rises, Paul''s life is one of a hanger-on as those in Dorothy''s new circle, including Playboy publisher Hugh M. Hefner and movie director Aram Nicholas, don''t much like Paul. Paul is unable to eke out a life of his own without using Dorothy''s name, which she increasingly is reluctant to provide to her husband. Those that know the couple know their relationship cannot continue as is, and it''s only a matter of how it will change or end is the question.',NULL,'6.7','[{"id": "0b60f2f33f5ffe00a01c1dd04d83fde6e38dc83f"}, {"id": "0b60f2f3db42fb3676f36995c2bb922a69e88ed5"}]');
INSERT INTO "movies" VALUES('tt0356070','Action, Adventure, Fantasy','Casey Hudson','','Star Wars: Knights of the Old Republic','Four thousand years before the fall of the Republic, before the fall of the Jedi, a great war was fought, between the armies of the Sith and the forces of the Republic. A warrior is chosen to rescue a Jedi with a power important to the cause of the Republic, but in the end, will the warrior fight for the Light Side of the Force, or succumb to the Darkness?',NULL,'9.6','[{"id": "0b60f2f3ee3a108dcd4de5aa0245a9b96755897f"}, {"id": "0b60f2f3bad5776e7da7c744740844ac2a8d3b99"}, {"id": "0b60f2f3c2ae782c19e70cac818424e5394fb4b4"}, {"id": "0b60f2f3c2ae782c19e70cac818424e5394fb4b4"}, {"id": "0b60f2f312eb05cf2df285152f7185dda2095062"}, {"id": "0b60f2f338c0a161fd6e6af2eb6c5a74caf84e88"}, {"id": "0b60f2f3aea187d8e2111380e9e13df070efa7b7"}, {"id": "0b60f2f34c1de2a37ad22d1a8b8118c29bbb2ea6"}, {"id": "0b60f2f3a5d4d974d53a7945eeb6ff166264a2cc"}]');
INSERT INTO "movies" VALUES('tt0114808','Drama, Romance','Giuseppe Tornatore','','The Star Maker','"Dottore" Joe Moretti travels round Sicily doing screen tests for the big Roman studios. He''s a conman and takes money or favours for his efforts. Beata, a young illiterate convent girl desperately wants to change her life and falls for him, belatedly he realises his feelings for her. Their love affair is doomed when he''s arrested.',NULL,'7.4','[{"id": "0b60f2f3f24f22d90c59791ab4d3ff867f99a5e8"}, {"id": "0b60f2f3bed5c5cb716632fac0c03eb4d5285362"}, {"id": "0b60f2f3f24f22d90c59791ab4d3ff867f99a5e8"}]');
INSERT INTO "movies" VALUES('tt6423362','Drama, Music, Romance','Ry Russo-Young','','The Sun Is Also a Star','A hopeless romantic ambivalent about his future in medical school falls for a hard-luck young woman who doesn''t believe in love.',NULL,'5.8','[{"id": "0b60f2f327d8b9a04fee818315932fe6b393e30c"}, {"id": "0b60f2f385f6cd4159fb18c2c69a77c1fd7a2f2c"}]');
INSERT INTO "movies" VALUES('tt0051087','Western','Anthony Mann','','The Tin Star','Veteran bounty-hunter Morg Hickman rides into a town in danger. The sheriff has been killed, and young inexperienced Ben Owens named a temporary replacement until a permanent can be found. Ben wants to be that permanent replacement, so needs to impress the townspeople with his skill. When he finds that Morg was a sheriff for a long time before he became a bounty-hunter, he asks the older man to teach him. Morg thinks that being a sheriff is a foolish goal, but agrees to instruct Ben in handling people, more important to a sheriff than handling a gun.',NULL,'7.4','[{"id": "0b60f2f38eb51e947dde96f8660965f30cd08b4d"}, {"id": "0b60f2f30ac99b858e06cbe3bbc1227e20a933c8"}, {"id": "0b60f2f3bacc446bfae71ba001ee0de69be04a97"}]');
INSERT INTO "movies" VALUES('tt1334272','Animation, Short, Comedy, Family, Sci-Fi','Seth Green','','Robot Chicken: Star Wars Episode II','The second of three Star Wars themed Robot Chicken parodies.',NULL,'8.1','[{"id": "0b60f2f3bdcd1b6d4c475be3159d2ebb81916962"}, {"id": "0b60f2f31da4003d4f1819f8aa0bc42da7c19f7c"}, {"id": "0b60f2f3596f099a3c230af0af185fe640c9068d"}, {"id": "0b60f2f34b080d9a3ed2856b24eca74afdadedb4"}, {"id": "0b60f2f3ffd1f48c1bd43ff88ea019233eeb4b40"}, {"id": "0b60f2f3f3057866b931a1f319479307e6478acb"}, {"id": "0b60f2f3bdcd1b6d4c475be3159d2ebb81916962"}, {"id": "0b60f2f3cd08c0373a752d9c927becf2a8041ef6"}, {"id": "0b60f2f3e5922ee9c3bd7ad88707f078ba12adaf"}, {"id": "0b60f2f31da4003d4f1819f8aa0bc42da7c19f7c"}, {"id": "0b60f2f313fb8513b46128fdf51e32aeb95772a2"}, {"id": "0b60f2f36cd412319ceed562a5e50b2ae4bc0d04"}]');
INSERT INTO "movies" VALUES('tt1024923','Action, Adventure, Drama','Haden Blackman, Steve Stamatiadis, Darragh O''Farrell, Martin Stoltz','','Star Wars: The Force Unleashed','Darth Vader''s secret apprentice, codenamed Starkiller, is trained in the Dark Side to defeat the enemies of the Empire, but must find his own path when his master betrays him.',NULL,'8.2','[{"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f364c034fe3d768b9ffe74760d58a36c25"}, {"id": "0b60f2f3f0baf0b72051eb05b776909d2cbfa955"}, {"id": "0b60f2f33c4fcd6b1680d3e2094898dd8ef55f65"}, {"id": "0b60f2f3b80e8f78a5c6b491d4513247f705bb6d"}]');
INSERT INTO "movies" VALUES('tt1776196','Animation, Action, Adventure, Fantasy, Sci-Fi','Kazuya Murata','','Fullmetal Alchemist: The Sacred Star of Milos','In the lost holy land of Milos, the Elrics search for the truth behind an unknown form of alchemy. What secrets are hidden in Milos? Riddles must be solved and dangers faced before the truth can be found.',NULL,'7.0','[{"id": "0b60f2f3ea8f7d33c077cf129b60758f594de20f"}, {"id": "0b60f2f393d97695fd86f34657b6b0099e2c4df7"}, {"id": "0b60f2f3365ab3131280fae6e1ca4be98fc575fe"}, {"id": "0b60f2f354dd2dbd1bfe8b89d6e08fa3a3ddb3e2"}]');
INSERT INTO "movies" VALUES('tt0483168','Action, Adventure, Sci-Fi','Eric ''Giz'' Gewirtz','0b60f2f39f0769e4a0ce1c5fc82eb8517d835c83','Star Wars: Battlefront II','You play as a member of the Clone 501st Legion, the most elite clone trooper attack group, also known as Vader''s Fist, and led by Anakin Skywalker/Darth Vader, over the course of the start, the middle, and the end of the Clone Wars, Operation Knightfall, and the key battles of the Galactic Civil War.',NULL,'8.8','');
INSERT INTO "movies" VALUES('tt1691338','Animation, Comedy, Family, Sci-Fi','Chris McKay','','Robot Chicken: Star Wars III','The Emmy Award-winning Robot Chicken returns with its third send-up of the Star Wars universe! In this all-new hour-long special, four very different characters -- Emperor Palpatine, Darth Vader, Boba Fett and Gary the Stormtrooper -- reveal untold stories that weave and interconnect throughout all six Star Wars films! Set phasers to "fun"! Oh wait, that''s the wrong franchise.',NULL,'8.1','[{"id": "0b60f2f3bdcd1b6d4c475be3159d2ebb81916962"}, {"id": "0b60f2f31da4003d4f1819f8aa0bc42da7c19f7c"}, {"id": "0b60f2f3596f099a3c230af0af185fe640c9068d"}, {"id": "0b60f2f34b080d9a3ed2856b24eca74afdadedb4"}, {"id": "0b60f2f37cb125f4718ddde576455ca24d796677"}, {"id": "0b60f2f3ffd1f48c1bd43ff88ea019233eeb4b40"}, {"id": "0b60f2f3f3057866b931a1f319479307e6478acb"}, {"id": "0b60f2f3bdcd1b6d4c475be3159d2ebb81916962"}, {"id": "0b60f2f3502f9e03338405ad096dfbf4f8d2691f"}, {"id": "0b60f2f3cd08c0373a752d9c927becf2a8041ef6"}, {"id": "0b60f2f313fb8513b46128fdf51e32aeb95772a2"}, {"id": "0b60f2f3062cbc9cf1199b034b6aeb8407c31ca4"}, {"id": "0b60f2f3e5922ee9c3bd7ad88707f078ba12adaf"}, {"id": "0b60f2f31da4003d4f1819f8aa0bc42da7c19f7c"}, {"id": "0b60f2f36cd412319ceed562a5e50b2ae4bc0d04"}]');
INSERT INTO "movies" VALUES('tt10323338','Drama','N/A','','9-1-1: Lone Star','A New York firefighter relocates to Austin, Texas with his son, where he works to save people''s lives while trying to solve his own personal problems.',NULL,'6.3','[{"id": "0b60f2f3fda04bc601e9fee299223e0314d5a555"}, {"id": "0b60f2f3c4ab28e79158d46ab0fb61d39c64b2b2"}, {"id": "0b60f2f349f92a2eb0371953f40e47eea9fa4c15"}]');
INSERT INTO "movies" VALUES('tt0116240','Comedy, Drama, Romance','Robert Harling','','The Evening Star','Continuing the story of Aurora Greenway in her latter years. After the death of her daughter, Aurora struggled to keep her family together, but has one grandson in jail, a rebellious granddaughter, and another grandson living just above the poverty line.',NULL,'5.9','[{"id": "0b60f2f3df7805f0f18cedea77eb00433812ba0e"}, {"id": "0b60f2f30321918ef7bc7025b916de323a50f3b2"}]');
INSERT INTO "movies" VALUES('tt0181196','Animation, Action, Adventure, Comedy, Family, Sci-Fi','Tad Stones','','Buzz Lightyear of Star Command: The Adventure Begins','After a successful mission in which his partner, Warp Darkmatter, fell in battle, Buzz Lightyear vows never to put another partner at risk and works solo. This vow, however is challenged by Star Command who assigns young Mira Nova to be Warp''s replacement over Buzz''s objections. In addition, the LGMs suggest he tries a new robot for an assistant while a lowly janitor, Booster, has his dreams of joining the Space Rangers. Together, this group of disparate heroes find they must work together to save the galaxy when Emporer Zurg hatches his grandest scheme for conquest yet.',NULL,'6.2','[{"id": "0b60f2f31f67a73377ef1bd3ddc687469129c7e4"}, {"id": "0b60f2f30a0c71f8e0862b7673003667b27cb3b2"}, {"id": "0b60f2f3d9ab204720a5d25013cfb8c48dcfa9bb"}, {"id": "0b60f2f34da64f6d819333436a3a54b4333eae55"}]');
INSERT INTO "movies" VALUES('tt0416716','Documentary, History, Sci-Fi','Edith Becker, Kevin Burns','0b60f2f3d3b5c4f2cf86d5b0c17acbcbac67a39e','Empire of Dreams: The Story of the ''Star Wars'' Trilogy','This documentary chronicles the making of the original Star Wars trilogy from start to finish. We get some background on George Lucas'' start in the business and then continue with the making of Star Wars (1977), Star Wars: Episode V - The Empire Strikes Back (1980) and Star Wars: Episode VI - Return of the Jedi (1983). The visual/special effects and financial problems are explained as well as casting, editing, scoring and releasing the films with tons of archival footage and interviews with plenty of cast & crew members.',NULL,'8.3','');
INSERT INTO "movies" VALUES('tt4941240','Drama, Music, Musical','N/A','','Star','A trio of women form a musical group in Atlanta.',NULL,'6.6','[{"id": "0b60f2f3b297dddde61c3b655e355c808dfa104d"}, {"id": "0b60f2f35da07c2daa0046a1fa90daffc0776ee2"}]');
INSERT INTO "movies" VALUES('tt5691474','Action, Adventure, Fantasy, Sci-Fi','Stig Asmussen','','Star Wars Jedi: Fallen Order','Set shortly after Revenge of the Sith, the player takes on the role of a Jedi padawan being hunted by the Empire after Order 66.',NULL,'8.8','[{"id": "0b60f2f37ecd9d44306e6b1a3d72803b5cbccd02"}, {"id": "0b60f2f37ecd9d44306e6b1a3d72803b5cbccd02"}, {"id": "0b60f2f3be8a626ac83ca4c24fe9758e9f0418a5"}, {"id": "0b60f2f3bf185a400020dfcc03742d697fcad100"}, {"id": "0b60f2f39d53855f252f370dd2c40e73fcf4308a"}, {"id": "0b60f2f3a9674682c3a3fd505fabfede8e002470"}, {"id": "0b60f2f3e2649749ab9a64b4eb1a5bb93ffa0676"}, {"id": "0b60f2f3b2bf16ddffb3beb2682ad6c75a39e2bc"}, {"id": "0b60f2f3965cabfd232b64f427bd26b0676a4b03"}, {"id": "0b60f2f3d8b8b057d731f6ef1a3b422f8c15b17a"}, {"id": "0b60f2f3e2649749ab9a64b4eb1a5bb93ffa0676"}, {"id": "0b60f2f3fefb8a057407b776c0d940c3b4bca52f"}, {"id": "0b60f2f3bf185a400020dfcc03742d697fcad100"}, {"id": "0b60f2f39d53855f252f370dd2c40e73fcf4308a"}, {"id": "0b60f2f3cf1dc49df18de1b8c14bc3f8cfd2bafc"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f37ecd9d44306e6b1a3d72803b5cbccd02"}, {"id": "0b60f2f3bf185a400020dfcc03742d697fcad100"}, {"id": "0b60f2f347722e9c228260a11c52c0e4d72a6dcb"}, {"id": "0b60f2f347722e9c228260a11c52c0e4d72a6dcb"}]');
INSERT INTO "movies" VALUES('tt8336340','Animation, Action, Adventure, Sci-Fi','N/A','','Star Wars Resistance','Kazuda Xiono, a young pilot for the Resistance, is tasked with a top secret mission to investigate the First Order, a growing threat in the galaxy.',NULL,'4.9','[{"id": "0b60f2f35f2ec215e4adb26fba2d933c40e44f50"}, {"id": "0b60f2f38dcbf64a10d50730022b1e3f99210b2e"}, {"id": "0b60f2f32a1e9ead3d377e45a365fe3f1a1b6907"}]');
INSERT INTO "movies" VALUES('tt2621446','Action, Adventure, Sci-Fi','N/A','','Star Trek: Renegades','When a seemingly unstoppable new enemy threatens the very existence of the Earth, Admiral Pavel Chekov (Walter Koenig) is forced to work outside the boundaries of Starfleet''s rules to combat this deadly new foe. When planet after planet winks out of existence, yet Starfleet refuses to act, Chekov turns to Commander Tuvok (Tim Russ, who also directs), the new head of Starfleet''s covert operations division, Section 31. Together, they assemble a new elite strike-force, consisting of rogues, outcasts and criminals, led by the fearless yet haunted Lexxa Singh (Adrienne Wilkinson). The Renegades'' mission is simple: take on an army and stop their leader, Borrada (Bruce Young), from destroying the Earth. Outnumbered and out-gunned, the ragtag crew is in an adrenaline-pumping race against time and space. But they soon find their foes are the least of their concerns: the real trouble may be coming from within!',NULL,'4.9','[{"id": "0b60f2f31e03639200daf8a22175ec41bc6f35d1"}, {"id": "0b60f2f3d1d10903fa3d1ca309c82041b486dbc5"}, {"id": "0b60f2f3611b46d139f5cf39d9740a2e65e62645"}]');
INSERT INTO "movies" VALUES('tt0433458','Adventure, Drama, Fantasy','N/A','','Star Wars: Knights of the Old Republic II - The Sith Lords','Five years after the defeat of Darth Malak, the Sith Lords have nearly destroyed the Jedi Order. An exiled Jedi has returned only to find the galaxy in shambles, and must decide whether to follow the path of the Dark Side and participate in the destruction of the Jedi Order or the Light Side and restore the Jedis to glory.',NULL,'8.9','[{"id": "0b60f2f347722e9c228260a11c52c0e4d72a6dcb"}, {"id": "0b60f2f361d77e8a3d0ecb31334092e7bc1790ac"}]');
INSERT INTO "movies" VALUES('tt0266171','Animation, Action, Adventure, Comedy, Drama, Sci-Fi, Thriller','N/A','0b60f2f3c8dcf359c619561d34414c9737af973f','Outlaw Star','Gene Starwind dreams of a life as an Outlaw, and fate smiles on him as he seems to suddenly wind up with a great job. But things go awry, and he finds himself the new owner of the fastest, most technologically advanced space ship in the galaxy. Unfortunately, it''s stolen and the owners want it back Along with his partner Jim and the lovely Melfina, Gene must fight his way across the galaxy battling pirates, aliens and assassins as he attempts to discover the secrets of the Outlaw star.',NULL,'7.9','');
INSERT INTO "movies" VALUES('tt0045186','Drama, Romance','Stuart Heisler','','The Star','Middle-aged Oscar winning actress Margaret Elliot - Maggie to those that know her - is a Hollywood has-been. Her life is in shambles. She clings to the hope of resurrecting her past movie stardom as a leading ingénue. No one will hire her, she''s penniless with creditors selling off anything that she owns that is of monetary value, and she has no one to turn to that can see her through financially. She has in the past supported her sister and brother-in-law, who still want to use her as their meal ticket. Divorced from her actor husband, she shares joint custody of their teen-aged daughter Gretchen, from who Maggie tries to hide her problems. When it looks as if Maggie has hit rock bottom, Jim Johannsen re-enters her life. Jim, who once had the stage name Barry Lester, got his big break in Hollywood movies by Maggie. He came to the quick realization that he was neither good as an actor or that he wanted to do it as a profession. He now works as a boat parts supplier and mechanic. Jim tries to help her come to the realization of the stage of life that she is in to help her reinvent herself. But Maggie wants to regain her star status on her own terms, and does whatever she needs to for that great ingénue role that has eluded her for so many years.',NULL,'7.0','[{"id": "0b60f2f3f2e58d1bcb3946c07ae7f76c9d28888c"}, {"id": "0b60f2f3a696ff2c5317d549bd7e645bdbfee883"}]');
INSERT INTO "movies" VALUES('tt5836316','Drama','Adam Rifkin','0b60f2f34fbc8ed8a4333aa98eee3ad600eb4fad','The Last Movie Star','An aging former movie star is forced to face the reality that his glory days are behind him. On its surface, the film is a tale about faded fame. At its core, it''s a universal story about growing old.',NULL,'6.9','');
INSERT INTO "movies" VALUES('tt0113074','Action, Fantasy, Sci-Fi, Thriller','Tony Randel','','Fist of the North Star','Based on a graphic novel, this apocalyptic adventure centers on a man who must reverse the cataclysmic conditions of his world.',NULL,'3.9','[{"id": "0b60f2f34a64dddbec8c01e384df728aa0035f43"}, {"id": "0b60f2f384df6900d578af85d1d049da83540a6e"}, {"id": "0b60f2f3dbd8b97c015da9b70b00d21a8cb9e841"}, {"id": "0b60f2f3b12f468403162e92adde2147bccc2587"}]');
INSERT INTO "movies" VALUES('tt0053825','Western','Don Siegel','','Flaming Star','West Texas in the years after the Civil War is an uneasy meeting ground of two cultures, one white. The other native American. Elvis portrays Pacer Burton. The son of a white rancher (John McIntire) and his beautiful Kiowa Indian wife (Dolores DelRio). When fighting breaks out between the settlers and natives, Pacer tries to act as a peace maker, but the "flaming star of death" pulls him irrevocably into the deadly violence.',NULL,'6.5','[{"id": "0b60f2f37658be4e4b3067c95632e5b063843805"}, {"id": "0b60f2f3cca6f0be24267d60468036cba1d82459"}, {"id": "0b60f2f37658be4e4b3067c95632e5b063843805"}]');
INSERT INTO "movies" VALUES('tt1570976','Action, Adventure, Drama, Fantasy, Mystery, Sci-Fi','Sylvain Doreau','','Star Wars: The Force Unleashed II','A clone of Starkiller is created by Darth Vader, but, after he escapes his master''s grasp, he travels across the galaxy to discover who, or what, he really is.',NULL,'7.1','[{"id": "0b60f2f364c034fe3d768b9ffe74760d58a36c25"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f3b80e8f78a5c6b491d4513247f705bb6d"}]');
INSERT INTO "movies" VALUES('tt0048340','Western','King Vidor','','Man Without a Star','Dempsey Rae, a cowboy with no clear aim in life, winds up working on a spread with a hard lady owner just arrived from the East. She needs a tough new top hand and uses all her means of persuasion to get Rae to take the job. But he doesn''t like the way the other settlers are getting treated and starts to side with them, despite their introduction of the barbed wire he loathes.',NULL,'6.9','[{"id": "0b60f2f3a11522d7fcd70da71688d5433f486c68"}, {"id": "0b60f2f34ed91464a4323412a93472854de041a9"}, {"id": "0b60f2f3363ee423baed87d8bb9b91501e18e93e"}]');
INSERT INTO "movies" VALUES('tt0269483','Comedy, Crime','David Semel','0b60f2f3b56d2358d7a29f60445a60d5819badf7','Lone Star State of Mind','Earl is engaged to his step-sister Baby. Baby has entrusted him to take care of her misfit cousin Junior. Baby is also intent on leaving Texas for LA on Tuesday. When Junior and his recently released ex-con friend Tinker rob a pizza delivery boy and end up with $20,000 of drug money Earl is forced onto the scene, giving up his and Baby''s LA money to save Juniors limbs.',NULL,'6.1','');
INSERT INTO "movies" VALUES('tt0260602','Animation, Action, Adventure, Comedy, Family, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Buzz Lightyear of Star Command','The further (animated) adventures of Buzz Lightyear of "Toy Story" and "Toy Story 2." Buzz, along with fellow Star Command Rangers Mira Nova, Booster, and XR, fight to keep the universe safe from the evil clutches of Emperor Zurg and his henchman, Warp Darkmatter.',NULL,'6.7','');
INSERT INTO "movies" VALUES('tt0091211','Animation, Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Fist of the North Star','In the year 199X, human civilization has been all but destroyed by a nuclear holocaust. In an age where the strong rule over the weak, the survivors of the fallout struggle over the remaining supply food and water left. Kenshiro, successor to an ancient, deadly martial art known as Hokuto Shinken (Fist of the North Star), wanders the wasteland with seven scars in the shape of the Big Dipper on his chest. This infamous style uses the body''s hidden 708 pressure points to destroy opponents from within and allows practitioners to unleash 100% of their humanly strength. Accompanied by a young thief and an orphan girl, this messiah brings justice to this lawless world with the strongest fist in the world.',NULL,'8.3','');
INSERT INTO "movies" VALUES('tt0120478','Adventure, Family, Sci-Fi','Manny Coto','0b60f2f398e48bd44c7ee82903bd92575e65ed8b','Star Kid','Shy seventh-grader Spencer Griffith''s life changes when a meteor falls into a local junkyard and he finds a Cybersuit - an exoskeleton with AI from another galaxy. Spencer puts on the Cybersuit and becomes a different kind of person.',NULL,'5.3','');
INSERT INTO "movies" VALUES('tt2732442','Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Trek Continues','The USS Enterprise''s historic five-year mission continues with all new episodes of the original series. "Star Trek: Continues", a new Trek series, beams down with exciting adventures of the Federation''s most heroic crew led by Captain James T. Kirk. The lighting and color of the highly accurate sets accentuate the equally detailed props and costumes, matching the original series that ran from 1966-69! With acting and stories that also replicate the original series, the adventures are sure to dazzle even the most die hard Trek fans. Witness now the untold morality plays that explore the final frontier and more importantly... the human condition. Fans of the original series will especially enjoy the pilot episode as a familiar guest star from the original series reprises his role in a sequel entitled "Pilgrim of Eternity".',NULL,'8.0','');
INSERT INTO "movies" VALUES('tt0282856','Documentary, Biography','Scott J. Gill','0b60f2f3a862dfc02d54e6774b1b766c399643f0','Porn Star: The Legend of Ron Jeremy','Porn Star: The Legend of Ron Jeremy offers audiences a penetrating look inside the world of Ron Jeremy, America''s most unlikely sex star and hero to millions. With nearly 25 years in the adult film industry and over 1,600 films to his credit, Ron Jeremy is huge. In his world, Ron reigns supreme-he''s made millions of dollars and slept with thousands of beautiful women, and is indisputably the industry''s biggest star. And everyone who''s anyone knows Ron-a pop icon to millions, he is a beacon of hope for many American male, since he stands as living proof that pretty much anyone can get some. So how did such a classically unhandsome, big and hairy guy ever get to be such a super stud? In one of the most fascinating and entertaining comedies of the last year, audiences finally get a chance to get inside the life and times of Ron Jeremy, and find out what''s really behind the hardest working man in show business.',NULL,'6.3','');
INSERT INTO "movies" VALUES('tt2261434','Drama, Romance','Maria Sole Tognazzi','','A Five Star Life','Forty-something Irene had a dream job that made her life easy: she was indeed a luxury hotel inspector and her work got carried out in a wonderful ever-renewed setting, from Paris to Gstaad to Berlin to Morocco to China... But does a dream job necessarily mean a dream life? Irene tried not to ask herself the question too openly. Yes she was single but she had manged to remain on good terms with Andrea, her former life companion. For sure she was childless but she occasionally took care of her two little nieces. And it was such fun to play the mystery guest in those magnificent hotels... Things could have gone on that way hadn''t one day Irene met Kate Sherman...',NULL,'6.3','[{"id": "0b60f2f31195b5dbaeb1ee1ab0175c3a2009a78b"}, {"id": "0b60f2f33dc3928c76f0dc0815a82f0e99f7ecd2"}, {"id": "0b60f2f3fe80644fb1499c02cd7b71f1d990bb1e"}]');
INSERT INTO "movies" VALUES('tt0418194','Action, Adventure, Sci-Fi','Eric ''Giz'' Gewirtz','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars: Battlefront','Battlefront is a multiplayer online first-person shooter which allows players to choose from a variety of armies (Stormtroopers, Rebel pilots, AT-AT commanders, Republic Guards) and crafts (X-wings, snowspeeders and AT-STs) from the epic film series. Team up or fight head-to-head on any of ten planets. ESRB Rating: RP',NULL,'8.4','');
INSERT INTO "movies" VALUES('tt0420416','Drama, Music','N/A','','Instant Star','Based on a song she wrote and performed, a young girl wins a national contest for a recording contract. Now she must balance the life of a normal teenager with that of a rising star in the music industry.',NULL,'7.4','[{"id": "0b60f2f3bb0f71e7a0912f2739358d8ca06fca80"}, {"id": "0b60f2f3179954ee07b8bb71f13c14173d29bfe4"}, {"id": "0b60f2f3b3c76eff33d36916dbe2fd0d11673e1f"}, {"id": "0b60f2f3258c4b602b1bbb2250e2e8db5318a608"}]');
INSERT INTO "movies" VALUES('tt0326450','Action, Adventure, Drama, History, War','Nikolay Lebedev','','The Star','The film is based on the eponymous book by Emmanuil Kazakevich. In the summer of 1944 the Nazi Armies prepare a massive Tank Division named ''Viking" for the offensive on occupied Russian land. The Russian Army''s special group of seven snipers named "Zvezda" is sent for a reconnaissance operation behind the enemy lines in the back of the Nazi Tank Division. Two previous Russian groups never came back. The seven Russians know that they are going to an almost certain Death for the sake of Victory.',NULL,'7.1','[{"id": "0b60f2f337f9fb338d6fbfadbe336dbc529dbcb8"}, {"id": "0b60f2f308ac81135e2c90448559dd127baf3d77"}, {"id": "0b60f2f3526b80e21e82af9827f073a8a7d24b3a"}, {"id": "0b60f2f3e2ed318a754cd961787b9e360a73db7c"}]');
INSERT INTO "movies" VALUES('tt0129712','Animation, Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Saber Rider and the Star Sheriffs','In the distant future, a team of four high tech Star Sheriffs defends frontier space colony Yuma from outlaws, as well as Outriders, an army of humanoid alien beings called Vapors, led by mysterious Nemesis, who need Yuma''s resources.',NULL,'8.4','');
INSERT INTO "movies" VALUES('tt0054073','Drama, Musical','Ritwik Ghatak','','The Cloud-Capped Star','"Meghe Dhaka Tara" tells the tragic story of the beautiful daughter of a middle-class refugee family from East Pakistan, living in the outskirts of Calcutta under modest circumstances. Neeta sacrifices everything for her family, including her personal happiness, her money, and her health, while her achievements are hardly ever recognized by the people around her.',NULL,'7.9','[{"id": "0b60f2f3cb336f8a173255c9a5b5e0b70b421f35"}, {"id": "0b60f2f3260edecbbd8501d56f6321f06d9abe12"}, {"id": "0b60f2f31915c58405c0080a46c034985e947962"}, {"id": "0b60f2f38cd563c2137405cfd00e56d812639b37"}]');
INSERT INTO "movies" VALUES('tt3702328','Action, Fantasy, Sci-Fi','N/A','','Star Wars: Battlefront','Join the battle and play an important part in the Star Wars Galaxy. Lead the battle as you fight against the powerful empire in hope to regain freedom for the Galaxy.',NULL,'7.1','[{"id": "0b60f2f3f93e29b87dac1a65adc5bbbdbbfeea1b"}, {"id": "0b60f2f3b337ace9cba7f736cae668ba2219dee1"}, {"id": "0b60f2f3306cf3ae4c60c68316bd7377e24387fb"}]');
INSERT INTO "movies" VALUES('tt0297410','Action, Adventure, Drama, Fantasy, Sci-Fi','N/A','','Star Wars: Jedi Knight II - Jedi Outcast','You guide mercenary Kyle Katarn, who must stop the evil plot of a renegade Jedi by relearning his skills as a Jedi Knight.',NULL,'8.6','[{"id": "0b60f2f3d8a080f028a7de137da70c0d792ac624"}, {"id": "0b60f2f32cceb4aae1a4f8640362e267e78506ba"}]');
INSERT INTO "movies" VALUES('tt0063642','Biography, Comedy, Drama, History, Musical, Romance','Robert Wise','0b60f2f3b9fff81ebb86c8324336ec4920596c3d','Star!','Film based on life of actress Gertrude Lawrence, on- and offstage, takes the opportunity to feature extravagant musical production numbers with ''Julie Andrews'' , acting, singing and dancing.',NULL,'6.6','');
INSERT INTO "movies" VALUES('tt1086236','Animation, Comedy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Lucky Star','Having fun in school, doing homework together, cooking and eating, playing video games, watching anime. All those little things make up the daily life of the anime-and chocolate-loving-Izumi Konata and her friends. Sometimes relaxing but more than often simply funny.',NULL,'7.3','');
INSERT INTO "movies" VALUES('tt1320395','Action, Adventure, Fantasy','James Ohlen','','Star Wars: The Old Republic','Set long before the Star Wars films, the Sith Empire returns to the galaxy to begin a war with the Galactic Republic. After some brutal battles, both sides stop fighting each other, but the peace is broken and the Empire and the Republic are soon at war again.',NULL,'8.7','[{"id": "0b60f2f3bb4950e445c55f172152d050cf19a5d6"}, {"id": "0b60f2f367437bebc1a88154153bfd8c78bdb8f4"}, {"id": "0b60f2f3be5403633d6236b61ddfb5946d98383c"}, {"id": "0b60f2f3ce5a1d4b968f173fae27bf2709a1ef7c"}, {"id": "0b60f2f333413865934ad2638acb98291b93b008"}, {"id": "0b60f2f3a2c1ca51036daa8b5f048aa1e0dcca00"}, {"id": "0b60f2f302f827b13c299dea2af622af3d7b797f"}, {"id": "0b60f2f37e6c6c7f28c67074192ec3b393897147"}, {"id": "0b60f2f30d992154c135aa3e65bae354c7f7b07e"}, {"id": "0b60f2f31a45042412453226a9922eafb8aa991b"}, {"id": "0b60f2f33507eded352c8e0d3ffcd6552df37105"}, {"id": "0b60f2f3b75b54f7c435f1f21e184d6e5d662d54"}, {"id": "0b60f2f37ed0768ee50c04d7d476ea59ffa83c4d"}, {"id": "0b60f2f39ec44b54b03e2bb7d023ae2e7822d1ad"}, {"id": "0b60f2f3c2ae782c19e70cac818424e5394fb4b4"}, {"id": "0b60f2f38ca0b36421cc75f419e9eb47dd2abdc2"}, {"id": "0b60f2f335146ceade4c846344b7b11540323de1"}, {"id": "0b60f2f331543f0dfe70e515e61a5e5a4a530455"}, {"id": "0b60f2f3c8ec440de4f328756f69fc57e8622ff3"}, {"id": "0b60f2f3f5260c02bf7ac8b208f19bb5777906fc"}, {"id": "0b60f2f31505e76036df551da0dbdda8c9f6da9d"}]');
INSERT INTO "movies" VALUES('tt5165412','Drama','N/A','0b60f2f3a6a2101912eb5243e4e2a20c7c7ceb2c','Still Star-Crossed','A period drama that picks up where the famous story of Romeo and Juliet leaves off, charting the treachery, palace intrigue, and ill-fated romances of the Montagues and Capulets in the wake of the young lovers'' tragic fate. Based on the book by Melinda Taub.',NULL,'5.5','');
INSERT INTO "movies" VALUES('tt0813808','Animation, Action, Adventure, Sci-Fi','N/A','0b60f2f32f29cc2cf50497fe9b0aa2d9096320a3','Oban Star-Racers','Earth, 2082, twenty-five years after the failed invasion of the Crog forces. Young Eva (15) is determined to be reunited with her father, race manager Don Wei, who sent her off to a tough boarding school after the tragic death of the mother, ten years earlier. She escapes from school and secretly joins her dad''s famous star-racer team under the alias "Molly". But Don Wei doesn''t recognize his daughter. He has other troubles on his mind: the President of the Earth Coalition has just put him in charge of a dangerous top-secret mission. Don Wei must lead the Earth to victory in a mysterious and mythical intergalactic competition - The Great Race of Oban. It is said that the outcome of the competition will radically transform the balance of power within our Galaxy. Earth cannot afford to lose - especially not against the Crogs! Before she knows what is happening, "Molly" takes off for the planet Alwas, the first stage of The Great Race of Oban, with Don Wei, champion pilot Rick Thunderbolt, gunner Jordan and mechanics Stan and Koji. The fate of Molly and her friends, as well as the future of the human race, are now inextricably intertwined.',NULL,'8.1','');
INSERT INTO "movies" VALUES('tt2005268','Animation, Short, Action, Adventure, Comedy, Family, Fantasy, Sci-Fi','David Scott','','Lego Star Wars: The Padawan Menace','Ian,a young boy,Commander Cody and Yoda must go to rescue the secret battle plans.However,when substitute teacher C-3PO and a class of padawans go too,things become more complicated....',NULL,'7.2','[{"id": "0b60f2f38b016881335829c35872fb8cb37ab176"}, {"id": "0b60f2f3123eee8d09969e5e5fb595d2e0d63173"}, {"id": "0b60f2f39ece4c8f149f5216ff7a5f5b0da2ea5a"}, {"id": "0b60f2f3376f3ca7c972e9e059e49a1ee75683a9"}]');
INSERT INTO "movies" VALUES('tt0094029','Adventure, Sci-Fi, Short','Dennis Muren','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Star Tours','Groups of visitors are taken on "Star Tours", a space tour bus set in the Star Wars universe. Thanks to an inexperienced and thoroughly incompetent robot pilot, what is billed as a leisurely tour to the Endor Moon becomes a wild ride as the tour gets caught up in a battle between the Empire and the rebels.',NULL,'8.0','');
INSERT INTO "movies" VALUES('tt1149396','Action, Adventure, Comedy','Jon Burton','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Lego Star Wars: The Complete Saga','In Lego Star Wars: The Complete Saga, you can now experience all 6 episodes at once. Containing the same levels and locations. Only with newer features and improvements. Such as more extras to unlock, more vehicles to build, new playable characters, & a better customizing Lego character feature. Now all Lego & Star Wars fans alike can experience this game more than it''s successors.',NULL,'8.5','');
INSERT INTO "movies" VALUES('tt3131532','Family, Romance','John Bradshaw','0b60f2f3b289a04767b96e0f387352c4c60e3681','Catch a Christmas Star','With the help of his two precocious kids, a widower reconnects with his high school sweetheart, who just happens to be one of the biggest pop stars on the planet.',NULL,'6.3','');
INSERT INTO "movies" VALUES('tt0021873','Crime, Drama','Mervyn LeRoy','','Five Star Final','Hinchcliffe, the ruthless publisher of a sleazy New York tabloid, is concerned that the ethical journalistic policies of City Editor Randall have caused a drop in circulation. He pressures the newsman to run more sensational stories including resurrecting the twenty year old Vorhees Murder Case. Although the perpetrator''s actions were ultimately judged justifiable, and she has been subsequently living an exemplary life in anonymity, Hunchcliffe insists Randall revisit the story. Randall assigns Isopod, an alcoholic degenerate, to dig up anything lurid that he find. The unprincipled reporter fraudulently insinuates himself into the Vorhees'' home masquerading as a minister and gets the expose he sought. Yellow journalism triumphs, and a decent woman''s name gets dragged through the mud again... with tragic consequences.',NULL,'7.3','[{"id": "0b60f2f37360bef091cd461351a4bacc442518c1"}, {"id": "0b60f2f39e183a594cfca045dd7494972562a73c"}, {"id": "0b60f2f392facec725c88377a4ffc3ab4142f4fc"}]');
INSERT INTO "movies" VALUES('tt0362179','Fantasy, Action, Drama','N/A','','Star Wars: Jedi Knight - Jedi Academy','You play a young Jedi Academy student who must help stop an evil plot by Dark Jedi to collect and use Dark Side energy for their own ends.',NULL,'8.5','[{"id": "0b60f2f3f320a160612601277d3929e9ae29a8d1"}, {"id": "0b60f2f3d306bb350f3c1e731dce9e2d7fbfbeb8"}, {"id": "0b60f2f331d6b701e2d8f3f89f72e5c11e1596ba"}]');
INSERT INTO "movies" VALUES('tt0058025','Short','Stan Brakhage','0b60f2f350405ece5ad187c866c105d7524104ba','Dog Star Man: Part I','From a murky landscape, a wooded mountain emerges. We watch the sun. We see a bearded man climbing up the mountain through the snow. He carries an ax, and he''s accompanied by a dog. His labors continue. There is no soundtrack. Images rush past - water, trees, and surfaces too close up to distinguish. He struggles. A fire burns. Nature, in long shots and magnified, is formidable and silent. It''s tough going; he carries on. In a capillary, blood flows.',NULL,'6.3','');
INSERT INTO "movies" VALUES('tt0088510','Animation, Action, Adventure, Comedy, Family, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars: Droids','This series recounts the adventures of C-3P0 and R2-D2 before they met Luke Skywalker as they serve various masters over the years. As it turns out, their lives were no less hectic as they became involved in battles versus gangsters, pirates, the Empire and even Boba Fett on one occasion.',NULL,'6.1','');
INSERT INTO "movies" VALUES('tt0118788','Drama','Ricardo Franco','','Lucky Star','Rafael witnesses Marina - a woman with a glass eye - being attacked on the street by Daniel; her long-time acquaintance since the orphanage, where they were both raised as kids. He rescues her from Daniel and brings her to his home, where a relationship between them soon develops. Marina is pregnant, but since Daniel does not want the child, Rafael offers to step in as the father, having his own physical problems, preventing him from having kids. He and Marina stays together as a couple, and as a family. But once everything seems to be settled, Daniel - released from prison - shows up again.',NULL,'7.3','[{"id": "0b60f2f3fe95cc3f091994ff922b7f27c946c798"}, {"id": "0b60f2f3eecdf27e49655b78a6f2a13747bac9c4"}, {"id": "0b60f2f38e9d44a01fcbaa35ee5d675ef95844a7"}, {"id": "0b60f2f337680a39eddc9be80fb26db3922ac8c5"}, {"id": "0b60f2f3287a2ab1d24e31d531567dda4e4a2fa0"}]');
INSERT INTO "movies" VALUES('tt0197626','Drama, Short','Sofia Coppola','','Lick the Star','A clique of school girls devise a secret plan that they code-name "Lick the Star".',NULL,'6.0','[{"id": "0b60f2f37f2eb78526e02381095a3ac1e9b45fe8"}, {"id": "0b60f2f3494f9083038ff319ea605ae0e46c94a4"}]');
INSERT INTO "movies" VALUES('tt0462553','Action, Adventure, Drama, Fantasy, Sci-Fi, War','Adam Schnitzer','','Star Wars: Episode III - Revenge of the Sith','Game that portrays the life of a jedi knight and sith lords, while you find your way around the galaxy, as you become part of the story.',NULL,'7.3','[{"id": "0b60f2f3cb65f6e4cf976784d7c4c25fad2a6123"}, {"id": "0b60f2f3734e77e41d6a172c856d484e2bd6fe39"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt0234512','Short, Drama','Stan Brakhage','0b60f2f350405ece5ad187c866c105d7524104ba','Prelude: Dog Star Man','A creation myth realized in light, patterns, images superimposed, rapid cutting, and silence. A black screen, then streaks of light, then an explosion of color and squiggles and happenstance. Next, images of small circles emerge then of the Sun. Images of our Earth appear, woods, a part of a body, a nude woman perhaps giving birth. Imagery evokes movement across time.',NULL,'6.7','');
INSERT INTO "movies" VALUES('tt9059594','Short, Action, Adventure, Drama, Sci-Fi','N/A','','Star Trek: Short Treks','A series of stand-alone short films featuring characters and storylines from Star Trek: Discovery (2017).',NULL,'7.0','[{"id": "0b60f2f35a158dc6d9c6a2024da15ab6ec6f56dc"}, {"id": "0b60f2f3d303b7eac76f46bb326068845b117829"}, {"id": "0b60f2f37e9e97c2b83dacb57ee6e1d15d2232cd"}, {"id": "0b60f2f3c612dfd8e888a0696f347b7a28ec5306"}, {"id": "0b60f2f3efa3dea62a996ee98540e5db00a3b5d2"}]');
INSERT INTO "movies" VALUES('tt2290151','Documentary, Music','Drew DeNicola, Olivia Mori(co-director)','0b60f2f350405ece5ad187c866c105d7524104ba','Big Star: Nothing Can Hurt Me','BIG STAR: NOTHING CAN HURT ME is a feature-length documentary about legendary Memphis band Big Star. While mainstream success eluded them, Big Star''s three albums have become critically lauded touchstones of the rock music canon. A seminal band in the history of alternative music, Big Star has been cited as an influence by artists including REM, The Replacements, Belle & Sebastian, Elliott Smith and Flaming Lips, to name just a few. With never-before-seen footage and photos of the band, in-depth interviews and a rousing musical tribute by the bands they inspired, BIG STAR: NOTHING CAN HURT ME is a story of artistic and musical salvation.',NULL,'7.0','');
INSERT INTO "movies" VALUES('tt2034761','Adventure, Family, Fantasy','Nils Gaup','0b60f2f34c14c1391e8071938858429a60fe69cd','Journey to the Christmas Star','Once upon a time a little girl went out to find the Christmas star.',NULL,'5.8','');
INSERT INTO "movies" VALUES('tt0835378','Action, Adventure, Sci-Fi','Tim Russ','','Star Trek: Of Gods and Men','It is the year 2306. Thirteen years have passed since Captain James T. Kirk was swept away by the Nexus, after saving the crew of the Enterprise-B. The remaining crew members of the original USS Enterprise have gone their separate ways. Captain Nyota Uhura and Captain Pavel Chekov, along with Captain John Harriman of the Enterprise-B, come together for a special dedication in honor of Kirk''s Enterprise. Their reunion is cut short when they receive a distress call from a mysterious planet, that presses the three friends to embark on a mission that will change their lives forever.',NULL,'6.1','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f3d1d10903fa3d1ca309c82041b486dbc5"}, {"id": "0b60f2f3c5c254ffa93abe329b6015038e3cfad2"}, {"id": "0b60f2f3611b46d139f5cf39d9740a2e65e62645"}, {"id": "0b60f2f31e03639200daf8a22175ec41bc6f35d1"}, {"id": "0b60f2f31e03639200daf8a22175ec41bc6f35d1"}, {"id": "0b60f2f3d1d10903fa3d1ca309c82041b486dbc5"}, {"id": "0b60f2f3611b46d139f5cf39d9740a2e65e62645"}]');
INSERT INTO "movies" VALUES('tt0457489','Action, Adventure, Sci-Fi','Shane Felux','','Star Wars: Revelations','Seers once shaped the path of the Jedi Order. But their visions grew unreliable and the Jedi came to distrust those with the ability. Seers hid their visions or left the Order forever. In the wake of the Temple''s destruction a power struggle has emerged between Darth Vader, the Dark Lord of the Sith, and Zhanna, the Emperor''s Hand. Each seek to eliminate the last of the Jedi and gain the Emperor''s favor. Caught between them is one woman who cannot deny the truth of her visions as all race to possess an ancient Jedi secret.',NULL,'5.0','[{"id": "0b60f2f350ab469dd21d3b363653b2a8392766eb"}, {"id": "0b60f2f3ec8861fd13bf923ac87a3685b5e539ef"}]');
INSERT INTO "movies" VALUES('tt0827187','Action, Adventure, Sci-Fi','N/A','','Lego Star Wars II: The Original Trilogy','Play the original trilogy of star wars A New Hope,The Empire Strikes Back, and Return Of The Jedi. All in LEGO!!!!!!!!!',NULL,'8.4','[{"id": "0b60f2f39259f78a508763ebb3ee7f7b7aff2033"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}]');
INSERT INTO "movies" VALUES('tt0114622','Action, Adventure, Crime, Drama, Western','Nils Gaup','','North Star','Set during the Alaskan gold rush of the late 1800''s. In his efforts to gain control of a small mining town, Sean McLennon is buying up every mining claim that becomes available, usually after the deaths of the previous owners at the hands of McLennon''s ''assistants''. One of the miners targeted by McLennon, a half-Indian hunter named Hudson Saanteek, manages to escape his hired thugs and comes back into town looking to re-establish his claim and get revenge. McLennon and his men have the advantange of numbers and weapons, but Saanteek has his survival skills and knowledge of the Alaskan wilderness.',NULL,'4.9','[{"id": "0b60f2f321cc94aa18b4192fad049a8dc37486d3"}, {"id": "0b60f2f3ae49323156229266f6dd6a81fb368860"}, {"id": "0b60f2f33f30fe80e0ab8cfdf5af9756d91afb26"}, {"id": "0b60f2f3d369a54081081aa458fdc148e6df085a"}, {"id": "0b60f2f38bf0a61882124e43d0edf2a47ea26979"}, {"id": "0b60f2f311463ad07e7089d9b3358c0e2fb2f64c"}]');
INSERT INTO "movies" VALUES('tt6779076','Animation, Adventure, Family, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars: Forces of Destiny','Small moments and everyday decisions shape a larger heroic saga.',NULL,'5.0','');
INSERT INTO "movies" VALUES('tt0461727','Game-Show, Reality-TV','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Food Network Star','A food network contest to find a well rounded great chef with a unique point of view and hosting type of personality to host their own show!',NULL,'6.3','');
INSERT INTO "movies" VALUES('tt0020122','Drama, Romance','Frank Borzage','','Lucky Star','Mary, a poor farm girl, meets Tim just as word comes that war has been declared. Tim enlists in the army and goes to the battlefields of Europe, where he is wounded and loses the use of his legs. Home again, Tim is visited by Mary, and they are powerfully attracted to each other; but his physical handicap prevents him from declaring his love for her. Deeper complications set in when Martin, Tim''s former sergeant and a bully, takes a shine to Mary.',NULL,'7.8','[{"id": "0b60f2f3e70ead589297f72f3d9fc5434376650a"}, {"id": "0b60f2f3efb2848c4b71807fb3efbf91c1e58c1a"}, {"id": "0b60f2f3163f03bd7cd67209956d738fc53876b0"}, {"id": "0b60f2f3a74cdce884d2629ff217127b98a59249"}, {"id": "0b60f2f3b8749cc8135e5c39e6d710929d5a8ed9"}]');
INSERT INTO "movies" VALUES('tt0036217','Drama, Romance, War','Lewis Milestone','','The North Star','In a peaceful Ukrainian village, the school year is just ending in June 1941. Five young friends set out for a walking trip to Kiev, but their travels are brutally interrupted when they are suddenly attacked by German planes, in the first wave of the Nazi assault on the Soviet Union. When the village itself is attacked and occupied, most of the men flee to the hills to form a guerrilla unit. The others resist the Nazis as well as possible, but soon the village is placed under the command of a Nazi doctor who begins using the town''s children as a source of constant blood transfusions for wounded German soldiers. Meanwhile, the small group of young persons tries desperately to take a supply of firearms to the guerrillas.',NULL,'6.0','[{"id": "0b60f2f3822b43c9a281ce40f22bdc343b90a1d1"}, {"id": "0b60f2f3822b43c9a281ce40f22bdc343b90a1d1"}, {"id": "0b60f2f3e597b07dfa967ca0374b5af1a6ed8721"}]');
INSERT INTO "movies" VALUES('tt0486613','Action, Adventure, Comedy','Jon Burton','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Lego Star Wars: The Video Game','Play through the star wars prequel trilogy in episodes 1,2,and 3, in lego.',NULL,'8.2','');
INSERT INTO "movies" VALUES('tt0772152','Crime, Horror','Shane Ryan','','Amateur Porn Star Killer','The unofficial story of a killer who kidnaps and kills three girls is told through the tale of his last victim, ''Amateur Porn Star Killer'' is about a girl he picks up on the street and convinces to go back to his hotel room. The girl is shy, unnerved, and yet unable to take herself out of a bad situation. The killer is a guy who seems at first nothing more than your standard, 18 year old pervert with a penchant for filming his sexual escapades. An unsettling darkness descends.',NULL,'4.3','[{"id": "0b60f2f31aa77f33d6e80328232a742bb9282722"}, {"id": "0b60f2f35be4a73be644d4b7ebd76456314c43d2"}]');
INSERT INTO "movies" VALUES('tt2402600','Animation, Short, Action, Comedy, Family, Sci-Fi','Guy Vasilovich','','Lego Star Wars: The Empire Strikes Out','Luke Skywalker embarks on a mission to find and destroy an Imperial base on Naboo, but is relentlessly chased by a group of fanatic girls, who think of him as a celebrity for destroying the Death Star. Meanwhile, Darth Vader engages a "sibling" rivalry with Darth Maul, in order to prove he''s the best Sith Lord to Emperor Palpatine.',NULL,'7.3','[{"id": "0b60f2f38b016881335829c35872fb8cb37ab176"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f3123eee8d09969e5e5fb595d2e0d63173"}, {"id": "0b60f2f39ece4c8f149f5216ff7a5f5b0da2ea5a"}, {"id": "0b60f2f3376f3ca7c972e9e059e49a1ee75683a9"}]');
INSERT INTO "movies" VALUES('tt0458122','Action, Adventure, Sci-Fi','N/A','0b60f2f38bf80dbebe43a1854547b0af6a19fb11','Star Trek New Voyages: Phase II','These are the new voyages of the starship Enterprise. Picking up from where the original 5-year mission left-off, a new cast continues the adventures of this legendary crew: to boldly go where no human has ever gone before & to search for new life forms.',NULL,'6.7','');
INSERT INTO "movies" VALUES('tt0089877','Animation, Adventure, Family, Fantasy, Sci-Fi','Bernard Deyriès, Kimio Yabuki','','Rainbow Brite and the Star Stealer','Rainbow Brite, and her magical horse Starlite, must stop an evil princess and her underlings from taking over the planet Spectra. When they meet Orin, the wise Sprite tries to make the two children get along and work together to stop the evil Princess. Orin tells them that they can only destroy her by combining their own powers against her. Getting in the way of their mission is the sinister Murky Dismal and his bumbling assistant Lurky who, as usual, are lavishing in the new gloom created by the darkening of Spectra, as well as trying to steal Rainbow''s magical color belt.',NULL,'6.9','[{"id": "0b60f2f379b2dd9e286002dfbca3624c2e740ac6"}, {"id": "0b60f2f3888b9654c8d7382c047e1d1a8fbb6201"}, {"id": "0b60f2f3888b9654c8d7382c047e1d1a8fbb6201"}]');
INSERT INTO "movies" VALUES('tt0078692','Animation, Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Blazers','In the late 2100s, the planet Gamilon, a world far beyond Earth''s solar system, declares an invasion of Earth. The nations of Earth fight as one against the Gamilons, but one by one, Earth''s fleets are defeated. When the nations of Earth refuse to surrender, Gamilon begins bombarding Earth with planet bombs, radioactive missiles that look like meteors, which gradually spread deadly radiation all over Earth, forcing what''s left of humanity to retreat to underground cities. Queen Starsha of planet Iscandar contacts Earth and promises to provide Cosmo-DNA that can remove the radioactivity and restore Earth to beautiful life. She provides plans to an engine that will allow a brave, young group of technicians to journey more than a hundred thousand light-years to Iscandar, obtain the Cosmo-DNA, and return to Earth within one Earth year. In 2199, an ancient seagoing vessel is fitted with the awesome engine and launched toward Iscandar. Along the way, the intrepid crew must fight the Gamilons, who are determined to prevent the brave voyagers from saving Earth from extinction.',NULL,'8.4','');
INSERT INTO "movies" VALUES('tt0284060','Short, Drama','Stan Brakhage','0b60f2f350405ece5ad187c866c105d7524104ba','Dog Star Man: Part II','A man, accompanied by a dog, struggles through snow on a mountain side. We see film stock blister; drawn square shapes appear. Then, we see an infant''s face. The images of struggling climber, baby, blurred film stock, large snow flakes, and what may be microscopic details of matter are superimposed on each other, one dominating the frame briefly to be replaced by another. As the man falls in the snow and tries to regain his feet, the baby continues to appear, first with eyes closed. Alternately, images rush by - montages of paper cutouts and life under a microscope.',NULL,'6.5','');
INSERT INTO "movies" VALUES('tt0284061','Short, Drama','Stan Brakhage','0b60f2f350405ece5ad187c866c105d7524104ba','Dog Star Man: Part III','Sexual intimacy. Three kinds of images race past, superimposed on each other sometimes: two bodies, a man and a woman''s, close up, nude - patches of skin, wisps of hair, glimpses of a face and genitalia; strips of celluloid with lines and squiggles scratched on them; and, close-up shots of what appear to be the insides of living bodies - a heart beating, muscle and sinew and tissue wet with fluids. The exterior and interior of desire.',NULL,'6.5','');
INSERT INTO "movies" VALUES('tt4074502','Documentary, Biography','Belinda Sallin','0b60f2f3aab3145969c2bb1c038733c3a8c19791','Dark Star: HR Gigers Welt','He feels at home in places we would flee from and lives his life among the very things we fear. Throughout his life, HR Giger had inhabited the world of the uncanny, a dark universe on the brink of many an abyss. It was the only way this amiable, modest and humorous man was able to keep his fears in check. Giger was merely the bearer of dark messages, charting our nightmares, drafting maps of our subconscious and molding our primal fears. A film with and about the internationally acclaimed and controversial painter, sculptor, architect and designer (Oscar for ''Alien'').',NULL,'7.0','');
INSERT INTO "movies" VALUES('tt0058026','Drama, Short','Stan Brakhage','0b60f2f350405ece5ad187c866c105d7524104ba','Dog Star Man: Part IV','The fourth and final part of Dog Star Man (1964), an experimental film wherein a man climbs a mountain along with his dog.',NULL,'6.6','');
INSERT INTO "movies" VALUES('tt0027040','Romance, Comedy, Mystery','Stephen Roberts','','Star of Midnight','Friend Tim Winthrop asks criminal lawyer and amateur detective Clay Dalzell to find his girl, Alice, who disappeared a year earlier without a trace. When they go to the theater with Clay''s would-be fiancée, Donna Mantin, Tim recognizes the star, Mary Smith, as his girl, and yells "Alice," after which she bolts from the stage and disappears once again. Reporter Tommy Tennant knows why she bolted, but before he can tell Clay the reason, he is shot dead and Clay is wounded slightly in Clay''s apartment. The many suspects include Roger Classon and his wife, Jerry, who are looking for Alice to testify and save Roger''s friend from the electric chair for a murder he didn''t commit; Abe Ohlman, the producer of Mary''s show; and gangster Jimmy Kinland who seems to know more than he''s telling. It''s up to Clay, with the help of Donna, to trap the murderer and find Alice.',NULL,'6.7','[{"id": "0b60f2f3b4f349f9f13733a350792918191af800"}, {"id": "0b60f2f33f057a91b72367a1635a999770837899"}, {"id": "0b60f2f3fa4f9e202dded474949938af3d22f2da"}, {"id": "0b60f2f3f7e103f552e4f612495884038efa0b97"}]');
INSERT INTO "movies" VALUES('tt1239459','Action, Adventure, Horror, Sci-Fi, Thriller','Mat King','0b60f2f3ed46f343dcaf3db4b6f847820ba84a75','Star Runners','Given a undercover government mission to retrieve a "crate" from a distant planet, TY JOHNS and LEI CHEN find that they must smuggle not a crate, but a woman off world -- and when their rocket-ship crash-lands on a planet packed with vicious giant alien bugs, they''ll need all the cunning and ferocity they possess to stay alive...',NULL,'4.3','');
INSERT INTO "movies" VALUES('tt6332276','Documentary','Ira Steven Behr(co-director), David Zappone(co-director)','0b60f2f350405ece5ad187c866c105d7524104ba','What We Left Behind: Star Trek DS9','Ira Steven Behr explores the legacy of Star Trek: Deep Space Nine (1993).',NULL,'8.4','');
INSERT INTO "movies" VALUES('tt1877688','Comedy, Drama, Romance','Maggie Kiley','','Brightest Star','After the heartbreaking end of his first love, a recent college graduate sets out to win back the girl of his dreams only to discover a greater journey awaits him.',NULL,'5.1','[{"id": "0b60f2f3b6f97b1454692af0e0c632e88499a2c4"}, {"id": "0b60f2f34d1cc372bd9916d447928de87f3f8ca4"}]');
INSERT INTO "movies" VALUES('tt1334510','Documentary, Music','Havana Marking','0b60f2f350405ece5ad187c866c105d7524104ba','Afghan Star','"Afghan Star" is a TV show modeled on the UK''s "Pop Idol." We join the 2008 contest when it''s down to nine contestants, and we focus on two women, Setara and Lema, and two men, Hameed and Rafi. We watch the two women in particular: Satara sings with emotion and includes dance in her final performance, an action that puts her life in danger; Lema is traditional, but her very appearance brings death threats. The three finalists are from different tribes, and each makes a plea for Afghan unity. The camera visits families watching the competition, there are comments from people in the street, and we return home with a nervous Setara. In Afghanistan, singing is an expression of freedom.',NULL,'7.3','');
INSERT INTO "movies" VALUES('tt0120197','Comedy, Drama','Miguel Arteta','','Star Maps','Carlos wants to be an actor. But his father, Pepe, wants him to work in the family business, that is, male prostitution. Carlos decides that he will be one of his father''s boys until he can get his foot in the door in Hollywood. Finally one of his clients, a rich soap star, offers him a bit part in her show. Pepe tell Carlos that she is just using him and demands that he not see the women any longer. Carlos defies his father and when his big day comes he is finds out the harsh realities of life are even harsher than he imagined.',NULL,'5.9','[{"id": "0b60f2f3cf42c3299158b01c706baf8ac74153c5"}, {"id": "0b60f2f3cf42c3299158b01c706baf8ac74153c5"}, {"id": "0b60f2f35a43fc66fb2e137e6980d3bee0a019dd"}]');
INSERT INTO "movies" VALUES('tt0025830','Romance, Western','Robert N. Bradbury','','The Star Packer','John Travers and his Indian companion Yak are after the mysterious Shadow and his gang. When Sheriff Davis is killed, Travers becomes Sheriff. Catching two gang members, he learns of the room where the gang gets their orders from behind a fake wall safe and makes plans to trap the Shadow.',NULL,'5.3','[{"id": "0b60f2f3aeb99ff336b0841f88094b7bfd770d58"}, {"id": "0b60f2f3aeb99ff336b0841f88094b7bfd770d58"}]');
INSERT INTO "movies" VALUES('tt2566858','Comedy, Drama, Romance','Michael Feifer','0b60f2f3e781b0eb64a0b76755ffd3231d105848','A Star for Christmas','The only thing that is working in Cassie''s world is her small town business. Her Christmas Cupcakery is a huge success, but her love life is a mess. Cassie''s whole universe is turned upside down when she falls in love with a co-worker who is revealed to be the famous and notoriously troubled actor Alex Gray. There''s no denying that Alex and Cassie are in love, but can their relationship survive the pressure of Hollywood and the holidays?',NULL,'5.3','');
INSERT INTO "movies" VALUES('tt0043751','Action, Adventure, History, Romance, Western','Vincent Sherman','','Lone Star','Rip-roaring big star, big budget semi-historical story about cattle baron Devereaux Burke, who is enlisted by an aging Andrew Jackson to dissuade Sam Houston from establishing Texas as a republic. Burke must fight state senator Thomas Craden, in the process winning the heart of Craden''s newspaper-editor girlfriend Martha Ronda.',NULL,'6.2','[{"id": "0b60f2f3a11522d7fcd70da71688d5433f486c68"}, {"id": "0b60f2f3bb713d9498074f25cc6f340d04b20bb6"}]');
INSERT INTO "movies" VALUES('tt4591840','Family','Richard Elson','','A Christmas Star','Born under the Christmas Star, Noelle believes she has the gift to perform miracles, so when conniving developer McKerrod threatens her peaceful life she and her friends determine to use this gift to thwart his plans and save their village.',NULL,'5.2','[{"id": "0b60f2f37f005b9f0b7a67c3c8bfe08365382769"}, {"id": "0b60f2f3004c6baee5f75969784fc91693b6cad9"}]');
INSERT INTO "movies" VALUES('tt0448131','Drama','Gianni Amelio','','The Missing Star','Labourer Vincenzo travels from Italy to China in search of a machine with a deficiency that was produced in the now defunct establishment at which Vincenzo worked for years.',NULL,'6.8','[{"id": "0b60f2f3ddd1490cb0bb3232132378f0b6aad9ec"}, {"id": "0b60f2f33343423269501a02b887601be0b95c5a"}, {"id": "0b60f2f31df6d9557809734c5669b9b72ba52cad"}]');
INSERT INTO "movies" VALUES('tt0092006','Horror, Sci-Fi, Thriller','Lance Lindsay','','Star Crystal','Set in 2032, as missions from Earth are being sent to explore Mars. After two groups of astronauts are mysteriously killed following the discovery of strange artefacts on the martian surface, the crew of the SC-37 go in to try and find out what happened. They soon learn what became of their predecessors when a bloodthirsty space monster begins lunching on members of the crew. Will any of them make it back to Earth alive?',NULL,'3.5','[{"id": "0b60f2f3182879248e79f78bcebb1cdcbfcb5cf2"}, {"id": "0b60f2f33b365aa22fab7fa1f93e5684e7cfc7be"}, {"id": "0b60f2f3182879248e79f78bcebb1cdcbfcb5cf2"}]');
INSERT INTO "movies" VALUES('tt0418195','Action, Adventure, Sci-Fi','N/A','','Star Wars: Republic Commando','Utilizing the heralded Unreal engine, Star Wars: Republic Commando is a first-person shooter from the perspective of an elite member of a Republic Special Ops unit. Set at the start of the Clone Wars, players find themselves able to carry out missions, as a Clone Trooper squad leader, deep behind enemy lines.',NULL,'8.5','[{"id": "0b60f2f3792eaa5f38ec387e800068582d275778"}, {"id": "0b60f2f32cceb4aae1a4f8640362e267e78506ba"}, {"id": "0b60f2f3dba2eebe1977eecfeab02c6bdfa4d248"}, {"id": "0b60f2f3fd188b05fc215d762084dc0699d9cea4"}]');
INSERT INTO "movies" VALUES('tt0102962','Biography, History, Western','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Son of the Morning Star','The life of George Armstrong Custer comes alive in this made for television movie.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt1591490','Drama','N/A','0b60f2f350ab11b2efa035e5d42ca0596b561b54','Lone Star','A FOX series that was cancelled after the second episode that involves a con man who lives a double life. He''s married to two different women in two different Texas towns.',NULL,'6.9','');
INSERT INTO "movies" VALUES('tt0063731','Drama, History, War','Edvin Laine','','Here, Beneath the North Star','Täällä Pohjantähden alla is based on the book with the same title. It is a story of the little village. The movie starts in the 1890''s and it ends to the Finnish civil war in 1918. Story concentrates around a tenant farmer family, although it gives us a good look at the society at whole. While the class struggle depends, people of the village are driven to bloody civil war.',NULL,'7.6','[{"id": "0b60f2f3023b4fc9a44763b886eb8b285ac3b1d0"}, {"id": "0b60f2f369192c6098c73aa01bd7ad1ee54bc784"}, {"id": "0b60f2f37368a93901185b926f24e8e27e55b839"}, {"id": "0b60f2f37368a93901185b926f24e8e27e55b839"}, {"id": "0b60f2f329d5438c9ce0ff719571b6675b6ba757"}]');
INSERT INTO "movies" VALUES('tt0087945','Action, Comedy, Sci-Fi','Fred Olen Ray','','Star Slammer','Two women who have been unjustly confined to a prison planet plot their escape, all the while having to put up with lesbian guards, crazed wardens and mutant rodents.',NULL,'3.5','[{"id": "0b60f2f3824d79dfff4f1e0657aeaf59c7cbe52e"}, {"id": "0b60f2f3362aa597899c6e854e9ebac75e99b836"}, {"id": "0b60f2f3824d79dfff4f1e0657aeaf59c7cbe52e"}, {"id": "0b60f2f38a894b53dc2e0172ba0b724c89608c83"}]');
INSERT INTO "movies" VALUES('tt0000410','Documentary, Short','Frederick S. Armitage','0b60f2f350405ece5ad187c866c105d7524104ba','Demolishing and Building Up the Star Theatre','This film shows the demolition of the historic Star Theatre building (formerly Wallack''s) at the corner of Broadway and 13th Street, New York. To secure this unique picture a Biograph camera was kept constantly at work by specially devised electric apparatus for weeks, during which time exposures were made every four minutes, 8 hours a day. Before the contractors began their work of tearing down and after the last vestige of the building had been removed, 15 seconds of exposure at normal speed were made. Thus in the finished positive one views at first the old Star Theatre standing as it had for years looking down with serenity upon the bustle of Broadway traffic. Then as if struck by a tornado of supernatural strength, the building begins to crumble. Chimneys totters, walls cave in, and whole stories vanish, until at last the site shows only a cellar excavation; and the Broadway cars with the sidewalk procession continue as if nothing unusual had happened. When this view is shown in the reverse, the effect is very extraordinary.',NULL,'6.7','');
INSERT INTO "movies" VALUES('tt0160910','Action, Sci-Fi','Scott Ewers','0b60f2f3ba34bc150dda1528ed3e270225ce65cd','Star Wars: Jedi Knight - Dark Forces II','You play as Kyle Katarn, a mercenary whose skills progress into becoming a Jedi knight, to stop a team of dark Jedis from taking the valley of the Jedi''s power.',NULL,'8.7','');
INSERT INTO "movies" VALUES('tt0158208','Adventure, Action, Sci-Fi','Jon Knoles','','Star Wars: Shadows of the Empire','You are the protector of Luke Skywalker.',NULL,'8.2','[{"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f38d7ef03db580c18d214a403eb0877b34"}, {"id": "0b60f2f35988f621775659dbb7ad784c3795d71b"}, {"id": "0b60f2f396ca24b85df614e1c5c29ee0d93316f6"}, {"id": "0b60f2f3260b247af4e0d39a7442edffb315f1c2"}]');
INSERT INTO "movies" VALUES('tt0089297','Drama','Suzana Amaral','','Hour of the Star','Macabea has just moved to the big city after her aunt, who raised her, died. She gets a job as a typist and moves into a boarding house with three other women. In her spare time she listens to time Radio Station; on Sundays she likes to ride the subways. She describes herself saying, "I am a typist and a virgin, and I like Coca-Cola." Then she meets Olimpico, a north-easterner like herself, who has dreams of becoming a Congressman.',NULL,'7.4','[{"id": "0b60f2f33c495d0b0c57f82e82bbba0066fb618e"}, {"id": "0b60f2f35e30921ddc3c3c5fe6555850145eccbe"}, {"id": "0b60f2f347449f440478534933d009126b95eba9"}]');
INSERT INTO "movies" VALUES('tt0241985','Animation, Action, Adventure','Takao Shimizu','0b60f2f3f12fa69b230f5ea160f034f403ac8248','Star Fox 64','You take on the role of Fox McCloud, the leader of the Star Fox team. ''Star Fox'' is an elite group of fighter pilots that works as mercenaries for the Cornarian Army. Corneria is the home planet of the team, and also of Dr. Andross, a mad scientist who was responsible for the death of Fox''s father five years after General Pepper, the leader of Corneria, exiled him (Andross) to the planet Venom, and the Star Fox team went to investigate the strange activity from the planet. Many years later, Andross arises as the emperor of Venom and the supreme ruler of an almost unstoppable military force and declares war on the entire Lylat System, starting with Corneria. General Pepper calls the team to action. The orders: protect the key planets of the Lylat System, infiltrate Venom, and stop Dr. Andross.',NULL,'8.6','');
INSERT INTO "movies" VALUES('tt0038115','Short, Drama, Family, Western','Don Siegel','','Star in the Night','It''s Christmas Eve. Three cowboys have just bought out a store of items as Christmas presents, despite not having anyone to give the presents to. While two of them admit to wanting to impress the pretty sales clerk, the third just felt good buying gifts to give to someone. Riding through the dark desert on horseback, they see a flashing star off in the distance, which they ride over to investigate. The newly purchased second hand star is a sign just erected by Nick Catapoli for his business, the Star Auto Court. Nick has no Christmas spirit, especially as he deals with the problems of customers, this despite his wife Rosa serving all their customers with a smile and warm heart. He believes most people are hypocrites in that they espouse this spirit at this one time of the year while not having it any other time. As such, he does not want to extend his lobby as shelter for a drifter who just wants to come in from the cold for a little while. Although the drifter tries to explain the true meaning of Christmas to Nick, Nick watching the interactions of all those around him may be a better way to show him, especially when a young and obviously in distress young couple named José and Maria Santos arrive, with no more rooms available at the inn.',NULL,'7.8','[{"id": "0b60f2f3c3854428e414b11d5fcd78bc369f63b6"}, {"id": "0b60f2f39ba54f9a4f7948829a0a265e2cdb2ffa"}]');
INSERT INTO "movies" VALUES('tt0804909','Action, Adventure, Sci-Fi','Ted Morris','','Star Wars: Empire at War','The game is set before the Battle of Yavin, while the Empire is still constructing the Death Star. The campaign goes through the events before this, on both the Rebel and Imperial side.',NULL,'7.8','[{"id": "0b60f2f39f0769e4a0ce1c5fc82eb8517d835c83"}, {"id": "0b60f2f3fd188b05fc215d762084dc0699d9cea4"}]');
INSERT INTO "movies" VALUES('tt5430544','Adventure, Sci-Fi','Jamie Eden, Pete Gomer, Robert Hewson','0b60f2f36987ecc0ccd23c7c1a67a87b5fea63c3','Lego Star Wars: The Force Awakens','30 years after the destructive Battle of Endor, a new threat emerges from the bricks of the old Empire, the First Order. Their plan: to end the New Republic and the Resistance, complete their ultimate weapon, and take over the galaxy. Luckily, hope is not lost. A scavenger, a rogue stormtrooper, and the Resistance''s best pilot must come together with the aid of old allies to end the First Order''s plans brick by brick. The most beloved LEGO video game franchise by Traveler''s Tales returns to take you back to a long time ago in a galaxy far, far away with LEGO Star Wars: The Force Awakens - The Videogame!',NULL,'8.4','');
INSERT INTO "movies" VALUES('tt4957538','Sci-Fi','Sion Sono','0b60f2f36e01edaef7e7a2eabcf63aa7605c6ac0','The Whispering Star','A feminine android delivers packages to the scattered humans in the galaxy. With years to spare the android and us have time to contemplate what it is to be human.',NULL,'6.3','');
INSERT INTO "movies" VALUES('tt0004637','Comedy, Short','George Nichols','0b60f2f3926fbff9091bd5eea76407537d85938c','The Star Boarder','Charlie stays at a boarding-house, where he is the landlady''s favorite. Her husband grows jealous when observing this. Their little son has a camera. He happens to take some photos of his mother and Charlie in situations which are innocent but look indecent. He also takes a photo of his father and a female boarding-guest in a similar situation. In the evening the boy arranges a slide show in the boarding-house. Suddenly also the equivocal photos of his parents appear on the screen. His jealous father gets furious and starts chasing Charlie. Soon all the boarding-guests are involved in the fight.',NULL,'5.4','');
INSERT INTO "movies" VALUES('tt1325743','Drama, Romance','Danny Buday','0b60f2f3210c48f427777105ce915d39c1b6bc5b','5 Star Day','Four People. One Horoscope. Infinite Possibilities. Jake Gibson''s (Cam Gigandet) horoscope forecasts a perfect FIVE STAR DAY the morning of his birthday, but what''s foretold as a flawless day unfolds to be far less than stellar. Jake''s world turns upside down when all that could go wrong ... does. Determined that Astrology has no legitimacy, Jake embarks on a journey to test the theory of Astrology by finding the three people born the same time and place as himself - Sarah Reynolds (Jena Malone), Yvette Montgomery (Brooklyn Sudano) and Wesley Henderson (Max Hartman). The journey quickly uproots Jake from the small college town of Berkeley, California, to downtown Chicago where he sets out to find and interview Sarah, Yvette and Wesley to see if their birthdays proved to be as deplorable as his own. Jake''s pursuit in finding his three Astrological matches (or Zodiac twins) will not only test his convictions, but validate how life''s unexpected twists of fate can deliver much more than the anticipated. The unforeseen takes Jake from the Windy City, to the boardwalk of New Jersey''s Atlantic City, to the bustling streets of New York. What Jake learns along the way is an important lesson about life, love, fate and destiny that will unexpectedly change his life forever.',NULL,'5.8','');
INSERT INTO "movies" VALUES('tt5459566','Animation, Action, Comedy, Fantasy, Sci-Fi','N/A','','Lego Star Wars: The Freemaker Adventures','The series stars the Freemakers, a family of scavengers who build and sell starships from the scoured debris of space battles strewn throughout the galaxy. When their youngest discovers a natural connection with the Force through an ancient artifact . The Kyber Saber, his world is turned upside down, and he and his family are thrown into an epic struggle against the Empire to restore peace and freedom to the galaxy. Throughout their adventures, the Freemakers explore new worlds, meet new and familiar characters, and learn the true value of what it means to be a family.',NULL,'7.5','[{"id": "0b60f2f3d9ab204720a5d25013cfb8c48dcfa9bb"}, {"id": "0b60f2f34da64f6d819333436a3a54b4333eae55"}, {"id": "0b60f2f35f2ec215e4adb26fba2d933c40e44f50"}, {"id": "0b60f2f3672351a7f19d6be0c4761bcecf9d4ff0"}, {"id": "0b60f2f39275895e5fe231e12fcad39f15533083"}, {"id": "0b60f2f3fe44df5f80f8b4ddca2169e6ea2382d0"}, {"id": "0b60f2f3f7e4a4f91f17088d4073d68c0cba94b4"}, {"id": "0b60f2f344b67d53fd9c85a3e7c08cd9d5d34f5d"}]');
INSERT INTO "movies" VALUES('tt6323140','Documentary, Sci-Fi','N/A','0b60f2f35b864f37827d82d89a04ab3200f7a40e','Rogue One: A Star Wars Story - World Premiere','A behind the scenes look at Rogue One: A Star Wars Story.',NULL,'7.4','');
INSERT INTO "movies" VALUES('tt0215208','Action, Adventure, Sci-Fi','N/A','0b60f2f364c034fe3d768b9ffe74760d58a36c25','Star Wars: Episode I - The Phantom Menace','The Jedi attempt to protect Naboo from the greedy Trade Federation and, as they soon learn, the Sith.',NULL,'6.6','');
INSERT INTO "movies" VALUES('tt4664600','Short, Music','Russell Mulcahy','0b60f2f350405ece5ad187c866c105d7524104ba','The Buggles: Video Killed the Radio Star','The video for the Buggles'' classic one-shot, about how the rise of television (and, by extension, music videos) hurt the careers of those performers whose looks would not translate well to the new medium.',NULL,'6.8','');
INSERT INTO "movies" VALUES('tt2496120','Animation, Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Blazers 2199','In the year 2199, Earth is invaded by an extraterrestrial race known as the Gamilas, who hail from a dying planet and decide to make Earth their new home. The Gamilas proceed to rain radioactive bombs on Earth, rendering the planet''s surface arid and uninhabitable (but hospitable for their race). Earth''s space fleet is hopelessly outclassed by the Gamilas and all seems lost... until a mysterious space probe is retrieved on Mars. The probe contains blueprints, and a message from Queen Starsha of the planet Iscandar, who claims to have a device which can cleanse Earth of its radiation damage. The blueprints are of a supercraft that can enable any ship to head to Iscandar (situated in another galaxy) and back in a year, and with these plans the denizens of Earth secretly rebuild a Japanese battleship, the Yamato, into a great space battleship. A large intrepid crew of 999 departs for Iscandar in the Yamato to require the device... but with the menace of the Gamilas, can they succeed in time?',NULL,'8.2','');
INSERT INTO "movies" VALUES('tt0049792','Animation, Family, Short, Comedy','Friz Freleng','0b60f2f358b65675fb1244711743e320b2f81386','A Star Is Bored','Daffy Duck must double for Bugs in any slapstick which Warners considers too dangerous for its star Bug Bunny.',NULL,'7.7','');
INSERT INTO "movies" VALUES('tt3924450','Comedy, Drama','Anna Melikyan','','Star','Three different persons, three different lives are connected in a mysterious way. 15-year old teenager suffering of misunderstanding, his glamorous and arrogant stepmother and the young untalented but full of optimism actress. Their destinies aren''t predetermined and their lives are very fragile.',NULL,'7.1','[{"id": "0b60f2f3fad72eda4ec34f06e71a84a6621b8d34"}, {"id": "0b60f2f3a2517de073d2b60c0df2c2f4f12f97c5"}]');
INSERT INTO "movies" VALUES('tt0152073','Family, Fantasy, Romance','Martin Fric','0b60f2f37e332ab64449f14c9de7c40b5a4ddb00','The Princess with the Golden Star','A Czech fairy tale about a princess named Lada who runs away from home in a mouse fur disguise in order to escape an unwanted and forced marriage.',NULL,'7.3','');
INSERT INTO "movies" VALUES('tt0108213','Drama, Romance','Michael Miller','','Star','After Vietnam, Crystal Wyatt meets a returning soldier, Spencer Hill and although she is young they are drawn together and find they have a lot in common. Spencer''s visit is fleeting and although he leaves, Crystal still thinks of him often. Crystal''s father dies and her mother, who has never really loved Crystal, begins to mistreat her and use her as a skivvy. After years of this, Crystal is attacked and raped by her brother-in-law. When Crystal gets her father''s shotgun to kill her brother-in law, her brother-in-law accidentally shoots her brother, and Crystal runs away from the farm to San Francisco where she becomes quite well known as a singer. Menawhile, Spencer has embarked upon a socially beneficial, yet ill-advised marriage, when he meets Crystal again in San Francisco. They embark on a hurtful affair, but the path does not run smooth for them. As intertwined as their lives are, it takes Spencer time to act like a decent man and do what is right.',NULL,'5.8','[{"id": "0b60f2f3fa678f9650d766a1c760b92233f489c9"}, {"id": "0b60f2f3abf44dc9a12fa32358b2ab7711f1d522"}]');
INSERT INTO "movies" VALUES('tt0116728','Animation, Family, Musical, Romance','Stefan Fjeldmark, Jørgen Lerdam, Flemming Quist Møller','0b60f2f314967e34830892b65467991c31e04f5e','Hugo: The Movie Star','Hugo, the one-of-a-kind jungle animal, is snatched away from his home for a second time in another attempt for him to become an animal actor. Meanwhile, he''s reunited with Rita the kind, streetwise fox. Finding that life in front of and behind the camera isn''t so bad, he grows more unaccustomed to wild life once he escapes and slowly weakens his relationship with Rita.',NULL,'5.2','');
INSERT INTO "movies" VALUES('tt3973814','Horror, Sci-Fi, Thriller','Richard Cranor','','Star Leaf','Some Highs Are Out of this World. Star Leaf is a sci-fi thriller about an extra-terrestrial form of marijuana discovered in the Olympic forests. The main character is a veteran of the Afghanistan war, and the film has PTSD and its treatment with cannabis as an underlying theme. Shot entirely on Washington''s Olympic Peninsula, the movie stars Julian Gavilanes and Russell Hodgkinson of Sy-Fy''s Z-Nation.',NULL,'3.6','[{"id": "0b60f2f3c1fc889c284286c89ab28315633f524b"}, {"id": "0b60f2f396aea9e07c2248afe2ba4d29aa6938ee"}, {"id": "0b60f2f396aea9e07c2248afe2ba4d29aa6938ee"}, {"id": "0b60f2f396aea9e07c2248afe2ba4d29aa6938ee"}]');
INSERT INTO "movies" VALUES('tt0183816','Action, Adventure, Sci-Fi','Julian Eggebrecht','','Star Wars: Rogue Squadron','Luke Skywalker leads the Rebel Alliance''s elite starfighter unit, Rogue Squadron, into battle against the Empire.',NULL,'8.1','[{"id": "0b60f2f349da6ca017b6814daf0abe1d58e0fbe7"}, {"id": "0b60f2f3622139dcca67cd6223a9dade2de637a0"}, {"id": "0b60f2f3c39d2e5594c3431987737247bf983a97"}, {"id": "0b60f2f3792eaa5f38ec387e800068582d275778"}, {"id": "0b60f2f3aca7edb672af31fab38aa1969d7319b1"}, {"id": "0b60f2f34c1de2a37ad22d1a8b8118c29bbb2ea6"}]');
INSERT INTO "movies" VALUES('tt4855868','Animation, Action, Adventure, Comedy, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Lego Star Wars: Droid Tales','After the battle on Endor, the Rebels are retold the story of Episode I and Episode II through the vantage point of C-3PO. A shadowy figure is also listening and steals a ship. ....and R2-D2. C-3PO and Admiral Ackbar set out to rescue R2.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt1039988','Documentary','Kevin Burns','','Star Wars: The Legacy Revealed','Filmmakers, critics and even politicians discuss the social impact of the "Star Wars" films and the franchise''s reliance in mythology and history.',NULL,'7.8','[{"id": "0b60f2f37cbf7e7a66464e5c7288cda78b038e1f"}, {"id": "0b60f2f3af8a52e513fb4f25bb6910f0be05ba1b"}, {"id": "0b60f2f3f10aeb7bbb73ccecdb6212787e5264f4"}]');
INSERT INTO "movies" VALUES('tt0176048','Adventure, Comedy, Family, Fantasy, Romance','Václav Vorlícek','','The Prince and the Evening Star','The old King (Vladimír Mensík) is not satisfied with his four children. It is high time for the Princesses to get married and for the Prince to assume the reign. Once the King sets out to the fowling and he entrusts the kingdom to the Prince Velen (Juraj Durdiak). His sisters want him to provide them with the bridegrooms. A beautiful girl Evening Star (Libuse Safránková) appears to Velen and he falls in love with her at once. Evening Star also likes Velen and therefore, for a kiss, she helps him to get married his sisters to her brothers Moonbeam, Sunbeam and Wind. After the King returns home he does not find the daughters because the bridegrooms took them right away. The angry King assigns the Prince to bring them home.',NULL,'7.1','[{"id": "0b60f2f34bc093163940f6e139014efead055338"}, {"id": "0b60f2f39f5375a2e7a92bfbc5e478e81e7ddea6"}]');
INSERT INTO "movies" VALUES('tt0281088','Short, Drama','Stan Brakhage','0b60f2f350405ece5ad187c866c105d7524104ba','Prelude: Dog Star Man','A creation myth realized in light, patterns, images superimposed, rapid cutting, and silence. A black screen, then streaks of light, then an explosion of color and squiggles and happenstance. Next, images of small circles emerge then of the Sun. Images of our Earth appear, woods, a part of a body, a nude woman perhaps giving birth. Imagery evokes movement across time.',NULL,'6.9','');
INSERT INTO "movies" VALUES('tt3051894','Biography, Drama','Kamaleswar Mukherjee','','Cloud Capped Star','To Ritwik Ghatak film was not merely a form of entertainment, but a weapon, a medium to portray struggle of common men. He was successful neither in his career nor he could he become a good...',NULL,'8.1','[{"id": "0b60f2f30998da1297fc6031bfcfb3779dc6bd9a"}, {"id": "0b60f2f30998da1297fc6031bfcfb3779dc6bd9a"}, {"id": "0b60f2f30998da1297fc6031bfcfb3779dc6bd9a"}]');
INSERT INTO "movies" VALUES('tt0088870','Adventure, Fantasy, Sci-Fi','Fernando Colomo','','Star Knight','When a dazzling craft illuminates the sky above a medieval European village, the townspeople fear mayhem while the ruling party prepares for battle with the mysterious "dragon in the sky." After Princess Alba is discovered missing, the quest for power and the young girl''s affections drive Klever to free her from the strange cosmic knight. But is that her desire? Worldly boundaries are crossed in this gothic sci-fi tale of power, greed and the universal language of love.',NULL,'4.1','[{"id": "0b60f2f3c4deac8e4c9cd11fc4edbed62298efbe"}, {"id": "0b60f2f30087453fbe6478b5ca4a4324ccf6f5de"}, {"id": "0b60f2f30087453fbe6478b5ca4a4324ccf6f5de"}, {"id": "0b60f2f36df8a7e9cc440362d71e0fa6ab1f40bf"}, {"id": "0b60f2f36df8a7e9cc440362d71e0fa6ab1f40bf"}]');
INSERT INTO "movies" VALUES('tt0337887','Action, Comedy, Musical','Brad Martin','0b60f2f389b3f29157b49ec1bb9c819899444ec3','Confessions of an Action Star','A ''mocumentary'' on the rise and fall of Chip and Dales dancer turned martial arts action star, Francis Allen Sledgewick, AKA Frank Sledge. When fame and fortune caused Frank to lose his sense of what''s truely important, he realised he''s going to have to get in touch with his roots if there''s ever going to be a comeback.',NULL,'2.9','');
INSERT INTO "movies" VALUES('tt1161951','Crime, Horror','Shane Ryan','','Amateur Porn Star Killer 2','This sequel to Amateur Porn Star Killer. The film follows a deranged serial killer who poses as a filmmaker to lure women into his lair.',NULL,'3.7','[{"id": "0b60f2f35be4a73be644d4b7ebd76456314c43d2"}, {"id": "0b60f2f30be61e9d46de8882a61255164a3270a5"}]');
INSERT INTO "movies" VALUES('tt0295270','Documentary','N/A','0b60f2f392c41126cd32d589a8dfb1c693e24e89','From ''Star Wars'' to ''Jedi'': The Making of a Saga','Ever wonder how they ever made Star Wars, Empire Strikes Back, and Return of the Jedi? Well this documentary explains it all as we''re taken on a behind-the-scenes tour of the making of the Star Wars saga. It shows how the puppets are made and worked, and creator George Lucas talks about what influenced him to do it, and everything. Narrated by Luke Skywalker himself, Mark Hamill.',NULL,'7.7','');
INSERT INTO "movies" VALUES('tt1612560','Sci-Fi','Jon Burton','0b60f2f348adc2f668a9a090165e24f3d3a7cf5a','Lego Star Wars III: The Clone Wars','Anakin Skywalker and other Jedi fight their way through the Clone Wars in this interactive LEGO video game. You get to play through levels that make up seasons 1 & 2 of the TV series "Star ...',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt1534098','Action, Adventure, Fantasy','Haden Blackman','','Star Wars: The Force Unleashed - Ultimate Sith Edition','Casts players as Darth Vader''s "Secret Apprentice," unveiling new revelations about the Star Wars galaxy seen through the eyes of a mysterious new character armed with unprecedented powers.',NULL,'8.1','[{"id": "0b60f2f364c034fe3d768b9ffe74760d58a36c25"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f3f0baf0b72051eb05b776909d2cbfa955"}, {"id": "0b60f2f33c4fcd6b1680d3e2094898dd8ef55f65"}, {"id": "0b60f2f3b80e8f78a5c6b491d4513247f705bb6d"}]');
INSERT INTO "movies" VALUES('tt1312156','Romance','Andrew Lau Wai-Keung','','Look for a Star','Inspired by the relationship between Stanly Ho and his fourth wife, Angela, it''s a romantic comedy about a billonaire who falls in love with a feisty casino dealer. Rated PG',NULL,'5.6','[{"id": "0b60f2f3928915b9aff2e8f95b59097c69624845"}, {"id": "0b60f2f399c51c09fce00ee25f35bfbf2af1c4f3"}, {"id": "0b60f2f3ae82b7c871f0268e19ce2089bff3a7dc"}]');
INSERT INTO "movies" VALUES('tt2351379','Short, Action, Sci-Fi','Kelly Dolen','','Star Wars: Wrath of the Mandalorian','Years after the Clone Wars end, Darth Vader sends bounty hunter Boba Fett to Kashyyyk to track down the last of the Jedi. Fett, motivated by revenge for his father''s death, proves effective - but he soon finds out a terrible truth about Vader while on the hunt that gives him a change of heart.',NULL,'3.3','[{"id": "0b60f2f3cc863b698db46d9ea5eeb77934359b47"}, {"id": "0b60f2f353a64ada1eeed6a8966d345ccb4b702c"}]');
INSERT INTO "movies" VALUES('tt0456980','Animation, Action','Takahiro Imamura','','Fist of the North Star: New Saviour Legend','N/A',NULL,'6.8','[{"id": "0b60f2f34a64dddbec8c01e384df728aa0035f43"}, {"id": "0b60f2f384df6900d578af85d1d049da83540a6e"}, {"id": "0b60f2f334446ad03544ecbc63b5fa58a1755b46"}, {"id": "0b60f2f3affffa6617be5b8a9cc33beedbfcba99"}, {"id": "0b60f2f3bd205d0e0a2b3eda2e76b4bbcf6116ec"}]');
INSERT INTO "movies" VALUES('tt0416908','Animation, Family','Piet De Rycker, Thilo Rothkirch','','Laura''s Star','Laura is seven year old country girl, who''s just moved along with her family to a city. On her first night in their top floor apartment, she sees a shooting star, actually falling to earth, she finds it in a park and discovers it''s a living being. Taking it back home, she and her toddler brother Tommy discover it can do miracles like making people fly and bringing inanimate objects to life. But over time both notice that the longer it stays on earth, the weaker it becomes, can they along with next door neighbor Max find a way to send it back into outer space, before tragedy occurs?',NULL,'6.1','[{"id": "0b60f2f32190472e3995296bb98a553fa557bcd3"}, {"id": "0b60f2f37155d8cac12a870fcb4b960ff5b785e9"}, {"id": "0b60f2f327231225e470f886f8068545fc12987f"}, {"id": "0b60f2f325c26376b7a71263c7e684656b12af57"}, {"id": "0b60f2f3177ea29e939119c8098cd97ebd99735f"}, {"id": "0b60f2f3d624e6ca5029beb0afe7d5a3287796c0"}, {"id": "0b60f2f3bcb6c3847a0a2eadb7090602477d911d"}]');
INSERT INTO "movies" VALUES('tt5896468','Documentary','Stan Brakhage','0b60f2f3aacbd95a54d8e0584ff72e9d6a11a231','Dog Star Man','An experimental film from Stan Brakhage in which a man and his dog ascend a wooded mountain.',NULL,'6.4','');
INSERT INTO "movies" VALUES('tt0295414','Documentary','Robert Guenette','0b60f2f392c41126cd32d589a8dfb1c693e24e89','The Making of ''Star Wars''','Ever wonder how they ever managed to make a movie like Star Wars? Well, bickering droid duo C-3PO and R2-D2 host this tour of the mind of creator George Lucas and what inspired him to make the movie. Even interviewed are the cast and crew, even features scenes of when C-3PO, R2-D2, and Darth Vader planted their footprints (or in R2''s case, tread-prints) into cement. Also discussed is Star Wars mania, how fans loved the movie, collected the merchandise and danced the disco music. Also shown are behind-the-scenes looks at the movie, as well as how difficult each effect was in doing since they didn''t have the convenience of computer animation back then.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt0128274','Comedy, Sci-Fi','Bruno VeSota','','Invasion of the Star Creatures','A pair of comical soldiers (Robert Ball and Frankie Ray) investigate a mysterious crater in an atomic detonation area and discover several beautiful alien vixens (Dolores Reed and Gloria Victor) who plan to conquer the world using an army of vegetable monsters.',NULL,'3.0','[{"id": "0b60f2f3c414fc2a585c4b73acbfc67c6c4ad2a2"}, {"id": "0b60f2f3c414fc2a585c4b73acbfc67c6c4ad2a2"}]');
INSERT INTO "movies" VALUES('tt9680524','Reality-TV','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Glow Up: Britain''s Next Make-Up Star','A talented group of aspiring make-up artists attempt to prove their potential to industry professionals in this competition hosted by Stacey Dooley.',NULL,'6.4','');
INSERT INTO "movies" VALUES('tt0200172','Action, Sci-Fi','N/A','','Star Wars: Episode I - Racer','Compete in the galactic pod-racing championship as one of the many pod-racers featured in ''Star Wars Episode I: The Phantom Menace''.',NULL,'7.7','[{"id": "0b60f2f349da6ca017b6814daf0abe1d58e0fbe7"}, {"id": "0b60f2f3622139dcca67cd6223a9dade2de637a0"}]');
INSERT INTO "movies" VALUES('tt0444953','Animation, Comedy, Drama','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Kaleido Star','Sora, a young girl from Japan, comes to America in search of her dream. She wants, with all her heart, to be a member of the famous Kaleido Stage, a combination of musicals, acrobatics and magical effects. With the help of her friends, she struggles to make this dream come true.',NULL,'7.8','');
INSERT INTO "movies" VALUES('tt0399977','Adventure, Comedy, Reality-TV','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Ich bin ein Star - Holt mich hier raus!','I''m a Celebrity - Get Me Out of Here. (often referred to as a jungle camp) is a reality show that has been aired by the RTL since 2004.',NULL,'4.8','');
INSERT INTO "movies" VALUES('tt3854562','Action, Adventure, Sci-Fi','Tommy Kraft','','Star Trek: Horizon','In a time prior to the United Federation of Planets, a young coalition of worlds led by Earth battle the Romulan Star Empire for their very survival.',NULL,'5.7','[{"id": "0b60f2f34e85c7082a2c30799cb13bb58960e583"}, {"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}]');
INSERT INTO "movies" VALUES('tt3648510','Documentary, History, Sci-Fi','Brian Stillman','0b60f2f34d42f1855acb4a86f431cec0fa0d7765','Plastic Galaxy: The Story of Star Wars Toys','When Star Wars landed in the theaters, it introduced audiences to a galaxy filled with heroes and villains, robots and space ships, and a dizzying variety of alien life. But when the lights came up, they all disappeared... Unless you had all the toys. In which case, the adventure never had to end. In backyards, playgrounds, basements, and bedrooms, Star Wars toys helped kids re-enact scenes from their favorite movies, and create entirely new dangers for Luke Skywalker and his friends to face. They were lusted after on holidays and birthdays, swapped with great cunning out on the school yard, and carefully collected like fine treasures. Like no toys before them, the action figures, space ships, play sets, and props were a phenomenon that swept the nation with as much force as the film that inspired them. Along the way they transformed both the toy and movie industries, earned those behind them vast amounts of wealth, and ultimately created a hobby that, 30 years later, still holds sway over not only the people who grew up with the toys, but also an entirely new generation of fans. Plastic Galaxy is a documentary that explores the groundbreaking and breathtaking world of Star Wars toys. Through interviews with former Kenner employees, experts, authors, and collectors, it looks at the toys'' history, their influence, and the fond and fervent feelings they elicit today.',NULL,'6.4','');
INSERT INTO "movies" VALUES('tt0163281','Adventure, Sci-Fi, Action','N/A','','Star Wars: Dark Forces','N/A',NULL,'8.1','[{"id": "0b60f2f3d816ed339263436d2bf5c4e98c542453"}, {"id": "0b60f2f3ba34bc150dda1528ed3e270225ce65cd"}, {"id": "0b60f2f382f8df0f103fd5535127698d842ffae8"}]');
INSERT INTO "movies" VALUES('tt2361602','Drama','Keith Miller','0b60f2f38801c57545bb97ba1f949f520832026f','Five Star','A member of the notorious Bloods since he was 12 years old - both in the film and in real life - Primo takes John, the son of his slain mentor, under his wing, versing him in the code of the streets. Set in East New York, FIVE STAR blends documentary and fictional storytelling as director Keith Miller carefully avoids worn clichés of gang culture to offer a compelling portrait of two men forced to confront the question of what it really means to be a man.',NULL,'5.4','');
INSERT INTO "movies" VALUES('tt5502946','Animation, Family, Sci-Fi','Andrew Tan, Michael Goguen','','Barbie: Star Light Adventure','Barbie(TM) is a cosmic princess who flies high on her hoverboard through a far-off universe with her adorable and devoted pet sidekick, Pupcorn. One day, everything changes when the twinkling stars start to dim and slow their dance in the sky. Barbie(TM) travels to a beautiful new planet to join a special rescue team on a mission to save the stars. Once there, she teams up with a group of talented new friends who work together to save the galaxy through exciting hoverboarding adventures. Barbie(TM) soon discovers that if she listens to her heart, and with the help of her friends, she might be the leader the whole universe has been waiting for!',NULL,'5.9','[{"id": "0b60f2f3c079920366c0948aefcbdefe9a6f2c67"}, {"id": "0b60f2f36455a0d6b21ac21d03b31286dc72e145"}]');
INSERT INTO "movies" VALUES('tt1363363','Action, Adventure, Comedy, Drama, Mystery','Ajay Chandhok','','Chatur Singh Two Star','After an incident at Dadar Railway Station, Mumbai''s Police Commissioner Rajpal K. Sinha suspends bumbling police detective, Chatur Singh, but is compelled to reinstate him after no-one within his department wants to be assigned with the security of disgraced and arrested Agriculture Minister Y.Y. Singh, who, after feigning an illness, is hospitalized. Chatur and his deputy, Pappu Panther, accordingly attend to the hospital and screen everyone that goes to visit him, including his wife, Savitri, and Secretary, Sonia Verma. Shortly thereafter, Singh is assassinated, Sonia is arrested as a suspect and lodged in a cell and refuses to divulge any information. Chatur decides to let her escape so that he can follow her and find out who was behind this high-profile killing. Sonia does manage to escape but he is not quick enough to follow, and she ends up in Capetown. Chatur and Pappu must now travel there and not only locate and apprehend Sonia but also must try to investigate her involvement in her employer''s assassination.',NULL,'1.8','[{"id": "0b60f2f37ec94881e16637e43430a218bea8e7a1"}, {"id": "0b60f2f3f01773d7c34a2da94da3220d0946f807"}]');
INSERT INTO "movies" VALUES('tt1360833','Sci-Fi','Jon Bonnell','','Star Quest: The Odyssey','As our world expands to include the entire galaxy everyone rushes to claim their own piece of this new world and thousands of colonies arise. With no core government, rogue colonies begin to wreak havoc and without a centralized army to protect the innocent peace is all but lost. Now at the end of mankind''s greatest battle, empires will crumble, alliances will form, enemies will rise, and heroes will fall.',NULL,'1.5','[{"id": "0b60f2f31183e37f8aefa8518665cb701c5d130f"}, {"id": "0b60f2f3e9c14cbbfb3cce265b1a92992bb1bdea"}]');
INSERT INTO "movies" VALUES('tt2215191','Documentary, Music','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Justin Bieber: A Star Was Born','N/A',NULL,'1.0','');
INSERT INTO "movies" VALUES('tt2039380','Adventure, Sci-Fi','Mark Steven Grove','0b60f2f3e67ecca5916db7a62df045af690d5b86','Star Raiders: The Adventures of Saber Raine','Rocket ships, Rayguns, and Robots abound in this heart-pounding tale where the stellar adventurer Saber Raine is hired to guide three elite soldiers on a rescue mission to recover a prince and princess who have been abducted from their home world. The trail leads Saber and his allies to a planet deep within uncharted space that is inhabited by strange mutated creatures, leech-like desert marauders, renegade mercenaries, alien outcasts, and cybernetically enhanced soldiers that guard mysterious ruins of an empire long forgotten. Deep within the ruins, Sinjin, a sinister overlord freed from a cryogenic chamber that was his prison for many centuries, is now in league with the Quintari, a malevolent insectoid race known throughout the galaxy as the scourge. In possession of a powerful new energy source, Sinjin plots his revenge on the descendants of those who betrayed him in the past. Can our heroes complete their rescue mission and stop Sinijin from unleashing his fury on the universe? Find out in Star Raiders: The Adventures of Saber Raine!',NULL,'3.0','');
INSERT INTO "movies" VALUES('tt2275656','Action, Adventure, Sci-Fi','Rasmus Tirzitis','','Star Wars: Threads of Destiny','94 years after The Battle of Yavin, the New Republic has been resurrected and democracy once again rules the galaxy. The Jedi Order is reestablished on the planet Yavin 4, and has continued to train new Jedi Knights in the art of peace and justice. But all is not peaceful in this new world. With the fall of the Dark Empire, the ancient Skenvi Empire now comes out of the shadow to make its move. The Skenvi now oppose the New Republic for control over the galaxy with their aggressively growing empire. The Skenvi seek to seize control of all the galaxy''s most valuable resources to cripple their enemies. And if a planet refuses to join them, they have been known to take very aggressive actions. Caught in between this struggle over the fate of the galaxy is the little planet of Coreign. The planet possesses a very powerful resource that would greatly favor the side that has access to it if a galactic war was to emerge. In its eagerness to gain access to Coreign''s resources, the Skenvi Empire sends its most infamous negotiator, Lord Siege. He is a man who is known throughout the galaxy for seeing that the Skenvi Empire gets what it wants by all means necessary. The New Republic sends two of its Jedi ambassadors, Master Soran Darr and his padawan, Raven Darkham.',NULL,'4.0','[{"id": "0b60f2f305f16b832d03f13a6d2aaa7d3309552c"}, {"id": "0b60f2f359a0ac59439053ba160ebe475750b191"}, {"id": "0b60f2f31b2761ad42387bd0dd406654666e6c2f"}, {"id": "0b60f2f36b864321684cf7bd560c3001bd321205"}, {"id": "0b60f2f305f16b832d03f13a6d2aaa7d3309552c"}, {"id": "0b60f2f355faa31ec0fe32f8acc21e4d7565416d"}]');
INSERT INTO "movies" VALUES('tt1145479','Drama, Romance, War','Timo Koivusalo','','Under the North Star','A new film-adaptation of Väinö Linna''s famous book here Beneath the North Star.',NULL,'6.8','[{"id": "0b60f2f379a5a1950073a26f4976ca9d44dd60ae"}, {"id": "0b60f2f37368a93901185b926f24e8e27e55b839"}]');
INSERT INTO "movies" VALUES('tt1037715','Action, Comedy, Musical','Brad Martin','0b60f2f389b3f29157b49ec1bb9c819899444ec3','Confessions of an Action Star','A ''mocumentary'' on the rise and fall of Chip and Dales dancer turned martial arts action star, Francis Allen Sledgewick, AKA Frank Sledge. When fame and fortune caused Frank to lose his sense of what''s truely important, he realised he''s going to have to get in touch with his roots if there''s ever going to be a comeback.',NULL,'2.4','');
INSERT INTO "movies" VALUES('tt5637108','Animation, Action, Fantasy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Twin Star Exorcists','Grotesque monsters known as Impurities reside in Magano, a realm parallel to the present day. Exorcists purify these evil apparitions to protect the people. Rokuro Enmado is opposed to becoming an exorcist, even though he has the talent to be one, but an oracle gives him the title of "Twin Star Exorcist," the name bestowed upon married exorcists. Benio Adashino, the girl who receives the title along with Rokuro, is determined to exorcise all the Kegare, or Impurities, in the world. The two find themselves wrapped up in more and more battles together as the Twin Star Exorcists.',NULL,'7.1','');
INSERT INTO "movies" VALUES('tt0052815','Comedy','Robert Asher','','Follow a Star','Norman Truscott is a store worker who dreams of stardom. Vernon Carew is a singer who''s star is fading. Vernon manages to get a recording of Norman singing and passes it off as himself.',NULL,'6.7','[{"id": "0b60f2f3595e9dd5a32f2fd455a8e247501d7b70"}, {"id": "0b60f2f3e3d0dfdb060d43e11264aba0600e5277"}, {"id": "0b60f2f347995e01fd6e662875e508b120643994"}]');
INSERT INTO "movies" VALUES('tt0367037','Animation, Action, Drama, Fantasy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','New Fist of the North Star','Kenshiro is back to make more people''s heads explode in this 3 episode anime OVA.',NULL,'7.0','');
INSERT INTO "movies" VALUES('tt0022430','Drama','William A. Wellman','','The Star Witness','The Leeds family is thrown right in the middle of a war between the cops and gangland when they are the only witnesses to two murders committed by gang kingpin Maxey Campos. Initially positive in their identification of the murderer, their attitudes change when young Donny Leeds is kidnapped by Campos'' boys. No amount of threatening with perjury by D.A. Whitlock can get them to tell the truth - except for cantankerous old Grandpa, civil war veteran, who berates his family for failing to do their civic duty, whatever the cost. Though having his doubts as to the credibility of his star witness, Whitlock is nevertheless taken aback when he learns Grandpa has disappeared just before he is to testify.',NULL,'6.4','[{"id": "0b60f2f3620e9b57746e5c330a6fbcfe70c7e4ab"}, {"id": "0b60f2f3620e9b57746e5c330a6fbcfe70c7e4ab"}]');
INSERT INTO "movies" VALUES('tt0131028','Sci-Fi','Minoru Kanaya, Kiyosumi Kuzakawa','','Star Force: Fugitive Alien II','In this second film compiled from two episodes of a Japanese TV serial, Captain Joe, reformed interstellar marauder Ken and the rest of the crew of the Backus-3 set off to destroy an alien race''s super-weapon, face off with Ken''s vengeful ex-lover Rita and confront the sinister leader of the marauding Star Wolves.',NULL,'1.9','[{"id": "0b60f2f320038a5de037118f1c73a4acdda16e00"}, {"id": "0b60f2f3b6acf6d069fda91b33a817873150c925"}]');
INSERT INTO "movies" VALUES('tt0049793','Drama, Romance, Western','Charles F. Haas','','Star in the Dust','The sheriff of Gunlock is planning to hang Sam Hall, who shot three farmers found on cattle land, at sundown. At the casino, betting is 8 to 3 he won''t make it. The cattlemen are set to rescue Sam; the farmers hope to lynch him before he can be rescued; and Hall schemes for escape with his girl Nellie. But Sheriff Jorden is most concerned with finding out who hired Hall: a leading suspect is the sheriff''s future brother-in-law.',NULL,'6.1','[{"id": "0b60f2f3339429f6f50bbdb1a7faf1679551aba7"}, {"id": "0b60f2f3162cf2fea4521fc1af891a0db26b1926"}]');
INSERT INTO "movies" VALUES('tt0078317','Sci-Fi','Alfonso Brescia','','Star Odyssey','Earth is attacked by an intergalactic villain and his army of robotic androids.',NULL,'2.5','[{"id": "0b60f2f358b36152a622ff52ae93ec03c99740de"}, {"id": "0b60f2f3411bb6f19d783e8d0274a49b288f3503"}, {"id": "0b60f2f3b510cd975aa0f1a1aa4fe9c3d84a4685"}]');
INSERT INTO "movies" VALUES('tt0216129','Animation, Short','Evan Mather','0b60f2f38f6bc673020b3e70d3b8a9e62113e64d','Quentin Tarantino''s Star Wars','We''re all familiar with the story: a long time ago in a galaxy far, far away, on a planet called Tattooine, a boy named Luke Skywalker is adopted by the only remaining Jedi knight and helps the Rebellion destroy the Death Star after learning the ways of the force. However, what if "Pulp Fiction" director Quentin Tarantino had directed George Lucas'' script, using Kenner action figures and stop computer animation?',NULL,'4.8','');
INSERT INTO "movies" VALUES('tt0065025','Adventure, Comedy, Crime','Sidney Hayers, Orson Welles','','The Southern Star','Comedy adventure based on a Jules Verne novel about the ups and downs of jewel thieves in the wilds of Africa circa 1900. George Segal is the appealing hero-heel and Ursula Andress is visually stunning as the lady in the proceedings. Orson Welles has a small role.',NULL,'5.4','[{"id": "0b60f2f396086239674d3524a42457da84d6e45b"}, {"id": "0b60f2f3f4b3d7e0f94e3adf4edc1a0ccb29f317"}]');
INSERT INTO "movies" VALUES('tt0884317','Comedy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Stories','Comedy Thats Shows Us How Some Of The Worlds Biggest Stars Came To Fame',NULL,'7.4','');
INSERT INTO "movies" VALUES('tt0251413','Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars','In this game, you assume the role of Luke Skywalker and fight past many enemies to to reach and destroy the Death Star.',NULL,'7.8','');
INSERT INTO "movies" VALUES('tt0297319','Comedy','Marko Marinkovic','0b60f2f3ef5a575316099935c7f9382ebaad9b7b','She Likes Red Star','Srba is graduating pupil and football fanatic, or more precise king of a street soccer, who plays even without others, in a winter, summer, rain or snow, while his grandma lights narrow backyard (so called small Maracana) with a flashlight. He wouldn''t accept to become professional by no means and to play for money, rejecting offers of various scouts promising him a career in Spain, Greece, Germany, Turkey... main characters of Srba''s school days are his best friends, Daca who is secretly in love with him ever since first grade, professors Hannibal and Darwin and Beki, new schoolmate to whom Srba fells in love - and she loves Red Star...',NULL,'3.8','');
INSERT INTO "movies" VALUES('tt5117484','Comedy, Drama','Grant S. Johnson, Jena Serbu','0b60f2f34620ed0463afac6e38a9d3753d3948e3','Frat Star','"Frat Star" explores the alluring, superficial, manipulative, and dark world of Ivy League fraternity culture. An insecure, poor, and broken-hearted Nick enters freshman year with no interest in fraternities. This all changes when his old money roommate Billy convinces him to pledge.',NULL,'3.5','');
INSERT INTO "movies" VALUES('tt1156464','Drama, Romance, Sport','Mark Heller','','Star Crossed','A modern day "Romeo and Juliet" is told against the backdrop of professional football in Portugal, with two feuding teams, Castelo and Invicta, filling in as the Montagues and the Capulets. The latest incident in the feud is an on-field brawl between the players worse than they have ever had, which results in an indefinite suspension of both teams from the league pending a full investigation. Each game not played results in a loss and thus less and less chance of either team reaching the post-schedule championship. Beyond the direct measures to have the league lift Invicta''s suspension, its owner/president, José Carlos Silva, believes another indirect measure is to win in the court of public opinion by currying favor with Philip Andrews, a British documentarian filming a movie about the feud, and whose cameras and stories he hopes will document that Invicta is the innocent victim. To curry that favor, José, upon Philip''s expression of interest, is pushing his innocent daughter, Inês Silva, to date Philip, in who she truly has no interest despite Philip being a decent man. Meanwhile, one Castelo player not involved in that on-field incident is Brit Paul Collins, who was out sick that game and who is nursing a broken heart over a recent break-up with his girlfriend, Danielle. However, Paul and Inês fall in love at first sight when they spot each other across a crowded room at a party. Despite the obstacles, Paul and Inês do clandestinely see each other, with Carla, Inês'' paternal grandmother, and Dr. Lawrence, Paul''s American physician, reluctantly being their co-conspirators, reluctant in that they are more cognizant about a Paul/Inês relationship being fraught with life long problems. As Paul and Inês'' love deepens, so does the feud, the two which truly may be incompatible.',NULL,'5.9','[{"id": "0b60f2f390b0d079fc269ffc5060f94c860d4262"}, {"id": "0b60f2f3438f5dd623084005cffb4fab8413a16e"}]');
INSERT INTO "movies" VALUES('tt0420676','Action, Adventure, Family','Masahiro Sakurai','0b60f2f350405ece5ad187c866c105d7524104ba','Kirby Super Star','N/A',NULL,'9.2','');
INSERT INTO "movies" VALUES('tt1643247','Short, Action, Sci-Fi','N/A','','Star Tours: The Adventures Continue','In the newly opened Star Tours touring agency, C-3PO is accidentally made to be the pilot of a StarSpeeder 1000. Also on board the craft is one of the guests, who is revealed to be a rebel spy who must be safely delivered from the Empire. With multiple beginnings, middles, and ends, there are 54 possible routes the StarSpeeder 1000 can take.',NULL,'8.3','[{"id": "0b60f2f366b68d29030e77e77b73a196c3123628"}, {"id": "0b60f2f348adc2f668a9a090165e24f3d3a7cf5a"}, {"id": "0b60f2f306b7e0b22e1c6a90bb3b47946886d373"}]');
INSERT INTO "movies" VALUES('tt4287234','Thriller','Dave Schwep','0b60f2f3d5ff0e15b20cb02a0be042f0975ac25f','Broken Star','Abandoned by her friends and family and with her career in jeopardy, starlet Markey Marlowe is sequestered in a duplex with a reclusive landlord who just may be more dangerous than she is.',NULL,'4.2','');
INSERT INTO "movies" VALUES('tt0120198','Short, Action, Adventure','Mario Kamberg, David de Vos','','Star Trek: The Experience - The Klingon Encounter','An attempt by some evil Klingons to kidnap visitors at The Las Vegas Hilton is foiled when the 24th century starship U.S.S. Enterprise transports them safely aboard. Taken to the bridge, the guests are told by Commander Riker that the Klingons plan is to disrupt the future time-line. Riker orders Lt. Commander LaForge to take them through the Klingon battle-zone and back to the 20th century aboard a shuttle-craft so that the time-line can be restored.',NULL,'7.7','[{"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}, {"id": "0b60f2f38385ed175a1502ed5be1569562853cbc"}, {"id": "0b60f2f330d9328b9ecafc68664165941ce6f813"}, {"id": "0b60f2f31e7ff49263fcb20246dd21530e54b45e"}]');
INSERT INTO "movies" VALUES('tt0035379','Comedy, Musical','George Marshall, A. Edward Sutherland','','Star Spangled Rhythm','Pop, a security guard at Paramount has told his son that he''s the head of the studio. When his son arrives in Hollywood on shore leave with his buddies, Pop enlists the aid of the studio''s dizzy switchboard operator in pulling off the charade. Things get more complicated when Pop agrees to put together a show for the Navy starring Paramount''s top contract players.',NULL,'6.8','[{"id": "0b60f2f346fd4021e96e66b60a928ecac9426d28"}, {"id": "0b60f2f3827ef099fd9e69b2a1b609f336d1d41a"}, {"id": "0b60f2f30509820af1b84d5e3580c89c2c3698d9"}, {"id": "0b60f2f3733963e57f40f0bbc0c23b8d417ae4f2"}, {"id": "0b60f2f36130d5816064a82d331d613ff16775d1"}]');
INSERT INTO "movies" VALUES('tt0095077','Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Earth Star Voyager','The Earth Star Voyager is a spaceship sent to another solar system to prepare it for colonization. Earth itself is horribly polluted, so the mission is vitally important. But as the ...',NULL,'7.0','');
INSERT INTO "movies" VALUES('tt2102502','Action, Adventure, Comedy, Romance','Dennie Gordon','','My Lucky Star','A woman gets caught up in an international diamond heist which pushes her close to a spy who is trying to save the world.',NULL,'5.0','[{"id": "0b60f2f3e1bbece05b6cb356c2072d02f3523017"}, {"id": "0b60f2f31a626277e1fac39b53b953ebe341bc40"}, {"id": "0b60f2f329aa07bde8de958cadfc1006b90038a2"}, {"id": "0b60f2f32d6d62d636cac6bafb3dc33c8acc4113"}, {"id": "0b60f2f33391f8fc0bd7ac48d40c2f856fc1ea85"}, {"id": "0b60f2f3e1bbece05b6cb356c2072d02f3523017"}, {"id": "0b60f2f398ea02b7b0223f3b2a16e6409493387c"}, {"id": "0b60f2f38f14f992a720d0d547d8ae20d5e22b85"}]');
INSERT INTO "movies" VALUES('tt0023175','Comedy, Drama, Romance','William Beaudine','','Make Me a Star','Menton Gill is longing to become a cowboy actor and leaves his hometown to try his luck in Hollywood, but there his acting ability is regarded as non-existent. Actress Flips gives him a chance in a bit part, but he fails in that; however, the way he fails makes her think that he could be a good comedian. She persuades the studio to put him in a western parody, not telling him what they''re really planing, because they know that he does not like comedies. Rather than ending tragic-comically, the movie becomes a brilliant coda to art and its servants, the artists, in this case the magniloquent Joan Blondell and Stuart Erwin.',NULL,'6.5','[{"id": "0b60f2f380a3cd1023a1bc52e9fd9ecc8d7e126e"}, {"id": "0b60f2f355c4db1ef96f3034943e5174ff67f8bf"}, {"id": "0b60f2f38d318dc115a346d1b757e24c77409376"}, {"id": "0b60f2f33402c522a18583a938eaa61d7f90c97b"}, {"id": "0b60f2f3827ef099fd9e69b2a1b609f336d1d41a"}, {"id": "0b60f2f394d7a555355d4051f36481e8d4191431"}]');
INSERT INTO "movies" VALUES('tt0459164','Music','Tippy Bushkin','0b60f2f319cb8c2b336fb1891e5cb812bf1f72cb','Star Wars: A Musical Journey','Actor Ian McDiarmid introduces several music videos featuring the famous Star Wars scores composed by John Williams. There are sixteen chapters in all, and are all perfectly created to show us the great music from the six films.',NULL,'8.6','');
INSERT INTO "movies" VALUES('tt0143901','Action, Adventure, Sci-Fi','Simon Ffinch, Guymond Louie, Rick Rasay','','Star Trek: Generations','Captain Jean-Luc Picard and the crew of the Enterprise-D are in the middle of a crisis that has been in effect for more then 80 years. An evil El-Aurian scientist named Tolian Soran has been destroying stars in order to change the path of a space anomaly called the Nexus, a ribbon of energy that acts as a gateway to another reality where all of your hopes and dreams come true. In order to do so, Soran has teamed up with the renegade Klingon faction lead by the Duras sisters, and plans on destroying the Veridian system (inhabited with hundreds of millions of people) in order to cross over into the Nexus.',NULL,'7.1','[{"id": "0b60f2f369dff44ae57277e285ff73e355ccd248"}, {"id": "0b60f2f383e3e3ab72b86be7cc18206259084a40"}, {"id": "0b60f2f311ff29e8beda383a4fde9502c2f4c1c2"}, {"id": "0b60f2f3506c7f818b5d1b4075e87177035e7e3c"}, {"id": "0b60f2f38c5f7abc002fb0b9ec8222e36e872905"}, {"id": "0b60f2f356090eeaf0fda0377a6fc4a6639e6998"}, {"id": "0b60f2f3dec7495f3c3dbff4bb79b8f2e4f96624"}, {"id": "0b60f2f3ae5ecd9f27aad3061c0529b065357314"}, {"id": "0b60f2f349ce9eb1c06d56b3210df238263a5590"}, {"id": "0b60f2f33ac02eeab633006e3bdf65991150e72a"}, {"id": "0b60f2f3e469440cfb0c0950660d00ab22386e59"}, {"id": "0b60f2f3b057087f51d43fe55e80546907274cf4"}, {"id": "0b60f2f3735c663ce56ab661f965796264631324"}, {"id": "0b60f2f39ee864679cb48d7dca42a1e0248dd5d6"}]');
INSERT INTO "movies" VALUES('tt0064385','Comedy, Drama, Romance','Aleksandr Mitta','','Shine, Shine, My Star','The story of a young actor during the Civil War years who drives around the countryside giving free performances in order to bring art to the masses.',NULL,'7.5','[{"id": "0b60f2f38fc986d48f5ff0403a1bda528ea6e6b5"}, {"id": "0b60f2f3fddc8501b2249e171b475fa9826779bd"}, {"id": "0b60f2f38bcd7810bb8cdc70b14ba27c318e4177"}]');
INSERT INTO "movies" VALUES('tt1509637','Animation, Short, Comedy, Sci-Fi','Peder Pedersen','','Lego Star Wars: The Quest for R2-D2','During a space battle with the sepretists R2-D2 ends up blasting out of Anakins ship and end''s up getting lost with precious data. Now the Jedi and the sith are hunting down the droid. Who will win?',NULL,'6.5','[{"id": "0b60f2f331d1714993bf8877be910cb7fd5d9035"}, {"id": "0b60f2f30670ab869561107ca47580c40828a0e2"}, {"id": "0b60f2f3fe44df5f80f8b4ddca2169e6ea2382d0"}, {"id": "0b60f2f3f7e4a4f91f17088d4073d68c0cba94b4"}, {"id": "0b60f2f3ec5c5a5f6109b0dbd0515cd614a82354"}, {"id": "0b60f2f3263690c1b0cdaef36aab42e246e9cbf7"}]');
INSERT INTO "movies" VALUES('tt2322683','Comedy','Lucio Pellegrini','','È nata una star?','Mother find out from her neighbours, that her teen son is a pornstar with really big tool. This comedy shows how mother and how father deal with this problem.',NULL,'4.9','[{"id": "0b60f2f39c6192ed0ac15326b0a79e0ad60fd554"}, {"id": "0b60f2f3698e2281a6840d6755595572e44d2c05"}, {"id": "0b60f2f3066c46b15784c46b28cf4be5381c27ce"}]');
INSERT INTO "movies" VALUES('tt0140181','Animation, Action, Adventure','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Fist of the North Star 2','Peace was brought to the land by Kenshirô years ago. But now he is gone; merely a legend. Along with the peace came a distinction in classes, and soon a new era of violence began. A new tyranny arose, the fearsome fighters of the Gento Kô Ken style that fight for their Emperor of Heaven. Rin and Bat have grown up and formed a resistance called the "Hokuto Army". When times are at their worst, Kenshirô returns! Can he stop the Gento terror? And what is the secret of the mysterious Land of Shura?',NULL,'8.3','');
INSERT INTO "movies" VALUES('tt6078842','Family, Romance','Takehiko Shinjo','','Daytime Shooting Star','Suzume Yosano''s parents have decided to move to Bangladesh when her father''s job gets transferred there. However, they''re not taking her with them. So, Suzume moves to Tokyo to live with ...',NULL,'6.9','[{"id": "0b60f2f3ac932ff296b52ce368a21b5fdebc1f4d"}, {"id": "0b60f2f34b5723683e15b9773399d66fd39d5589"}]');
INSERT INTO "movies" VALUES('tt5449296','Comedy, Family','Robert Vince','','Pup Star','Welcome to a world where dogs can not only talk -- they can SING! Tiny, a cute little Yorkie pup with a big voice, gets a chance to audition for the singing competition for dogs, "Pup Star." After she earns a place in the finale, she''s suddenly dog-napped! But with the help of her new friend, Charlie, a retired rock-and-roller, she escapes. Together they leave on an incredible journey through some of music''s most iconic cities. They meet Big Ears - a soulful Bassett Hound who teaches Tiny to belt out the blues, Murray - a spiritual shaggy dog who helps her find her inner rhythm, and Emily Rose - a country-singing shepherd who helps her learn to sing from her heart. Most important of all, they all encourage Tiny to believe in herself and never give up on her dreams! Filled with all-new songs and the biggest cast of talking and singing canines ever assembled, Pup Star is an incredible family film filled with fun, music and heart.',NULL,'4.2','[{"id": "0b60f2f3eb770cfc69be272186fbdb25208c1bc9"}, {"id": "0b60f2f3dd29ce9f715f6142cd626818f90c7104"}, {"id": "0b60f2f3dd29ce9f715f6142cd626818f90c7104"}, {"id": "0b60f2f36b6a2cd8ea3b05657b6d4080777aaf06"}, {"id": "0b60f2f36b6a2cd8ea3b05657b6d4080777aaf06"}]');
INSERT INTO "movies" VALUES('tt0233274','Biography, Drama, Family','Nadia Tass','','Child Star: The Shirley Temple Story','The life, laughters, and luck of one of the most famous and beloved child stars, Shirley Temple.',NULL,'6.2','[{"id": "0b60f2f389f6b33a9a20e181f98400be85eae73f"}, {"id": "0b60f2f3f473c83279c2fcb0bd83abf43476459e"}]');
INSERT INTO "movies" VALUES('tt2191526','Action, Adventure, Sci-Fi','N/A','','Star Trek','Kirk and Spock team up against the Gorn.',NULL,'6.9','[{"id": "0b60f2f32f274541b3629561b5e5246bc2821f2c"}, {"id": "0b60f2f35a158dc6d9c6a2024da15ab6ec6f56dc"}, {"id": "0b60f2f3aa68a9c54c9df5376df66eb1a4f3fe7f"}]');
INSERT INTO "movies" VALUES('tt0175245','Comedy, Drama, Romance','Bob Clark','','Catch a Falling Star','Sydney Clarke is a spoiled famous actress who is shooting a film when she suddenly gets angry and storms off. She wakes up in the middle of nowhere and gets a ride to a small New England town. There she meets and develops a friendship with Joyce, a waitress at a bowling alley. There she meets Ben, a steel mill owner, and later when she goes to get a job in that small town, she meets Ben again. Sydney becomes a nurse at the mill. All the men adore her. There they have many great times together, and Sydney realizes how important real friends are and that small towns are better than big name Hollywood.',NULL,'6.0','[{"id": "0b60f2f3cb5546a813a969112d63865261e7b6f1"}, {"id": "0b60f2f3cb5546a813a969112d63865261e7b6f1"}, {"id": "0b60f2f3a7d422b3c3be837df4d1f3315995e151"}, {"id": "0b60f2f342191909dabf8c6b4bba548466dfbb80"}, {"id": "0b60f2f342191909dabf8c6b4bba548466dfbb80"}]');
INSERT INTO "movies" VALUES('tt0091750','Crime, Drama','Ron Satlof','','Perry Mason: The Case of the Shooting Star','A comedian hatches a great joke: rig a fake killing live on TV. He takes a gun with blanks, and shoots his accomplice during a talk show. Happy that his joke has been successful, he walks away. His accomplice is really dead, however, and nearly a million viewers saw him pull the trigger.',NULL,'6.9','[{"id": "0b60f2f329685a52f06ff499fad334092a9de4c1"}, {"id": "0b60f2f3c4c3e2e54780a0224cf2d71786c155ca"}, {"id": "0b60f2f3faa66c5cb50c2e56d207d0e01ce6ed5f"}, {"id": "0b60f2f33d144626e62661cad16d06490949bd12"}]');
INSERT INTO "movies" VALUES('tt3038578','Animation, Action, Comedy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','King Star King','King Star King is an intergalactic warrior who fights various evil foes throughout the Gigantiverse. Always buy his side are his team of "strange heroes" which includes Hank Waffles, Pooza the Wizard, and Gurbles the flying robot bear.',NULL,'5.9','');
INSERT INTO "movies" VALUES('tt3014650','Animation, Family, Fantasy, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Lego Star Wars: The Yoda Chronicles','Centered around Yoda''s stories that take place before ''''Lego Star Wars: The Padawan Menace''''. Yoda begins by training Padawans at the Jedi Temple Academy, but then he feels a disturbance in the Force and rushes off to fight the Dark Side.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt0220472','Documentary','Jon Kroll','0b60f2f3843845b88921ef5397fc22f0777a7866','From Star Wars to Star Wars: The Story of Industrial Light & Magic','The incredible evolution of George Lucas'' special effects dream factory, including an inside look at "Star Wars: Episode One - The Phantom Menace."',NULL,'7.2','');
INSERT INTO "movies" VALUES('tt3248132','Action, Adventure, Fantasy, Thriller','Luca Boni, Marco Ristori','','Morning Star','In time of war, a man must survive to make a journey to fulfill a promise made and discover the truth. After a terrible battle, he sees his great friend perish, leaving him one request - that he visit the king, father of the deceased, to give him the news of his death. Stuck to the promise, the warrior part to the meeting with the king, who lost his only heir.',NULL,'2.7','[{"id": "0b60f2f3d7045aef339bac0333cd35d02c7e4c12"}, {"id": "0b60f2f3e7898576f2e4bf57e1b5e6ac9317032d"}]');
INSERT INTO "movies" VALUES('tt5970302','Animation, Short, Drama, Fantasy','Norihiro Naganuma, Tetsuaki Watanabe','','The Ancient Magus'' Bride: Those Awaiting a Star Part 2','N/A',NULL,'7.8','[{"id": "0b60f2f37667cd5f80ae7a169274dc9d74a642cb"}, {"id": "0b60f2f37667cd5f80ae7a169274dc9d74a642cb"}, {"id": "0b60f2f3bf35b631581abca519dba35a99998192"}, {"id": "0b60f2f3aae5a0620aaebcd0e023d6e4b7eba57e"}]');
INSERT INTO "movies" VALUES('tt0164179','Action, Adventure, Sci-Fi','N/A','','Star Wars: Jedi Knight - Mysteries of the Sith','The game starts with Kyle Katarn from Jedi Knight and Dark Forces battling his way onto an asteroid that is being used by the Empire to attack a rebel outpost. Kyle then leaves and the focus shifts to his apprentice, Mara Jade, who completes several missions for the rebels before setting out to locate the missing Kyle.',NULL,'7.9','[{"id": "0b60f2f37e1780ba60b447d78712d33be1b0154a"}, {"id": "0b60f2f37e1780ba60b447d78712d33be1b0154a"}]');
INSERT INTO "movies" VALUES('tt11518196','Sci-Fi','James Thomas','0b60f2f3b07a78d73f1f54a796f202a063e3b378','Battle Star Wars','When the leader of the evil Coalition threatens to destroy a Rebel planet for its resources, his daughter will have no choice but to join the Rebel side and fight for what is right.',NULL,'1.6','');
INSERT INTO "movies" VALUES('tt5126178','Adventure','Bret Miller','0b60f2f30dcce5393d698e4606b6e55be4e0fb97','Chasing the Star','Three Magi Priests journey the unforgiving desert in search of the new born King.',NULL,'3.1','');
INSERT INTO "movies" VALUES('tt0329241','Documentary','Peter Fitzgerald','0b60f2f3225f50f1e43ceecaee5630e08009b334','Joan Crawford: The Ultimate Movie Star','In this documentary on the life of ''Joan Crawford'', we learn why she should be remembered as the great actress she was, and not only as the "mommie dearest." caricature she has become. Friends, fellow actors, directors, and others reminisce about their association with her, and numerous film clips show off her talent from her start in silents to bad science fiction/horror movies at the end of her career. Daughter ''Christina Crawford'' even explains the origin of the phrase "No more wire hangers!".',NULL,'6.2','');
INSERT INTO "movies" VALUES('tt0304743','Action, Fantasy, Sci-Fi','Katsuya Eguchi','0b60f2f350405ece5ad187c866c105d7524104ba','Star Fox','Join the Star Fox team as you battle the forces of the evil Andross.',NULL,'8.1','');
INSERT INTO "movies" VALUES('tt6117002','Comedy, Talk-Show','Mike Stoklasa','0b60f2f3dee2a710f2c85009bc9c86923672bdbd','Mr. Plinkett''s The Star Wars Awakens Review','Mr Plinkett discusses his views and personal feelings on The Force Awakens and the current state of the Star Wars franchise.',NULL,'8.0','');
INSERT INTO "movies" VALUES('tt2896278','Animation, Adventure, Sci-Fi','Michael Hegner','0b60f2f38b016881335829c35872fb8cb37ab176','Lego Star Wars: The Yoda Chronicles - The Phantom Clone','Grievous lures Yoda away from the Jedi Temple and steals the Padawans light sabers. Dooku plans to use the crystals inside the light sabers to make Sith clones. It is up to Yoda and the Padawans to prevent Dooku from carrying out his plan.',NULL,'7.0','');
INSERT INTO "movies" VALUES('tt1900920','Drama, Romance','Carlos Portugal','','Pop Star','When talented young singer, Roxie Santos, meets music producer, Eddie Marz, he promises her an amazing new lifestyle and a future record deal. All he needs her to do is first lend her voice to a celebrity with no singing talent. However, when things go too far and it looks like she might lose her "voice" forever, she sets off to prove the truth.',NULL,'4.8','[{"id": "0b60f2f3c8aad4c0befeb7dcd4c9f14ecc776102"}, {"id": "0b60f2f3ce861439ef45646ebceba5bcfbabcd17"}, {"id": "0b60f2f3853f48e4e02c8010f3d0b2fb449f1928"}, {"id": "0b60f2f3dc8546eaa7008e977347b3540e8983f9"}]');
INSERT INTO "movies" VALUES('tt0090840','Drama, Family','Alan Shapiro','','The Christmas Star','Horace McNickle (Edward Asner) is a two-time felon serving prison time for counterfeiting. On the week before Christmas, he escapes from prison dressed as Santa Claus due to his uncanny resemblance to St. Nick resulting from his long white beard and heavyset features. McNickle hides out from the police in a nearby suburban neighborhood where he is befriended and helped by two local children who think he is the real Santa Claus. McNickle takes advantage of the kids naivety to help him get his counterfeit money hidden somewhere in a local department store while he develops kind-hearted feelings for his two con victims that make him slowly understand the true nature of Christmas.',NULL,'6.5','[{"id": "0b60f2f3082b6b76071db0ee818518bf369e2e96"}, {"id": "0b60f2f32143ce1f62258a5ded9cbbb233c96336"}, {"id": "0b60f2f32143ce1f62258a5ded9cbbb233c96336"}, {"id": "0b60f2f32143ce1f62258a5ded9cbbb233c96336"}]');
INSERT INTO "movies" VALUES('tt0203946','Action, Adventure, Sci-Fi','N/A','','Star Trek Voyager: Elite Force','Lt. Commander Tuvok, chief officer of the USS Voyager, has started a force against the dangerous races of the Delta Quadrant. You play as a member of this Elite Force of Starfleet Security officers as you battle the Borg, Hirogen, Species 8472, and other races of the Delta Quadrant. Your arsenal includes weapons seen on Voyager, as well as new alien and prototypical Starfleet weapons.',NULL,'8.3','[{"id": "0b60f2f3f320a160612601277d3929e9ae29a8d1"}, {"id": "0b60f2f331d6b701e2d8f3f89f72e5c11e1596ba"}]');
INSERT INTO "movies" VALUES('tt0058859','Adventure, Sci-Fi','Pietro Francisci','','Star Pilot','Aliens from the constellation Hydra crash-land on the island of Sardinia. A prominent scientist, his daughter, several young technicians, and a pair of Oriental spies are taken hostage by the beings so they can use them to repair their spaceship''s broken engine. With that done, they take off towards their home planet, taking the earthlings with them. However, the humans attempt to mutiny against their captors, inadvertently sending their tiny spaceship hurtling into the infinite beyond...',NULL,'4.3','[{"id": "0b60f2f368ba248bb11c778351814ebac38d2a17"}, {"id": "0b60f2f38d5c30d377f0716e8dc5206e9414e183"}, {"id": "0b60f2f391ba624685c59f4409663f1c4c6f26c2"}]');
INSERT INTO "movies" VALUES('tt9353248','Animation, Short, Action, Adventure, Family, Fantasy, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars Galaxy of Adventures','Key moments and characters of the ''Star Wars'' saga are reintroduced in short animations.',NULL,'5.1','');
INSERT INTO "movies" VALUES('tt0304746','Action, Adventure, Sci-Fi','Julian Eggebrecht','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars: Rogue Squadron II - Rogue Leader','In this sequel to "Rogue Squadron," Rebel Alliance pilots Luke Skywalker and Wedge Antilles lead the titled squadron on a series of missions that ties in with the universe of the original Star Wars trilogy from the Death Star Trench Run to the Strike at the Core inside the Death Star II.',NULL,'8.0','');
INSERT INTO "movies" VALUES('tt0185712','Action, Adventure, Sci-Fi','Kalani Streicher','0b60f2f350405ece5ad187c866c105d7524104ba','Super Star Wars: Return of the Jedi','The Empire is rebuilding the Death Star and planning a big attack on the Rebels. Meanwhile back on Tatooine, the evil Jabba the Hutt is causing trouble. He also has in his possession Han Solo, who''s been frozen in carbonite in the last adventure, so in a land speeder, Luke Skywalker, Chewbacca and Princess Leia rush to Jabba''s palace. After a treacherous ride over cliffs and rocks, you arrive. Leia is dressed as bounty hunter Boush. You rescue Han Solo, then you must defeat Bib Fortuna, survive the Rancor pit, treacherous rides on Skiffs, and send Jabba the Hutt to an early grave! Soon after you all travel to the exotic moon of Endor, while Lando Calrissian leads Rebel pilots into a full scale attack on the Empire. Luke and Leia must survive a fast and furious Speeder rides, avoiding trees. Then they meet Wicket and the rest of the Ewoks who help rid the Ewok Village of Imperial Troops. Luke, meanwhile, heads into the forest and allows himself to be captured and taken onboard the Death Star where he must engage into a lightsaber battle with Darth Vader, and even the Emperor himself! And then, Lando flies the Millennium Falcon into the Death Star and destroys the breaking point, which is the good news because the Death Star will now simultaneously combust. The bad news: you''ve got to zoom out of there at the speed of light, avoiding walls and small ceilings! If you are successful, the Death Star will once and for all be blown away into the heavens, and the Rebels will live happily ever after.',NULL,'7.9','');
INSERT INTO "movies" VALUES('tt0153067','Action, Adventure, Sci-Fi','N/A','','Star Wars: TIE Fighter','You play an up and coming combat pilot serving the Galactic Empire.',NULL,'8.8','[{"id": "0b60f2f31c753a0a4fb44baa84f6502520e1e361"}, {"id": "0b60f2f37a95aab27b5b5a2042868cb2cf51bce4"}]');
INSERT INTO "movies" VALUES('tt0891577','Comedy, Drama','Joon-ik Lee','0b60f2f3a05cf3dad148f51f6eade208d3705b70','Radio Star','Once a superstar with a music award on his belt, rocker CHOI Gon now sings in a run-down café. But an incident with one of the guests at the café has him end up locked behind bars. His manager for more than 20 years, Min-soo makes a deal with the radio station producer to help Gon bail out, and in exchange, to have Gon DJ at a remote radio station in the suburbs. Reluctant to work at first, CHOI Gon soon finds out that the little things matter the most, and his attitude towards his pal and manager Min-soo gradually changes.',NULL,'7.1','');
INSERT INTO "movies" VALUES('tt0399837','Animation, Comedy, Family, History, Musical','Tim Hodge','0b60f2f38812fd599a36d3c9cea5e14a68fd3c6c','The Star of Christmas','Bob the Tomato and Larry the Cucumber appear as Cavis Appythart and Millward Phelps, respectively--two jingle writers based loosely on Gilbert and Sullivan. The setting is 1880s London, and they''ve written a musical called "The Princess and the Plumber", which they plan to open on Christmas Eve. Cavis thinks the production will "teach London how to love". But children at nearby St. Bart''s Church are planning a nativity play for the same evening, and they plan to feature the Star of Christmas, a religious artifact unseen by the public for decades. The London Post Gazette writes a front-page story about the nativity play and the Star, and Cavis and Millward hatch a plan to make their musical better than the children''s play. In the end, they learn about the true meaning of Christmas.',NULL,'7.0','');
INSERT INTO "movies" VALUES('tt1397502','Drama','Adriana Maggs','0b60f2f373a8ab2c92490241920d166dcddf323d','Grown Up Movie Star','Grown Up Movie Star tells the story of disgraced NHL star Ray and his precocious daughters Ruby and Rose. Once the town hero, Ray has returned home to Newfoundland from the US following a drug conviction, only to have his wife Lillian leave him for another man and aspirations of stardom. With Lillian gone, Ray flails from woman to woman trying to find a replacement for her, while struggling against a growing awareness of his homosexuality. At loose ends for lack of guidance, Ruby is becoming increasingly curious about her own sexuality and, in a desperate plea for attention, putting herself in increasingly risky situations. Ruby begins spending more and more time with Ray''s best friend Stuart, confined to a wheelchair following an accident involving Ray. When Stuart finds himself attracted to Ruby, dangerously motivated by fear and anger, he leads the three of them towards a heartbreaking conclusion.',NULL,'6.1','');
INSERT INTO "movies" VALUES('tt1316577','Crime, Horror, Thriller','Shane Ryan','0b60f2f35be4a73be644d4b7ebd76456314c43d2','Amateur Porn Star Killer 3: The Final Chapter','Villainous voyeur Brandon (Shane Ryan) wreaks havoc and pure sexual violence on a poor young girl, Nikki (Regan Reece). Rather than lure her in like the first film, or gain her trust as a ...',NULL,'2.4','');
INSERT INTO "movies" VALUES('tt6268734','Comedy','Michael A. Nickles','0b60f2f3f4213d205e6ad161226e51ae6ecbb2dd','Holly Star','A broke puppeteer returns home for the holidays and gets caught up in a treasure hunt with her paintball-obsessed best friend, her tango-dancing grandmother, and a childhood sweetheart.',NULL,'5.1','');
INSERT INTO "movies" VALUES('tt1410046','Comedy, Horror','Keith Emerson','0b60f2f3de7252cf5c2818c9e9b8c815431fa8ec','Porn Star Zombies','A group of adult film cast and crew members must discover what is causing their fellow stars to rabidly attack them.',NULL,'2.4','');
INSERT INTO "movies" VALUES('tt1459459','Documentary, Comedy','Leslie Small','0b60f2f350405ece5ad187c866c105d7524104ba','All Star Comedy Jam','The Original King of Comedy and Shaquille O''Neal presents this Stand-Up Special with some of the industry''s most talented and sought after comedians.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt2899768','Drama, History','Lluís Miñarro','','Falling Star','The difficulty of establishing beauty and the futility of power.',NULL,'5.0','[{"id": "0b60f2f3fac78e9d4520b111a8a3cfc539670116"}, {"id": "0b60f2f3b2b0aca4cd51c9cc32311b44bc07371b"}]');
INSERT INTO "movies" VALUES('tt1372191','Comedy','N/A','','Star-ving','David Faustino plays himself as a struggling actor in this very entertaining web series. Great cameos and several appearances by former Married with Children cast members.',NULL,'7.9','[{"id": "0b60f2f3539c0b18e17252ff28ddabc12f15b491"}, {"id": "0b60f2f337eb75b65695a8ac062a20e4d0aeeff2"}, {"id": "0b60f2f3a9cad05026fb32ee63175ea939d4b028"}, {"id": "0b60f2f3de05afd088e004f466ef385ef2d0379c"}]');
INSERT INTO "movies" VALUES('tt0078631','Action, Adventure, Family, Sci-Fi','N/A','0b60f2f33eb84e1cd0644be515d04245313f72ec','Jason of Star Command','Jason was an officer of Star Command, which was located on the same asteroid as Space Academy. Star Command''s job was to protect the innocent from the bad guys, most notably Jason''s archenemy, the one-eyed Dragos.',NULL,'6.7','');
INSERT INTO "movies" VALUES('tt0328475','Action, Adventure, Animation','Jon Knoles','0b60f2f35c4fde091ca6d059293c7d9f78fef6dc','Star Wars: Bounty Hunter','You are Jango Fett, the most fearless bounty hunter in the galaxy, hired to capture a deranged Dark Jedi. Armed with an array of deadly weapons and skills, you''ll face off against galactic scum from the darkest corners of the Star Wars universe. For the galaxy''s most wanted-there is no place to hide.',NULL,'7.9','');
INSERT INTO "movies" VALUES('tt0467491','Short, Action, Sci-Fi','N/A','','Star Trek: Hidden Frontier','For the last six years, has continued the ongoing missions of Starfleet after the journeys of Star Trek: The Next Generation, Star Trek: Deep Space Nine, and Star Trek: Voyager. More than "just a fan film", has made an improving production using spectacular special effects.',NULL,'4.8','[{"id": "0b60f2f311feba8b859dde22eeb9bc066b9b3c92"}, {"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}]');
INSERT INTO "movies" VALUES('tt0984009','Comedy','Hyun-su Kim, Sang-chan Kim','','Highway Star','A struggling rocker is finally discovered, but unfortunately by producers specializing in Korean "country music" (trot). Can he embrace this new career while staying true to his heart as a musician?',NULL,'6.5','[{"id": "0b60f2f395b3558f2eb03f340edf531a1b0f8d6b"}, {"id": "0b60f2f332239363a82b97bb5dcb1c2950cd320e"}, {"id": "0b60f2f3d83e9e6097c7518efdf98d391fd0fafb"}]');
