INSERT INTO "movies" VALUES('tt0378773','Action, Drama, Romance','Daniel Lee','','Star Runner','Get ready for the ultimate martial arts competition, where anything goes and lives are bought and sold. Tank is the celebrated Champion Star Runner and is deemed invincible among the martial arts community. When the headstrong Bond becomes determined to take on the undefeated fighter, he knows he must be in the best fighting condition. Training under a renowned martial arts expert, Bond learns to supplement his Thai Kickboxing skills with various styles of Chinese kun-fu, creating a powerful hybrid fighting style. With his new skills, Bond prepares to take on Tank and the fight of his life.',NULL,'5.2','[{"id": "0b60f2f34dbdd39fd96308f9495fed509e269a73"}, {"id": "0b60f2f3736abadf5e70b8dd8ee2678ddcecbdf4"}, {"id": "0b60f2f3a437d612892b8524ea26a31a68526b8d"}]');
