INSERT INTO "movies" VALUES('tt0388625','Animation, Family, Comedy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','My Dad the Rock Star','Being the son of the world famous rock star, Rock Zilla, may sound wonderful for most people, but Willy has a different opinion. All he wants is a normal life and friends who accept him for himself and not because of his parents. When the Zilla family moves to Silent Springs in semi-retirement, Willy sees his chance. However, that normal life will not be easy to find with his wealthy family stirring things up in their own eccentric ways. Regardless, with the help of two newfound true friends, Willy is ready to deal with his unique challenges in a world that is remarkably new to him.',NULL,'5.0','');
INSERT INTO "movies" VALUES('tt8019044','Thriller','Robert Malenfant','','Stalked by a Reality Star','A teenage girl lies about her age to get into a Hollywood party and meets a handsome reality TV star - but when she finds out he is a creep and rejects him, he becomes obsessed and starts ...',NULL,'5.1','[{"id": "0b60f2f3a3269e545529e8398bb66c0333a6c876"}, {"id": "0b60f2f330890905ae4ffbb6c1f3ce3f3b8f31fb"}]');
INSERT INTO "movies" VALUES('tt0083467','Adventure, Sci-Fi','N/A','0b60f2f3c527bcd18590ef2c23f027fc7f64224b','The Powers of Matthew Star','Matthew Star was a prince on the planet Quadris, who was forced to flee to Earth when his planet''s government was overthrown by despots. On Earth, he took the form of an ordinary high-school student (albeit one with superpowers), and was accompanied by his guardian Walt, who became the school''s science teacher. The American government knew of Matthew and Walt''s origin, and used them to act as agents on occasion.',NULL,'6.5','');
INSERT INTO "movies" VALUES('tt0098081','Crime, Drama, Mystery','Christian I. Nyby II','','Perry Mason: The Case of the All-Star Assassin','Thatcher Horton is owner of a Denver sports arena and a couple of sports teams. Bobby Spencer a friend of Ken was one of his hockey players. It seems that Horton verbally promised him that he would take care of him if he gets injured, which happened. Now it seems that Horton is reneging and he has asked Ken to represent him in his suit against Horton. Bobby threatened Horton and not long after that Horton was killed and the murder weapon was found in Bobby''s possession. So Perry comes to help defend Bobby. It seems that Horton was not liked by other people including his wife and son, and it also seems that the killer was a professional assassin, so did one of them hire him?',NULL,'6.9','[{"id": "0b60f2f3c4c3e2e54780a0224cf2d71786c155ca"}, {"id": "0b60f2f3faa66c5cb50c2e56d207d0e01ce6ed5f"}, {"id": "0b60f2f33f02f11f183885c1ed2bfe65d206ba01"}, {"id": "0b60f2f33f02f11f183885c1ed2bfe65d206ba01"}]');
