INSERT INTO "movies" VALUES('tt0274889','Documentary','Donald R. Beck','0b60f2f3435eebc31e6178b2dba084a98fa4c629','Star Trek 25th Anniversary Special','A tribute to Star Trek on its 25th anniversary. This film tells the story of how the series (original and Next Generation) and the first six movies came about. Includes plenty of behind-the-scenes looks, clips from the series and movies, bloopers, and interviews with creator Gene Roddenberry, cast members, and NASA officials.',NULL,'6.9','');
INSERT INTO "movies" VALUES('tt0383373','Drama','Milton Alencar','','Garrincha: Lonely Star','The life of Brazilian soccer player, Garrincha, considered to be one of the greatest players of all time, with his uniquely original style. He had arched legs, a passion for women and booze...',NULL,'5.2','[{"id": "0b60f2f30719a1a33b3745881b7011f65397052b"}, {"id": "0b60f2f3b1e64c62a77e02005dc7fa17fc3ff00a"}, {"id": "0b60f2f37417ba13507723575f8f776cfcfc7018"}, {"id": "0b60f2f3990283c9a46abe3a80e812b0524176b3"}]');
INSERT INTO "movies" VALUES('tt0114529','Sci-Fi','Cole S. McKay, Fred Olen Ray','','Star Hunter','Star hunters are the space monsters who hunt helpless creatures for pleasure. One night couple of high school football players and their cheerleaders are returning home after the lost game....',NULL,'3.1','[{"id": "0b60f2f31144817014782b1459187487d9fd4441"}, {"id": "0b60f2f370f1b2929f98c8941b9345ba80eadc34"}, {"id": "0b60f2f3344bbe2064cfe5fda755b953157e086b"}]');
INSERT INTO "movies" VALUES('tt0160152','Drama, Romance','Mark Griffiths','','The Cowboy and the Movie Star','Depressed at the thought of losing his family ranch to settle his divorce, cowboy Clint Brannan decides to drive his cattle up to their high pasture. One day into the drive Clint happens across actress Sean Livingston who has run her car off the road in the middle of nowhere whilst out on a drive to clear her head. Faced with the prospect of a two or three day wait for rescue or accompanying Clint on his cattle drive, Sean decides to go on the cattle drive. Completely unprepared for the harshness and privations of living outdoors Sean initially hates the adventure. However, as the drive progresses Sean and Clint start to appreciate the differences and similarities of their respective lives and begin to realize that they have much in common. As the drive progresses fate and the forces of nature intervene to turn the cattle drive into a race against time to reach their destination to save the cattle and then return to civilization as soon as possible to save Clint''s life. Will their fledgling friendship, borne of enforced intimacy, survive and grow or will they go their separate ways?',NULL,'6.3','[{"id": "0b60f2f3cb6cdc2c0bcf24477064c0b831c21d38"}, {"id": "0b60f2f3222b7626dff722d329b73eb5902b2bc4"}]');
INSERT INTO "movies" VALUES('tt0150969','Comedy','Martin Fric','','The Blue Star Hotel','Zuzanka (Natasa Gollová) can finally stop toiling away at washing dishes at hotel Mercur after a distant aunt has bequeathed her her own hotel - Blue Star. She proudly marches over to the luxury hotel in the center of town and immediately begins to change the personnel. Because this involves the facilities belonging to a joint-stock company, which no one can inherit, she is considered insane. It comes out that her inheritance is in reality a small, shabby little hotel of the same name in the IV town district. The personnel are three unemployed youths who in this way work off the money they owe for rent. The first guest is wealthy Vladimír Rychta Rohan (Oldrich Nový), whose parents spent their honeymoon in this very hotel. He wants to celebrate his wedding there, with which his fiancée Milada (Adina Mandlová), who is waiting for him at the luxurious Blue Star, does not concur.',NULL,'7.4','[{"id": "0b60f2f35d29dfa71d2a727810ac5d370b20fadf"}, {"id": "0b60f2f37e332ab64449f14c9de7c40b5a4ddb00"}, {"id": "0b60f2f37478582244c78934a13692688850e39e"}]');
