INSERT INTO "movies" VALUES('tt0292568','Documentary, Short','Donald R. Beck','0b60f2f3435eebc31e6178b2dba084a98fa4c629','Journey''s End: The Saga of Star Trek - The Next Generation','Your destination: the 24th century. Your mission: to voyage where few have gone before--behind the scenes of Star Trek: The Next Generation! Join Jonathan Frakes, Next Generation''s Commander William Riker, for this fascinating chronicle of Gene Roddenberry''s beloved, Emmy Award-winning series. You''ll explore the Enterprise, meet the show''s stars (and some villainous guest stars), learn special-effects secrets and makeup magic, and finally get the answer to that nagging question, "Where is the bathroom on the Enterprise?" Other highlights include a visit to a Star Trek convention, and a stop at the scoring stage to watch Marina Sirtis (Lt. Commander Deanna Troi) lead the orchestra in a recording session. This program concludes with a special look at the series'' thrilling final episode ("All Good Things . . .") and a sneak peak at the crew''s movie debut, Star Trek: Generations. So set a course for an adventure like no other.',NULL,'7.0','');
INSERT INTO "movies" VALUES('tt0111279','Comedy, Romance','Jim Drake','','Star Struck','Runner and Robyn were summer camp sweethearts. She became a Hollywood star and Runner stayed at the farm. Finally Runner takes grandma''s advice and goes LA to win his lost love back. He gets a job as her gofer but she doesn''t recognize him. Everyone thinks his down-to-earth ''nice'' is an act, while he keeps hoping Robyn will remember...',NULL,'5.1','[{"id": "0b60f2f3f4261582630d6347a2a50092853a1823"}, {"id": "0b60f2f3efa6d9f82f06125d761e0bb79f38c4f4"}]');
