INSERT INTO "movies" VALUES('tt1117633','Action, Adventure, Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars Battlefront: Renegade Squadron','The story in this game follow the previously secret "Renegade Squadron" that was made up of the galaxy''s toughest scoundrels. As the plot unfolds, players learn how Han Solo recruited and assembled his team and used their many talents for missions in Korriban''s Valley of the Sith, the rocky remains of Alderaan, and the fiery ashes of the volcanic planet, Sullust. In addition to single-player story missions, Renegade Squadron allows up to 16 players to compete via Infrastructure mode (eight-person support for ad hoc), with a special 100-point spending system to purchase custom kits with more than a million different combinations that can be used to create unique Star Wars characters.',NULL,'8.2','');
