INSERT INTO "movies" VALUES('tt3076982','Documentary, Biography, Comedy','Charlie David','0b60f2f3e307cdae38b035337fe1a8944d76c09a','I''m a Porn Star','I''m a Porn Star follows the lives of guys in the neighborhood who are likely a lot more famous than you - at least on the Internet. There are an estimated 370 million pornographic websites on-line. Porn is now a thirteen BILLION dollar business. So who''s doing all this moonlighting? Turns out -- probably some people you know.',NULL,'5.0','');
INSERT INTO "movies" VALUES('tt0844485','Action, Adventure, Sci-Fi','N/A','','Star Trek: Legacy','Jonathan Archer, the captain of the first Enterprise, is asked by the Vulcans to retrieve one of their ships that went missing. He locates and saves the ship from the Romulans, but the ship''s mysterious captain T''Uerell decides to use him for her own gain. First Archer, then Kirk, and finally Picard, Sisko and Janeway, will all have to face this dangerous individual in their own eras in order to save the Alpha Quadrant. While Archer, Kirk and Picard each star in one-third of the game, Sisko and Janeway show up only in two of Picard''s missions.',NULL,'6.5','[{"id": "0b60f2f33a9c7b9a9f797a857c1746cf890bf35f"}, {"id": "0b60f2f3425efe2adf1d97cedb31a57390da90ff"}]');
