INSERT INTO "movies" VALUES('tt0376208','Action, Adventure, Drama','Yoshiharu Gotanda','','Star Ocean: Till the End of Time','A young 19 year old college student Fayt Leingod and his family are having fun on their vacation in Hyda. While Fayt and his childhood friend Sophia Esteed strolls around the hotel and play the battle simulator, an unknown space force attacks Hyda. Fayt and Sophia were forced to evacuate the hotel and they meet up with their parents. However, Fayt and Sophia were separated from their parents after their escape route falls under attack. Fayt and Sophia later boards the Helre that is heading to Remote Station #6. But however, the Helre went under attack by the space force and everyone was forced to evacuate. Fayt and Sophia boards their escape pods, but they were separated and Fayt lands in the planet Vanguard III. With Fayt by himself, how will he able to find a way back to Sophia and his parents? Fayt must do something about this.',NULL,'7.9','[{"id": "0b60f2f3cf32cb8124698d55bba5327b70b3259f"}, {"id": "0b60f2f36b17e1c569cb728c704e4d865f19a492"}]');
