INSERT INTO "movies" VALUES('tt0356069','Short, Adventure, Sci-Fi','Ty Granoroli','0b60f2f38c9005f12cb37ed091261ea9d48b4872','Star Trek: The Experience - Borg Invasion 4D','A combination of an interactive 3D movie and a stage performance, Borg Invasion 4D was a Star Trek: Voyager-based attraction, part of the Star Trek: The Experience series of attractions at the Las Vegas Hilton in Paradise, Nevada. Borg Invasion 4D ran from 2004 to 2008. The audience enters a small theater where physically present actors portraying the Star Fleet crew greet them. The story is told through prerecorded 3D film sequences and actors'' interaction with them and the audience. The story takes place some time after the end of the ST: Voyager series. The audience takes the roll of guests on a secret space station where Doctor from Voyager works with researches on creating a new DNA strain that will be resistant to the Borg''s assimilation techniques. The guests are there to have themselves tested and help the research in case their DNA contains the resistant strain. Then the Borg attack. Actors lead the audience through a couple of hallways as other actors dressed as the Borg assimilate the researchers. Finally, the audience and the "surviving" actors reach another small theater that represents an escape shuttle and there a new series of prerecorded 3D film sequences starts. The shuttle launches but the Borg cube with the Queen inside captures it. As the Queen taunts the audience, the Borg are tearing the shuttle apart. Just as they are about to reach the audience, a familiar, charmingly raspy, friendly female voice is heard as well as the sound of proton torpedoes. She disagrees that resistance is futile and is there to prove it.',NULL,'8.0','');
INSERT INTO "movies" VALUES('tt0348111','Action, Adventure, Sci-Fi','N/A','0b60f2f3bb3da955fbfe25832f46da32ca4e8e11','Star Trek: Elite Force II','After the long return journey of the USS Voyager to the Federation, the elite Hazard Team finds themselves declared redundant and disbanded. You play Lt. Munro, the leader of the team who is relegated to being an instructor at Starfleet Academy. After years at the unexciting post, your fortunes change dramatically when Capt. Picard himself has the team reassembled and assigned to the Enterprise. The good captain''s wisdom could not have been better placed as the Enterprise is sent to investigate the loss of contact with the USS Dallas. Leading your Hazard Team, you find yourself at the front line when you discover a formidable new enemy who represents a terrible threat to the galaxy and it will require all your courage and cunning to stop it.',NULL,'8.5','');
