INSERT INTO "movies" VALUES('tt0074061','Sci-Fi','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star Maidens','TV series of British/German origin, and set in the "present" Earth of the 1970s. A planet from another solar system drifts into Earth''s system and is detected by some Earth scientists who investigate. The surface of this planet is no longer habitable and the residents have moved to a high-tech underground city. The society is ruled by the women, who of course, are all beautiful. Men are considered mentally inferior and are divided into two categories: the "adequately intelligent" who are selected by women to act as their personal "domestics" for household chores, and the remainder who are forced to perform menial labor under the supervision of female guards. The guards are attired nicely in visored helmets, boots, hot pants, and elbow-length gloves which are used to control the men through some sort of apparent force. Scientists from Earth (one men and one woman) find their way to the planet, and are forced to take their stated places in society. The man is chosen as a domestic, sometimes is forced to work on a city maintenance crew, and the woman is assigned a white-collar job. The aliens also visit Earth clandestinely in their tear-drop shaped ship. Some episodes bluntly address the issue of unfair discrimination based on sex.',NULL,'6.5','');
INSERT INTO "movies" VALUES('tt0049031','Romance, Western','Lesley Selander','0b60f2f350184ceb1d7e6720188382a89cb26620','The Broken Star','A deputy marshal is ordered to investigate the killing of a Mexican ranch hand by a fellow deputy, who claims self-defense. Using turn of the century forensic science and dogged determination, the deputy breaks down his partner''s alibi and discovers that the lawman had killed the rancher for eight thousand dollars in gold that had been hidden in the Mexican''s home. Now he must arrest his friend before the Mexican''s gunslinging friends can kill him before he''s tried for the crime.',NULL,'5.9','');
INSERT INTO "movies" VALUES('tt0125516','Action, Adventure, Sci-Fi','Martin Denning','','Star Trek: Starfleet Academy','In this FMV space combat simulator with elements of an adventure game, you play David Forester, a young human cadet at Starfleet Academy who is going through the extensive command training system that uses several simulator scenarios of missions with a variety of ship classes. In addition, you interact with your various classmates with the mundane situations on campus. You also have some meetings with Captain Hikaru Sulu and Pavel Chekov while Captain James T. Kirk assigns the missions. Through various dialogue options and other choices, you shape your story and must prove to yourself, your crew that''s prone to infighting and Kirk that you are worthy of the captain''s chair. The true test though arrives when your Vulcan member of the bridge crew gets hurt in an explosion. The first signs of a conspiracy that wants to push the Klingons and the Federation into another bloody conflict emerge here. You must also solve the mystery of a living spaceship created by an unknown alien race that uses unique form of communication and either wants to make first contact, or attack.',NULL,'8.1','[{"id": "0b60f2f3bb3da955fbfe25832f46da32ca4e8e11"}, {"id": "0b60f2f30d2e7dad8400e04f30f04c06c9d31d09"}, {"id": "0b60f2f329f5773f816e956d089d8bfcfaee1f98"}, {"id": "0b60f2f3394c9a3d78ecb14ce2979843e5aebbcc"}, {"id": "0b60f2f30aa27b658ae6e9e6938f7d1a79f45e59"}, {"id": "0b60f2f365237d03082c234a2fd3c034f55956b5"}, {"id": "0b60f2f3a2113b08c40a569c22427f657caa43ab"}, {"id": "0b60f2f3bdb4926cd615e7a2d3b0ea66abb8797a"}, {"id": "0b60f2f39bbba7c526d8e5578999cfe87df803a9"}]');
