INSERT INTO "movies" VALUES('tt0970511','Documentary','John Logsdon','','Star Trek: Beyond the Final Frontier','Forty years after the start of the Star Trek phenomenon, Paramount commissions Christie''s auction house in New York to sell over a thousand original artifacts (spaceship models, costumes, and props) used in the production of the five television series and ten feature films.',NULL,'7.3','[{"id": "0b60f2f3bdc1438e5492b0c6282fec1855551a48"}, {"id": "0b60f2f3c3b0fedaf2728a2127f8864cba47d45b"}]');
INSERT INTO "movies" VALUES('tt6357074','Family','Robert Vince','0b60f2f36b6a2cd8ea3b05657b6d4080777aaf06','Pup Star: Better 2Gether','The action-packed new season of the franchise continues with the story of Tiny, an adorable Yorkie pup who, after winning the ''Pup Star'' TV singing competition, is suddenly launched into an adventure when she''s replaced by a street Yorkie, Scrappy, and the two swap lives in a dog-filled, fish-out-of-water tale that ultimately demonstrates life truly is ''better together.''',NULL,'4.5','');
INSERT INTO "movies" VALUES('tt2907908','Drama','Don McBrearty','0b60f2f3d0a1545dc36f27b60e21d3a36a959148','Star Spangled Banners','In their late teens and early 20''s, the Banner siblings - Mitchell, Desiree and Danny - made it big as a rock group, but at the height of their fame, Desiree decided to leave the group, and everything fell apart. Now, fifteen years later, their mother has a plan to bring the group back together and heal her family. But will the siblings be able to put aside their differences and reunite, or will they remain estranged forever?',NULL,'5.7','');
INSERT INTO "movies" VALUES('tt8861786','Family','Robert Vince','','Puppy Star Christmas','A song-filled new Air Bud ''Pup Star'' movie that introduces four new pups to the family, who stow away on Santa''s sleigh and find themselves trapped at the North Pole, trying to save the world''s Christmas spirit.',NULL,'3.4','[{"id": "0b60f2f36b6a2cd8ea3b05657b6d4080777aaf06"}, {"id": "0b60f2f3999d3f25205c5f324402ebb14deba63b"}]');
