INSERT INTO "movies" VALUES('tt3176284','Documentary, Comedy, History, News','Keith Patterson, Phillip Schopper','0b60f2f392bf91482fd0927afd6e53e9e911d401','All About Ann: Governor Richards of the Lone Star State','The life story of Ann Richards, the hilarious straight-talking Governor of Texas who fought special interests for the people and ultimately lost re-election to the first ever pairing of George W Bush and Karl Rove. Celebrities, family members, and personal friends tell the behind-the-scenes battle stories of how a housewife rose to the most powerful position in a good-old-boy state.',NULL,'7.8','');
