INSERT INTO "movies" VALUES('tt2199603','Action, Sci-Fi','Casey Pugh','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars Uncut: Director''s Cut','In 2009, Casey Pugh asked thousands of Internet users to remake "Star Wars: A New Hope" into a fan film, 15 seconds at a time. Contributors were allowed to recreate scenes from Star Wars however they wanted. Within just a few months SWU grew into a wild success. The creativity that poured into the project was unimaginable.',NULL,'6.7','');
INSERT INTO "movies" VALUES('tt0124140','Action, Adventure, Sci-Fi','James L. Conway','','Star Trek: Borg','You play a Starfleet officer whose father was killed at Wolf 359 and are upset when Starfleet won''t allow you to participate in repelling the current Borg attack. Q steps in and makes you a deal-with-the-devil offer: he will take you back to the Battle of Wolf 359 to prevent your father''s death.',NULL,'7.3','[{"id": "0b60f2f3dd33850ce8d5d087eaa5432bfdecd3ff"}, {"id": "0b60f2f3699da11f04c36197fbaeff1e8ad5f9aa"}]');
