INSERT INTO "movies" VALUES('tt0301253','Comedy, Sci-Fi, Short','Michael Stevens','','Ultimate Trek: Star Trek''s Greatest Moments','"The Trouble with Tribbles" . . . "The Best of Both Worlds" . . . "Trials and Tribble-ations" or "Scorpion." Which one is the greatest Star Trek episode of all time? Tonight, you decide! Take a hilarious journey through Federation space with Captains Kirk, Picard, Sisko, Janeway and the bravest crews in the galaxy. From dangerous villains to outrageous one-liners, this all-encompassing retrospective captures the greatest moments in Star Trek history. Challenging trivia questions and never-before-seen outtakes make Ultimate Trek the ultimate ride. Get ready to experience entertainment at warp speed!',NULL,'6.1','[{"id": "0b60f2f3fc3ad66780e895c5c331c8995ebfa1a1"}, {"id": "0b60f2f39efed81f57d813ed23ffb3e4a7cce697"}, {"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}]');
