INSERT INTO "movies" VALUES('tt5796728','Documentary, Western','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Lone Star Law','"Lone Star Law" features the men and women of the Texas Game Wardens who protect more than a quarter-million square miles of deserts, lakes, piney woods, bayous, plains and coast in the second-largest state in the U.S. Whether rushing to investigate poaching cases, save flash-flood victims, disrupt illegal smuggling rings, or rescue injured wildlife, the officers are always on the go, defending both animals and citizens. Animal Planet expands its family of wildlife law enforcement series, adding to Maine''s "North Woods Law" an offering that follows an elite patrol force in Texas.',NULL,'8.0','');
INSERT INTO "movies" VALUES('tt2512962','Documentary, Music','Hark Joon Lee','0b60f2f350405ece5ad187c866c105d7524104ba','9 Muses of Star Empire','''9 Muses of Star Empire'', a year-long chronicle that follows a journey of an all girl pop group ''9 Muses'', portrays the every-day life of nine girls, relentlessly pursuing their dreams in a world of jealousy, betrayal, and scandal. ''9 Muses'' is an emerging girl group, aspiring to perform on a national stage and gain world-wide fame just like millions of others. For that, the girls have decided to set everything aside and live as one of the Muses for ''Star Empire''; the entertainment company which created and coordinated every move. What''s the price they must pay for their dreams?',NULL,'6.1','');
