INSERT INTO "movies" VALUES('tt0279206','Action, Adventure, Comedy','Victor Ireland, Hiroyuki Koyama, Yoichi Miyaji','','Lunar: The Silver Star','From the village of Burg, a teenager named Alex sets out to become the fabled guardian of the goddess Althena...the Dragonmaster. Along with his girlfriend Luna, and several friends they meet along the journey, they soon discover that the happy world of Lunar is on the verge of Armageddon. As Dragonmaster, Alex could save it. As a ruthless and powerful sorceror is about to play his hand, will Alex and company succeed in their quest before all is lost? And is his girlfriend Luna involved in these world shattering events? Play along and find out.',NULL,'9.2','[{"id": "0b60f2f3455ffe1d867d2a4675807fefcf259efc"}, {"id": "0b60f2f3e18e817748e10d282dfc1c44baa65ce0"}, {"id": "0b60f2f39c2d9fa0a0a119419e2420676c7410ce"}, {"id": "0b60f2f33269bbd278fa8ac2f80ed1dc0718c89b"}, {"id": "0b60f2f30efd37ed929dc83086ba0c24de3fe070"}, {"id": "0b60f2f30efd37ed929dc83086ba0c24de3fe070"}]');
