INSERT INTO "movies" VALUES('tt0496699','Drama, Romance','Alberto Lecchi','','A Star and Two Coffees','Carlos, a young architect in crisis with his partner, arrives in a small town in the north of Argentina to build a complex of cabins. There he meets Estela, a thirteen-year-old girl, but he...',NULL,'6.7','[{"id": "0b60f2f3112afbaf515e55187d49e351e88864f5"}, {"id": "0b60f2f35b7edbd778d08dd90c39aceaaec8a4fb"}]');
