INSERT INTO "movies" VALUES('tt0027039','Short, Music','Louis Lewyn','0b60f2f3a3229ad4fea6fa5745ae0d43d3533161','Star Night at the Cocoanut Grove','Hollywood''s famous Cocoanut Grove nightclub stages a Star Night-only musical revue in which many Hollywood actors attend. Staged is the operative word. Entertainers include Ted Fio Rito and his orchestra, Eduardo Durant''s Tango Band, and the Fancho & Marco Sunkist Beauties. Leo Carrillo acted as the Master of Ceremonies, and introduces a galaxy of stars from their tables. Those higher on the 1935 pecking order, Mary Pickford, Jack Oakie, Arline Judge, Bing Crosby and Gary Cooper, come to the microphone and do a bit...mostly chit-chatting bits.',NULL,'5.7','');
INSERT INTO "movies" VALUES('tt0030481','Comedy, Musical, Romance','Roy Del Ruth','','My Lucky Star','The son (Romero) of a department store owner enrolls the store''s sports clerk (Henie) at a university to use her as an advertisement for their fashion department. She falls for a teacher (Greene) and gets expelled.',NULL,'6.0','[{"id": "0b60f2f3206c1548aea4c04a45ba6a76aead5c5c"}, {"id": "0b60f2f346fd4021e96e66b60a928ecac9426d28"}, {"id": "0b60f2f3f534c29e9ec8016f4ff5f629ca95b9d7"}, {"id": "0b60f2f3667d860f831deea48a2171e4c2cc8905"}]');
