INSERT INTO "movies" VALUES('tt3445408','Documentary','Roger Lay Jr.','0b60f2f3c32dd64ac89a60160afe2ab2863c1b6a','Star Trek: Enterprise - In a Time of War','Newly produced multi-part documentary featuring all-new interviews with the show''s cast and crew as well as behind the scenes archival content. This retrospective documentary gives fans an inside look at the making of the show''s groundbreaking third season - the first season of a Star Trek series to feature a year-long story arc. Writing staff and production personnel discuss the complexities of plotting the Xindi story-arc and the development of all the major story threads that connected every single episode of the show''s third season.',NULL,'7.3','');
INSERT INTO "movies" VALUES('tt0221709','Documentary, Biography','Michael Mahler','','William Shatner''s Star Trek Memories','As James T. Kirk, the intrepid captain of the Starship Enterprise, William Shatner was at the forefront of the world''s most popular sci-fi series. Now, for the first time, Shatner shares his personal rememberances of the original TV series and the Star Trek phenomenon. Joining him are original crew members Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Nichelle Nichols and Walter Koenig. You''ll hear the never-before-told stories behind Star Trek. How the fans rallied to save the show after it was canceled. How Chekov''s look was styled after The Monkees'' Davy Jones. Why the ship''s chief engineer was Scottish, the origin of Vulcan hand salute, and much more. It''s the behind-the-scenes story of a classic series that lived long and prospered, hosted by the man who captained its amazing journey.',NULL,'6.2','[{"id": "0b60f2f304c744a3dbc15cf342d296f36e92038e"}, {"id": "0b60f2f31c5837479727484d6d36572b34550895"}, {"id": "0b60f2f38bf80dbebe43a1854547b0af6a19fb11"}]');
