INSERT INTO "movies" VALUES('tt5300268','Drama','Alecs Nastoiu','','Billion Star Hotel','Every day, we''re faced with the following exercise: to give the world around us a certain cue. To smile, to take everything as a joke, to laugh out loud, or to allow ourselves to be overwhelmed by reality. To be painfully aware of the distance between us and our dreams, of the obstacles, and the fact that we are alone all the time. Some choose to escape, to build their own world, with it''s own rules, with the memories of fairy tales and dreams that really come to be. A world where three friends are brought together by the same destination. Or maybe, it all comes down to daydreaming. And feeling the empty spaces with music. It all depends on how you choose to see things. In black, in white, or in sync with the beat. Billion Star Hotel, for each viewer, a different story.',NULL,'6.1','[{"id": "0b60f2f39308e1c13b7713b0dff2077e530e22ff"}, {"id": "0b60f2f37ba687917958da47dba012d418b0e3e8"}]');
INSERT INTO "movies" VALUES('tt0368298','Comedy, Documentary, Sci-Fi','Mike Rotman','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wait','The new Star Wars film arrived on May 16 - so why not line up on the streets 6 weeks before? Hundreds of people in Hollywood did just that. Star Wait takes a look at the lives of some of these people waiting in line in front of the famous Mann''s Chinese Theater. How do they get along with each other? How do they deal with the homeless people vying for sleeping room on the streets of Hollywood? How do they make sure no one spoils the new Star Wars movie for them? And of course, how do they go to the bathroom? Star Wait is broken up into 9 different episodes. Episodes include; who is hotter: Natalie Portman or Princess Leia? How does a Christian band get along with Star Wars fans at 2 in the morning? The day the tickets are sold, infighting among line members, and of course the final day leading up to the Hollywood 12:01am showing of "Star Wars Episode II: Attack of The Clones."',NULL,'6.6','');
