INSERT INTO "movies" VALUES('tt0390145','Biography, Drama, History','Tony Tew','0b60f2f3dd591f8c301b7eb8348e77d23351e020','John Wycliffe: The Morning Star','John Wycliffe, the scholar and lay preacher of the 14th century who was later dubbed "The Morning Star of the Reformation", risked his life and freedom to criticize the Church for its abuses of power and its false teachings. The dramatized story of his life includes his battles with Church authorities, his relationship with the peasants and his realization that the Bible must be translated into English, so that the common man, as well as the learned, could read it.',NULL,'6.8','');
