INSERT INTO "movies" VALUES('tt0830161','Sci-Fi','N/A','','Grand Star','"Grand Star", formerly known as "Ice Corp.", is a futuristic, action-adventure series based on the saga by French novelist Georges J. Arnaud. In the latter part of the 21st century, there is a cataclysmic explosion on the moon, which was being used as a nuclear waste dump and the earth is turned into a frozen mass of ice. Billions died but a few thousands have managed to rebuild their lives in railway stations like "Grand Star", where they must learn to survive in the frozen landscape home to strange near humans of unknown origin who can withstand the cold and the "renewer" who profess the return of the Sun. Starring Canadian actors Tyler Johnston (Godiva''s, Blood Ties), Kyle Labine (Freddy vs. Jason), Tammy Hui (Battlestar Galactica) and Tristan D. Lalla (Superstorm).',NULL,'6.1','[{"id": "0b60f2f33ffcc867a6a74b25129bf66eac038c8f"}, {"id": "0b60f2f351791750c3bc93c21db3f2dbf3d9c67f"}, {"id": "0b60f2f3162488dea61d799a3e17db577688e195"}]');
