INSERT INTO "movies" VALUES('tt0062304','Comedy','Karl Genus','0b60f2f33fd94e601f859a6de2dca0832a0fc949','The Star Wagon','In middle age, inventor Stephen Minch is happy enough with his life, despite the fact that he has never risen to prominence even though his innovations have made others rich. His wife Martha, however, resents his lack of drive, his complacency, his willingness to live hand-to-mouth, and his ever-present and ever-annoying sidekick Hanus Wicks. Confronted by the evidence of Martha''s years-long regret over how their lives together have turned out, Stephen decides to use his newest invention to repair her unhappiness. The new invention: a time machine.',NULL,'8.0','');
