INSERT INTO "movies" VALUES('tt6071476','Documentary','Mick Grogan','0b60f2f39b2998dcfae84fc80c923b3a3bd3599f','Building Star Trek','Half a century after it first aired, Star Trek has become not only a pop-culture phenomenon, but also an inspiration for social progress, scientific and technological endeavor, and space exploration. On its 50th anniversary, "Building Star Trek" features scientists, actors, and cultural leaders, asking how did this happen ... and why?',NULL,'6.7','');
