INSERT INTO "movies" VALUES('tt0189110','Animation, Action, Adventure','Greg Christensen, Chris DeSalvo, Chris Jones, Mark Whittlesey, Wesley Yanagi','','Star Trek: Judgment Rites','A series of missions of the Enterprise, under the command of James T. Kirk: a rematch with Ies Breddell, who has a powerful new weapon capable of destroying the Federation; evidence of advanced technology on a stone-age planet; a reunion with the powerful Trelane, this time obsessed with World War I; a distress call from a barren world; Spock''s abduction by mysterious forces as the Enterprise explores a dangerous rift in space; and terrorists seizing control of a museum with Kirk, Scotty and Checkov trapped inside. Through it all, a reclusive but advanced alien race is watching and testing the Enterprise, wondering if they should break their long silence and make contact with the Federation.',NULL,'8.1','[{"id": "0b60f2f30d2e7dad8400e04f30f04c06c9d31d09"}, {"id": "0b60f2f34a1b84bd53426f06bc67a02dc8b372b7"}, {"id": "0b60f2f3e7032cc57c6bf6a7c8162a03ac82da98"}, {"id": "0b60f2f3b36d6c9118b04597f22d9e08372be939"}]');
