INSERT INTO "movies" VALUES('tt4910232','Family','Cristian Scardigno','','Teen Star Academy','The "Teen Star Academy" is an incredible school for all Teenagers who love Music, Dance and Fashion. Each year the selected students will be lead and taught by the extremely talented and very friendly teachers (John Savage, Blanca Blanco, Adriana Volpe, Youma Diakite..), who will improve their students'' skills, in order to prepare them for the "Final Challenge" of the year. At the same time, different stories of friendship, competition and strong emotions of the present and the past, interlace inside and outside the Academy, especially at the "Zelo''s Beach" run by the hilarious Nathan (Bret Roberts) with the help of the crazy assistant Jonathan Bagoro. And there''s more... Among the singing and dancing, new stories will begin; others won''t continue, and some others will begin again. Everything set in the beautiful surroundings of the French Riviera.',NULL,'7.3','[{"id": "0b60f2f385cd6c692eb517fedb54a9e94c45c183"}, {"id": "0b60f2f3c9d6f87657cce8771736b1b347139c53"}]');
