INSERT INTO "movies" VALUES('tt2243998','Short, Adventure, Sci-Fi','Brad Murphy','','Star Wars Droids: The Jawa Adventure','Having given the auspicious impression that they are finally retiring, the spunky astromech droid R2-D2 has convinced the worry-prone protocol droid C-3PO to join him in assisting an eccentric old scientist named Von Bruneus with an experimental vehicle crafted from a decommissioned and modified Mon Calamari sentry cutter called the Max. After the unanticipated incapacitation of the doctor, the Max crashes safely on the desert planet of Tatooine where the droids ironically find themselves once more at the mercy of scavenging Jawas. A precocious and curious little Jawa named Skeetie proceeds to take the droids on a wild adventure that ultimately ends with a provocative revelation.',NULL,'6.8','[{"id": "0b60f2f3ce7a6e0bae10be6aea6998c161bc419b"}, {"id": "0b60f2f3ce7a1b5b96a9460f58fa3003777dc73d"}, {"id": "0b60f2f3ce7a1b5b96a9460f58fa3003777dc73d"}]');
INSERT INTO "movies" VALUES('tt0457490','Sci-Fi','Lin Sten','0b60f2f350405ece5ad187c866c105d7524104ba','Star Worms II: Attack of the Pleasure Pods','Jessup, forced to hide his true identity, is imprisoned on a deadly and desolate planet, the Star Prison. banished to mine rabid rivers for the elusive Fire Gems, Jessup and his men must battle bands of derelict prisoners and fight the fatal fangs of the Star Worms in order to supply the Lords of the Evil Empire with the sacred source of their hedonistic hallucinogenic opiates.',NULL,'2.7','');
INSERT INTO "movies" VALUES('tt0352088','Documentary','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Pet Star','This series on the Animal Planet cable network is a talent show for pets. Ten pet owners have their pets perform a specific trick. Among the contestants on the first show were a roller skating macaw; a dog that plays hockey, a Vietnamese pot-bellied pig that painted pictures with a brush, and a girl who hypnotized her pet frog. Each pet/owner team is rated on a scale of 1-10 by three celebrity judges (with new judges each week). The three teams with the highest scores are finalists; the winner is chosen by a vote of the audience. The winning owner receives $2,500 and is eligible for the end-of-season finals and a chance to win $25,000.',NULL,'7.2','');
