INSERT INTO "movies" VALUES('tt0042106','Comedy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','All Star Revue','This early comedy program started off with a rotating cast of four famous comedians, each of whom would take turns hosting the show. The program format was similar to that of a Vaudeville show or stage revue, with the prestige of the hosts enabling the show to bring in equally well-known talent for individual performances. As more hosts were added to the program''s roster, the name was changed to "All Star Revue".',NULL,'8.2','');
INSERT INTO "movies" VALUES('tt0051931','Drama','Jack Witikka','0b60f2f329d5438c9ce0ff719571b6675b6ba757','A Man from This Star','Office clerk Eero Koskinen prefers to spend his nights drinking and reminiscing the war with his friends, instead of taking care of his wife and two children. A two-week drinking spree gets him fired, and a new job is not easy to find because of his reputation. He goes to a rehab centre in the countryside for a couple of weeks, but with no permanent result. Meanwhile, his wife has to get a job and is employed by her old sweetheart, now a recently divorced successful businessman.',NULL,'7.5','');
INSERT INTO "movies" VALUES('tt0190804','Action, Adventure, Sci-Fi','N/A','','Star Wars: Masters of Teräs Käsi','Features all your favorite Star Wars characters, including Luke Skywalker, Han Solo, Princess Leia, Boba Fett and Chewbacca! 3D fighting at its best -- literally hundred of possible moves! Single and two-player modes for an all-out fighting frenzy! Spectacular 3D arenas including Cloud City, Endor and Dagobah! Two ways to fight: hand-to-hand and full weapons -- wield lightsabers, gaffi sticks, blasters and more!',NULL,'6.8','[{"id": "0b60f2f349da6ca017b6814daf0abe1d58e0fbe7"}, {"id": "0b60f2f36ee48ad51c30a43d05a0edd4a2541c7a"}]');
