INSERT INTO "movies" VALUES('tt0324065','Documentary','Michael Mahler','','Star Trek: A Captain''s Log','This documentary is a trip through the original series. The whole movie is composed of short fragments showing the high points of original series. Between them we can listen to comments of actors. They talk how they felt during shooting, how they feel the series now and what is the meaning of series for the mankind. The original series is full of allegories and in this documentary they are all presented to us with straight words. All leading characters are presented, decribed and we found out what do they really represent. In last third the movies with original crew are presented and, ofcourse, what is the future of Star Trek. This documentary is full of quotes with which we get impression what Star Trek really is.',NULL,'6.5','[{"id": "0b60f2f304c744a3dbc15cf342d296f36e92038e"}, {"id": "0b60f2f31c5837479727484d6d36572b34550895"}]');
INSERT INTO "movies" VALUES('tt1002540','Documentary','Ido Haar, Uri Ackerman','0b60f2f350405ece5ad187c866c105d7524104ba','9 Star Hotel','Slipping through the predawn darkness over highways, through traffic and across the border, Palestinian construction workers go to work clandestinely in Israel every day. Haar''s raw, handheld photography follows workers who build their own border shanty community to enter Israel more easily, with no choice but to risk their lives simply to earn a living',NULL,'7.4','');
