INSERT INTO "movies" VALUES('tt0274079','Documentary','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','The Science of Star Trek','This documentary compares and contrasts the scientific principles in Star Trek with current science. Many clips from the Star Trek movies and TV series are used to illustrate the concepts of: faster-than-light travel, time travel, anti-particle physics, medical imaging, extrasolar planets, extraterrestrial life and intelligence (SETI and the Drake equation), artificial intelligence, robotics, and matter transmission.',NULL,'7.4','');
