INSERT INTO "movies" VALUES('tt1293813','Documentary, Music','Gabriel Noble','0b60f2f350405ece5ad187c866c105d7524104ba','P-Star Rising','At age 9, Priscilla, an adorable yet precocious little girl, tells her single-father, Jesse,: "I am going to become a rapper and fulfill your dreams of succeeding in the music business." Moved by Priscilla''s passion and impressed with her natural talent and undeniable charisma, he begins to teach her all he knows about rapping. In the four years that follow there is no question that rapping has brought Priscilla closer to her estranged father, and that her success has made him proud. Before our eyes, this father-daughter duo go from a one-bedroom shelter in Harlem to a 4 bedroom apartment, from food stamps to shopping sprees, from rapping on street corners to sold out night clubs, and from sneaking under train turnstiles without the $2 fare to spare to being driven around in tinted SUV''s. It is further undeniable that Jesse has been reborn, from looking at old photos and bitterly reflecting on how he never was given the respect he deserved in the music business as a rapper himself to finding his own voice and self-respect as his daughter''s overzealous manager. But in the efforts to make her dad proud, Priscilla struggles to remain a child and finds herself trapped in a world of people twice her size and four times her age and doesn''t know who to trust. Jesse himself is caught between wanting to protect his daughter'' innocence and exploiting her raw talent to fulfill his deferred dream. All they know is that the ride has just begun.',NULL,'7.8','');
