INSERT INTO "movies" VALUES('tt5000744','Short, Biography, Drama, Family','Ratimir Rakuljic','','Star Stuff: The Story of Carl Sagan','What are the stars? In search of an answer to that seemingly simple question, Carl, a curious child, sets off on a great voyage of discovery. As one question is answered, more appear. Soon enough, where once stood but a curious boy, a great scientist will rise. "Star Stuff" is a short and sweet film inspired by the life and work of Carl Sagan, one of the most famous scientists and science communicators of the 20th century.',NULL,'8.6','[{"id": "0b60f2f32d81c8021b69ef837c43ea5a11a6b79f"}, {"id": "0b60f2f33f7b346edaf80fe88b945da4a2964c82"}]');
