INSERT INTO "movies" VALUES('tt3120434','Documentary','Roger Lay Jr.','0b60f2f3c32dd64ac89a60160afe2ab2863c1b6a','Star Trek: Enterprise - Uncharted Territory','This 90 minute documentary features all-new interviews with the show''s cast and crew as well as behind the scenes archival content providing fans an inside look at the challenges faced during the second season of ENTERPRISE as the writing staff and creators struggled to find the right tone and creative course for the series, ultimately developing the controversial XINDI story-arc which kicks off with the season finale: THE EXPANSE.',NULL,'7.7','');
