INSERT INTO "movies" VALUES('tt0825677','Documentary, Biography, Sport','Jean Claude Guiter','0b60f2f350405ece5ad187c866c105d7524104ba','A Star Named Ayrton Senna','The Official Film of Brazil''s greatest Formula One driver, Ayrton Senna, who''s sudden death in the 1994 San Marino Grand Prix sent shock waves around the World. It cemented his reputation both within the sport, and his native Brazil, as a legend. The film looks at his life and career using archive footage and featuring revealing interviews with the man, as well as those who knew him well; friends, family and competitors. It also shows how the Ayrton Senna Foundation, set up in his honor, is working to help under privileged and street-bound children in his native Brazil using sport as an incentive to learn.',NULL,'8.0','');
INSERT INTO "movies" VALUES('tt0264040','Sci-Fi','Garry M. Gaber','0b60f2f34e86f5814716e85888856ba381be37a7','Star Wars: Force Commander','Brenn and Dellis Tantor, brothers, are loyal imperial officers whose father was killed in a Rebel assault on their home-planet. Just before the battle of Yavin, Brenn is given command of some ground troops and Dellis joins Imperial intelligence. During the Galactic Civil War, they will discover that the Empire is not as fair and righteous as they grew up thinking.',NULL,'6.9','');
INSERT INTO "movies" VALUES('tt0184974','Action, Sci-Fi','Kazuya Konaka','0b60f2f3198d0a0b57ecf19d07cc444331bc73af','Ultraman Tiga & Ultraman Dyna: Warriors of the Star of Light','The members of the Super GUTS force, one of whom is secretly Ultraman Dyna, are in the middle of a losing battle against an enormous monster on the surface of the moon, when suddenly a spaceship appears and saves them by zapping the beast. The crew of the ship claim to members of the world peace force that originally created the Super GUTS force, and they invite the GUTS members to enter their brainwave patterns into the ship''s battle computer so it can be a more effective fighting system. It sounds like a good idea, but could they have some other plan up their sleeves?',NULL,'6.1','');
INSERT INTO "movies" VALUES('tt0181026','Sci-Fi','Jon Purdy','','Star Portal','An alien from a race dying of a disease crashes on Earth and assumes the body of a human. She then precedes to take blood from other humans to send back to her planet. Things get complicated when she starts to feel human emotions and other aliens show up to exterminate her. Her only hope lies with a curious and helpful doctor.',NULL,'4.1','[{"id": "0b60f2f3555e495e924d3c158ec0322cb1d5a9ce"}, {"id": "0b60f2f37d243f9eb4e883ab663eef4bac740994"}]');
