INSERT INTO "movies" VALUES('tt0339723','Documentary, Biography, History','Mads Baastrup, Sonja Vesterholt','','The Star Dreamer','About a visual wizard and a fantastic legacy of films which transformed and influenced the science fiction genre as we know it. The Russian filmmaker, Pavel Klusjantsev, has had an extraordinary influence on an entire genre of films. Throughout his career at the film studio in St. Petersburg, Klushantsev pioneered and invented legendary techniques for filming the planets, stars and weightnessless - long before anyone else. He went on to redefine the science fiction genre and influence the way Hollywood made their science fiction films, including the Academy Award-winning Visual Effects Master, Robert Skotak, a man who spent years trying to track Klushantsev down. This is a film about a fantastic inventor and dreamer whose destiny was intimately linked with the Space Race and the whims of the Soviet dictatorship. However, despite dying blind and penniless, Klushantsev has left an indelible mark on the history of film and inspired countless filmmakers. The Star Dreamer ensures that the name of Pavel Klushantsev lives on.',NULL,'8.1','[{"id": "0b60f2f39e2842c57fb4a4929a284c7a7794ac2f"}, {"id": "0b60f2f3df00232f298a27cbb32711160c360305"}]');
INSERT INTO "movies" VALUES('tt1736611','Documentary, Biography, Sci-Fi','Daniel Griffith','0b60f2f350405ece5ad187c866c105d7524104ba','Let There Be Light: The Odyssey of Dark Star','Exploring the controversial story behind John Carpenter (Halloween & The Thing) and writer Dan O Bannon''s (Alien & Return of the Living Dead) from first feature film. From its humble beginnings as a USC student film, to its modern day status as a cult masterpiece. It also offers a rare glimpse inside the creative minds of two USC film students... who would eventually go on to change the way horror films are made.',NULL,'6.6','');
INSERT INTO "movies" VALUES('tt3045810','Documentary','Theresa Demarest','0b60f2f350405ece5ad187c866c105d7524104ba','Keiko the Untold Story of the Star of Free Willy','Millions of Free Willy fans around the world finally learn the truth about what really happened when the whale star, Keiko, became the first and only captive orca to be released back into the wild.',NULL,'8.1','');
INSERT INTO "movies" VALUES('tt2273275','Documentary, Drama, Family','Bobbi Jo Hart','0b60f2f34c192c6f5bf8d517cd11c1c38aae8407','I Am Not a Rock Star','Shot over 8 years, I AM NOT A ROCK STAR follows the tumultuous coming-of-age story of Juilliard trained concert pianist Marika Bournaki (age 12 to 20). Intimately exploring universal themes of dreams, sacrifice, love, family, loss and determination, the film ultimately reveals the elusive alchemy of finding one''s purpose in life.',NULL,'7.1','');
