INSERT INTO "movies" VALUES('tt3579168','Comedy','Yû Irie','','Hibi Rock: Puke Afro and the Pop Star','Takuro Hibinuma had no talent for sports or aptitude for studying throughout high school and never had a girlfriend. However, he found his true calling when he began playing rock music. While in high school, he formed a rock band named Rock ''n'' Roll with his friends. After graduation, they move to Tokyo and begin playing live shows. One day, at a live house, Takuro meets a world-renowned idol singer named Saki Utagawa and his fate is irrevocably altered when she asks him to write her a song.',NULL,'5.6','[{"id": "0b60f2f36fb78ef675d344ee8921c09e9188a79f"}, {"id": "0b60f2f3e056f2ad038d36282c91ae9a3bee4f28"}, {"id": "0b60f2f3fca1d21a0d2509cee1b654498fc53dd1"}]');
