INSERT INTO "movies" VALUES('tt0380627','Animation, Adventure, Sci-Fi','Chienshi','0b60f2f34f7bdbe62fd10369ea62bf5c8e81e42d','Phantasy Star II','Somewhere in the deep vastness of space, within the Andromeda Galaxy lies the Algol Star System floating like a dust fleck in a sunbeam. Around the parent star, Algol, whirl its three children: Palm, Mota, and Dezo. Closest to Algo is Palm, the economic and intellectual stronghold of the system. Of the three planets the middle gleamed the brightest like an emerald. This is Mota, a beautiful, beckoning jewel gripped by madness!',NULL,'8.0','');
