INSERT INTO "movies" VALUES('tt1860230','Drama, Romance','Susi Ganesan','0b60f2f37fb829576fd74664eda5be71d7918600','Five Star','Prabhu(Prasanna), Ilango(Krishna), Sundar(Karthik), Priya and Indra are the best of friends at college, swearing to never lose touch with one another later in life. They manage to get jobs in the same company but Ilango, was whisked away to his village by his dictatorial father(Vijayan) and forced into marriage with Eeswari(Kanika). He then runs away while the friends assume that he is in Bombay with his new wife. A few years later the remaining four are still friends, working in the same company and even living in one house. Prabhu meets Eeswari on the train and without knowing that she is Ilango''s wife, falls in love with her. When the truth comes out she becomes good friends with the gang while they promise to find Ilango and reunite them.',NULL,'5.7','');
