INSERT INTO "movies" VALUES('tt0031974','Biography, Comedy, Music','Roy Del Ruth','','The Star Maker','A penniless song writer, Larry Earl, is convinced he is going places in shown business, and convinces Mary, an assistant at an orphanage, to marry him. Fifteen months later they are still in love, but broke as Larry writes songs that won''t sell and loses one job after another one. He stops to watch a group of newsboys singing and dancing, and decides to organize them into the greatest kid act to ever hit vaudeville. Mary persuades Proctor, a big theatrical manager, to book the act, and they are a big hit. Then Larry and his publicity agent, "Speed" King, launch a big publicity stunt---a talent train in which they travel across country holding auditions for young performers. Back in New York, Carlotta Salvini, an ex-OPera singer, brings in her talented fourteen-year-old-daughter, Jane, who has an amazing voice. Larry, to get the mother out of the way, offers Carlotta a forty-week vaudeville tour, and then goes to work to make a star out of Jane, by building Braodway''s first all-kiddie musical revue around her. Opening night has "School Days" as the first act and the show and Jane are a big hit...until the Gerry Society, organized to protect working children, reminds Larry there is a law against children working after 10 p m., and the show closes. Larry''s future appears dim at best.',NULL,'6.0','[{"id": "0b60f2f363c7497f3d25693e2ba301562ebadea5"}, {"id": "0b60f2f3589f4da39bb897e85aac78405eaa7626"}, {"id": "0b60f2f3f0cb94078930a49707f0c695970e1b8f"}, {"id": "0b60f2f3fe5511a1749d1bac968b2627b3193582"}, {"id": "0b60f2f363c7497f3d25693e2ba301562ebadea5"}]');
