INSERT INTO "movies" VALUES('tt0225337','Documentary, Short','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','The Car That Became a Star','At a 1965 international auto show in New York City, the key attraction is not a new car but a 35 year old late 1930s-vintage brilliant yellow colored Phantom II Rolls-Royce limousine. Its claim to fame is that it is the star of the MGM feature film The Yellow Rolls-Royce (1964). For filming, the automobile traveled from London to northern Italy (Pisa and Florence) to Austria to Yugoslavia, along the way encountering its several co-stars including Rex Harrison and Jeanne Moreau in London, Shirley MacLaine, George C. Scott, Art Carney and Alain Delon in Italy, and Ingrid Bergman and Omar Sharif in Austria and Yugoslavia. The limo also encountered many fans interested both in the filming and the vehicle itself. During filming, the limo was well taken care of by a large maintenance crew. In its post filming life, the limousine has even inspired a fashionable clothing line by designer Joan Leslie in, of course, the famous yellow motif.',NULL,'5.4','');
