INSERT INTO "movies" VALUES('tt4644286','Documentary','Jamie Benning','0b60f2f3a49b04dccc7a778932a719201332ffe7','Star Wars Begins: A Filmumentary','Filmmaker Jamie Benning has finally finished his trilogy of documentary-commentaries. This final chapter concentrates on the first Star Wars film. Like his two previous documentaries, Building Empire (2006) and Returning to Jedi (2007), Star Wars Begins is an unofficial look at the creation of the classic movie and features deleted scenes, alternate takes and different angles, bloopers, original on set audio recordings and a huge amount of commentary from cast and crew, culled from every corner of the galaxy.',NULL,'8.2','');
