INSERT INTO "movies" VALUES('tt2306587','Animation, Short, Drama, Family','Chel White','','Jingle & Bell''s Christmas Star','In "Jingle & Bell," Jingle the Husky Pup and his buddy Andrew meet some new friends. A girl Andrew''s age, Sofia, and her Husky pup, Bell, have moved from sunny Palm City to Pineville weeks before Christmas. With no friends yet and not knowing what to expect, Sofia and Bell''s world is upside down and it looks like it might be the worst Christmas ever. But with a little help from Jingle and Andrew, Sofia and Bell will soon discover that Christmas joy isn''t about where you are -- it''s about who you are with!',NULL,'7.5','[{"id": "0b60f2f353b5715a9d6b6a516a0fbc71ea47ea26"}, {"id": "0b60f2f3391fa9752111349dda5d4fb3106b339d"}, {"id": "0b60f2f3982d6377bfa9ceeca7e4454cbaaa74ff"}]');
