INSERT INTO "movies" VALUES('tt0367885','Documentary','Donald R. Beck','','Inside Star Trek: The Real Story','Who directed the pilot for the original Star Trek series? Where was it filmed? Who really built the Enterprise? You may own The Star Trek Encyclopedia, and you may have seen every episode, but you still don''t have all the answers! For the first time, the men and women who worked behind the scenes on the most popular science fiction telelvision series ever created invite you to go boldly where no fan has gone before. In-depth interviews will introduce you to the writers, directors, producers, technicians and artists who breathed life into the original Star Trek series. You''ll discover their greatest joys, their deepest sorrows and everything else you ever wanted to know about the greatest show in the galaxy. There are no actors and no special effects. Just the truth.',NULL,'6.8','[{"id": "0b60f2f3348f5fe033e6221a6ff9b138641f5bf7"}, {"id": "0b60f2f3016d58e782cae069b3a1edc45e2bae5f"}]');
