INSERT INTO "movies" VALUES('tt1212911','Documentary, Music','Justin McConnell','0b60f2f357740e14496ac05c9145f37b66d90483','Working Class Rock Star','The music industry is changing, record sales are down, artists are making less money, and mediocrity holds sway. Yet there are more bands than ever before working for years just to receive even the tiniest drop of success. Following the lives and careers of Tub Ring, Bloodshoteye, and 3 Mile Scream, with supporting interviews from major players in the heavy music scene, this documentary sheds light on why some bands never make it and why the ones that break realize only too soon that life on a label is only the beginning of their troubles.',NULL,'7.0','');
