INSERT INTO "movies" VALUES('tt3981582','Animation, Drama, History','Toshio Hirata, Satoru Namekawa','','Rail of the Star','A young Japanese actress remembers her war childhood in Korea. Her father goes to fight, her baby sister Miko dies of typhoid, her beloved Korean maid Ohana is fired due to a mistake which could cost Chiko her life... By and by Chiko realizes that the country is being ruled by the Japanese and the Koreans are persecuted. When the war ends, the Koreans chase the Japanese rule and the roles change. Now Chiko''s family is unwanted. But then the Russians come and this is the end. They have to burn all the pictures to avoid all suspicions... even Miko''s picture. But when the Russians come to their house, they decide to flee over the 38th Parallel towards freedom. A group of men, women, children struggles along the mountains, led by the light of the Northern Star. Along the way they meet a Korean man, who is willing to help them to escape the Russian soldiers although his family was killed by the Japanese.',NULL,'7.6','[{"id": "0b60f2f39daf82cb507574e4d0a03de70b88bac5"}, {"id": "0b60f2f3478d08f42c9ca6b3520a37ce119707f8"}, {"id": "0b60f2f3742394292d6681c72ea01fe8d06069c4"}]');
