INSERT INTO "movies" VALUES('tt0854159','Documentary','Gene Feldman, Suzette Winter','','Robert Mitchum: The Reluctant Star','This retrospective of Robert Mitchum begins with his troubled childhood and unconventional development, his beginnings as a bad guy in B-Westerns during the early 40s, his breakthrough role in "The Story of G. I. Joe," his early stardom at RKO, his controversial arrest on marijuana possession charges, and his emergence as a superstar. Mitchum himself discusses his attitude toward his celebrity and career with a complete lack of pretension. Film clips from some of his notable films are seen along with interviews with brother John, son Chris, friends, and co-workers.',NULL,'7.2','[{"id": "0b60f2f32e3dc72fc99f4e404086684d08f520ff"}, {"id": "0b60f2f32e99d224217e61ad38abf9e7d590ee20"}]');
