INSERT INTO "movies" VALUES('tt4325422','Documentary, Biography, Comedy','Justin Johnson','0b60f2f34c4e04d83959b7704d790830f91afe3b','Double Digits: The Story of a Neighborhood Movie Star','Deep in the recesses of YouTube there is an ingenious artist who cannot be stopped. Despite having almost no audience, he consistently churns out 3-4 original feature-length films a year. He''s made action movies, horror movies, westerns and more. He''s not rich, he has no crew, no formal training and aside from his action figures, plays virtually every part. Welcome to the inspiring, imaginative, and often handmade world of Ultra-DIY filmmaker Richard ''R.G.'' Miller, a 50 year-old man who creates impossible blockbusters from his tiny studio apartment in Wichita, Kansas.',NULL,'9.1','');
INSERT INTO "movies" VALUES('tt0033697','Musical','John Paddy Carstairs','','He Found a Star','When Lucky Lyndon decides to start a new talent agency, he persuades highly efficient Ruth Cavour to leave her current job and work as his secretary. Lyndon devotes his agency to finding and representing unknowns who need an opportunity. After a very slow start, Lyndon finally has his first success when he makes some changes in singer Frank Forrester''s routine, leading to sudden success. As the business grows, Lyndon becomes closely involved professionally and personally with Suzanne, an opportunistic night club singer. The changes that she brings about in Lyndon are an increasing source of despair for the loyal, devoted Ruth.',NULL,'5.2','[{"id": "0b60f2f3a5157a8e07dc5577375e680c8b785d00"}, {"id": "0b60f2f3f35f6eccca8665954855bbfb1ce4c205"}, {"id": "0b60f2f3e23e5e18dc4e5da9b8406ee8f5ae5eb4"}]');
