INSERT INTO "movies" VALUES('tt2515134','Drama','Thomas K. Phillips','','The North Star','The North Star is the story of Benjamin "Big Ben" Jones and Moses Hopkins, two slaves who escaped from a Virginia plantation and made their way to freedom in Buckingham, Pennsylvania in 1849. Big Ben''s 6 foot 10 inch size and a record bounty for his safe return make him the focus of every slave hunter on the east coast. Their journey exposes them to danger and cruelty; however it also exposes them to the unexpected kindness of the people involved in the Underground Railroad. These experiences will change Ben and Moses forever. Upon reaching the relative safety of Mt. Gilead Church on Buckingham Mountain, Ben and Moses get to experience life as free men and cross paths with historical figures such as Frederick Douglass, Harriet Tubman, Joshua and Jonathan Fell. Their freedom also allows them to experience heroism, romance and treachery.',NULL,'5.5','[{"id": "0b60f2f3c0c8410b9f2191471bdbd93c533af8a1"}, {"id": "0b60f2f3d8bd21c993dd0ef7c06571a5125b4799"}, {"id": "0b60f2f398bdfabfefaea6132a48726240bd652c"}]');
