INSERT INTO "movies" VALUES('tt1831832','Drama, Sci-Fi','Zi''en Cui','0b60f2f3e7eac5df4c7f18fdd9171950c5c80430','Star Appeal','Chinese activist filmmaker Cui Zi''en crafts the first all gay Chinese science fiction film with this fantastical tale of a lonely extraterrestrial who learns a tender lesson in earthly love after being taken in by a curious bisexual. When Xiao Bo first saw the curious alien, he was alone and naked on a long stretch of highway. He claimed to be from Mars, so Xiao Bo brought him home in order to teach him a thing or two about life on Earth. Dubbed "ET" by his human hosts, the curious alien soon reveals that he has been sent to this planet in order to learn as much as possible about physical interaction. Bisexual Xiao Bo has both a girlfriend and a boyfriend, neither of whom are particularly thrilled that Xiao Bo has brought home a new lover. Later, when Xiao Bo''s girlfriend attempts to have a child with "ET," the alien falls into a deep coma. Now the way to revive "ET" is for Xiao Bo to utter the words "I love you." Once that happens, Xiao Bo resolves to teach his extraterrestrial friend the true meaning of Earthly Love before "ET" travels back to his home planet to reveal his passionate findings.',NULL,'4.1','');
INSERT INTO "movies" VALUES('tt5199836','Documentary, Short','Charles de Lauzirika','0b60f2f350405ece5ad187c866c105d7524104ba','Star Wars: Launch Bay - Meet the Makers','Presented as part of the STAR WARS: LAUNCH BAY experience at Disneyland and Disney''s Hollywood Studios, "Meet the Makers" is a featurette exploring the past, present and future of the STAR WARS franchise, including interviews with the new generation of storytellers behind the Saga.',NULL,'6.4','');
