INSERT INTO "movies" VALUES('tt0455776','Action, Sci-Fi','N/A','0b60f2f384ddb8a3a34f5ef94c10b0ffe9422c40','Soul Star','Soulstar is a 3D shoot-''em up that combines several different types of gameplay into one game. Some levels in this game are on a fixed path, similar to Space Harrier or Star Fox. Other levels allow your space craft to hover freely around a 3D environment, and in other levels your craft transforms into a walker robot for close-up attacks. In Soulstar you are a warrior pilot known as Bryk Hammelt. It is your mission to prevent an alien aggressor known as the Myrkoids from draining the Soulstar system of its energy resources.',NULL,'6.6','');
INSERT INTO "movies" VALUES('tt0479885','Short, Drama','Turgut Turk Adiguzel','0b60f2f306026d5118420c9490fb96ac80886706','Crescent Star','In 1944, the Germans began rounding up the Jews of Rhodes. The Turkish Consul General, Selahattin Ulkumen, interceded on behalf of those Jewish who were Turkish nationals. By his efforts, 42 Jewish families were set free from the deportation to Auschwitz-Birkenau. In reprisal, German planes bombed the consulate building and Ulkumen''s house, killing his staff and pregnant wife. His sacrifice made consul Selahattin Ulkumen the first non-Christian to be declared a Righteous Gentile by Yad Vashem, Israel''s Holocaust memorial.',NULL,'7.9','');
