INSERT INTO "movies" VALUES('tt0083484','Comedy','N/A','0b60f2f350405ece5ad187c866c105d7524104ba','Star of the Family','Fire Captain Buddy Krebs'' 16-year-old daughter Jennie Lee begins getting show-business offers because of her singing talents in the country/pop genre. This scares Buddy because he does not want his daughter to grow up too fast. Adding to his troubles, are (1) his wife runs off with a bellhop, (2) his 17-year-old son has muscle instead of brains in his head, (3) his crew down at the firehouse are "strange": Feldmand tells his mother he is a doctor instead of a fireman, Rosetti has only sex on the brain and Max, a Hispanic, speaks fractured English. Finally, his daughter signs with a manager named Moose; the name fits the description of the woman.',NULL,'7.2','');
INSERT INTO "movies" VALUES('tt0032724','Western','George Sherman','','Lone Star Raiders','Dust storms and drought make herding horses a tough job for the boys. When the new owner of the ranch, Lydia Phelps, shows up, the ranch is in dire financial straits. The Martin Ranch has ...',NULL,'8.2','[{"id": "0b60f2f3dc3adae5e1cf9612a5d6fe0d2a1a8ead"}, {"id": "0b60f2f3aeee2b38659d41d488369ebb9eaed3fe"}, {"id": "0b60f2f31c5de69cf923e4bd77b6fc84a83777f5"}, {"id": "0b60f2f34086fc268b65f542b2e2544769eec66c"}]');
