INSERT INTO "movies" VALUES('tt0415245','Drama','Ned Ambler','0b60f2f38b54b73eff63860dac2129c1be4c6b17','Rock Star','ROCK STAR: Shot by famed cinematographer, Jim Fealy ("Chop Suey", "Doom Generation") at fashion photographer Steven Klein''s studio, ROCK STAR features Theo (of all-girl punk band Lunachicks) as Heaven Scent, an agorophobic rock star preparing for a big show at Madison Square Garden as a calvacade of transsexuals, punk rockers on motorbikes, rival musicians, and a bitchy dominatrix and her Russian muscle slave, drop by her loft. Including rockers Miss Guy (of Toilet Boys); Chloe Dzubilo and Gyda Gash (of Transsisters); Gina, Squid, and Chip (of Lunachicks); Jonny Cragg (of Spacehog); with actor Michael Cavadias ( "Wonder Boys"), James Chinlund (CK1 and CK Jeans model / Set designer) and painter Walt Paper as the spirit of Klaus Nomi. It also features hair and make-up by Clyde Haygood, and styling by Victoria Bartlett.',NULL,'5.7','');
